CREATE FUNCTION public.delete_student_assignment_data(arg_user_id bigint DEFAULT NULL::bigint, arg_section_id bigint DEFAULT NULL::bigint, arg_assignment_id bigint DEFAULT NULL::bigint) RETURNS SETOF bigint
    LANGUAGE plpgsql
    AS $$
BEGIN
  ASSERT arg_user_id IS NOT NULL OR
         arg_section_id IS NOT NULL OR
         arg_assignment_id IS NOT NULL,
  'All input parameters are NULL. This is most likely an error.';
  RAISE NOTICE 'delete sad for user %, assignment %, section %', arg_user_id, arg_assignment_id, arg_section_id;
  RETURN QUERY
  DELETE FROM student_assignment_data
  USING student_assignment_data AS self
    JOIN assignments ON assignments.id = self.assignment_id
    JOIN section_assignments ON section_assignments.assignment_id = self.assignment_id
    JOIN course_users ON course_users.user_id = self.user_id AND
                         course_users.section_id = section_assignments.section_id
  WHERE self.id = student_assignment_data.id AND
        course_users.discriminator = 'student' AND
        (arg_assignment_id IS NULL OR self.assignment_id = arg_assignment_id) AND
        (arg_user_id IS NULL OR self.user_id = arg_user_id) AND
        (arg_section_id IS NULL OR section_assignments.section_id = arg_section_id)
  RETURNING student_assignment_data.id;
END;
$$;
