CREATE FUNCTION public.get_natural_sort_name(text) RETURNS text
    LANGUAGE sql IMMUTABLE STRICT
    AS $_$
SELECT string_agg(coalesce(r [2], length(length(r [1]) :: TEXT) || length(r [1]) :: TEXT || r [1]), '')
FROM regexp_matches($1, '0*([0-9]+)|([^0-9]+)', 'g') r;
$_$;
