CREATE FUNCTION public.insert_student_assignment_data(arg_user_id bigint DEFAULT NULL::bigint, arg_section_id bigint DEFAULT NULL::bigint, arg_assignment_id bigint DEFAULT NULL::bigint) RETURNS SETOF public.student_assignment_data
    LANGUAGE plpgsql
    AS $$
BEGIN
  ASSERT arg_user_id IS NOT NULL OR
         arg_section_id IS NOT NULL OR
         arg_assignment_id IS NOT NULL,
  'All input parameters are NULL. This is most likely an error.';
  RAISE NOTICE 'insert sad for user %, assignment %, section %', arg_user_id, arg_assignment_id, arg_section_id;
  RETURN QUERY
    SELECT
      nextval('sequence_student_assignment_data'),
      course_users.user_id,
      assignments.id,
      NULL,
      NULL,
      NULL,
      NULL
    FROM assignments
      JOIN section_assignments ON section_assignments.assignment_id = assignments.id
      JOIN course_users ON course_users.section_id = section_assignments.section_id
    WHERE course_users.discriminator = 'student' AND
          (arg_section_id IS NULL OR section_assignments.section_id = arg_section_id) AND
          (arg_assignment_id IS NULL OR assignments.id = arg_assignment_id) AND
          (arg_user_id IS NULL OR course_users.user_id = arg_user_id)
  ON CONFLICT DO NOTHING
  RETURNING student_assignment_data.*;
  PERFORM update_student_assignment_data(
      arg_user_id := arg_user_id,
      arg_assignment_id := arg_assignment_id,
      arg_section_id := arg_section_id
  );
END;
$$;
CREATE FUNCTION public.insert_student_course_data(arg_user_id bigint DEFAULT NULL::bigint, arg_course_id bigint DEFAULT NULL::bigint) RETURNS SETOF bigint
    LANGUAGE plpgsql
    AS $$
BEGIN
  ASSERT arg_user_id IS NOT NULL OR
         arg_course_id IS NOT NULL,
  'All input parameters are NULL. This is most likely an error.';
  RAISE NOTICE 'insert scd for user %, course %', arg_user_id, arg_course_id;
  RETURN QUERY
    SELECT
      nextval('sequence_student_course_data'),
      arg_user_id,
      arg_course_id,
      NULL,
      NULL
    FROM course_users
      JOIN sections ON sections.course_id = arg_course_id AND course_users.section_id = sections.id
    WHERE course_users.discriminator = 'student' AND arg_user_id = course_users.user_id
  ON CONFLICT DO NOTHING
  RETURNING student_course_data.id;
  PERFORM update_student_course_data(
      arg_user_id := arg_user_id,
      arg_course_id := arg_course_id
  );
END;
$$;
CREATE FUNCTION public.insert_student_exercise_data(arg_exercise_id bigint DEFAULT NULL::bigint, arg_user_id bigint DEFAULT NULL::bigint, arg_section_id bigint DEFAULT NULL::bigint, arg_assignment_id bigint DEFAULT NULL::bigint) RETURNS SETOF bigint
    LANGUAGE plpgsql
    AS $$
BEGIN
  ASSERT arg_exercise_id IS NOT NULL OR
         arg_user_id IS NOT NULL OR
         arg_section_id IS NOT NULL OR
         arg_assignment_id IS NOT NULL,
  'All input parameters are NULL. This is most likely an error.';
  RAISE NOTICE 'insert sed for user %, exercise %, section %, assignment %', arg_user_id, arg_exercise_id, arg_section_id, arg_assignment_id;
  RETURN QUERY
    SELECT
      nextval('sequence_student_exercise_data'),
      course_users.user_id,
      exercises.id,
      NULL,
      NULL
    FROM exercises
             JOIN exercise_group ON exercises.group_id = exercise_group.id
             JOIN section_assignments ON section_assignments.assignment_id = exercise_group.assignment_id
             JOIN course_users ON course_users.section_id = section_assignments.section_id
    WHERE course_users.discriminator = 'student'
      AND (arg_exercise_id IS NULL OR exercises.id = arg_exercise_id)
      AND (arg_section_id IS NULL OR section_assignments.section_id = arg_section_id)
      AND (arg_assignment_id IS NULL OR exercise_group.assignment_id = arg_assignment_id)
      AND (arg_user_id IS NULL OR course_users.user_id = arg_user_id)
  ON CONFLICT DO NOTHING
  RETURNING student_exercise_data.id;
  PERFORM update_student_exercise_data(
      arg_exercise_id := arg_exercise_id,
      arg_user_id := arg_user_id,
      arg_section_id := arg_section_id,
      arg_assignment_id := arg_assignment_id
  );
END;
$$;
CREATE FUNCTION public.insert_student_exercise_problem_data(arg_exercise_id bigint DEFAULT NULL::bigint, arg_user_id bigint DEFAULT NULL::bigint, arg_section_id bigint DEFAULT NULL::bigint, arg_assignment_id bigint DEFAULT NULL::bigint, arg_descriptor_id bigint DEFAULT NULL::bigint) RETURNS SETOF bigint
    LANGUAGE plpgsql
    AS $$
BEGIN
  ASSERT arg_exercise_id IS NOT NULL OR
         arg_user_id IS NOT NULL OR
         arg_section_id IS NOT NULL OR
         arg_assignment_id IS NOT NULL OR
         arg_descriptor_id IS NOT NULL,
  'All input parameters are NULL. This is most likely an error.';
  RAISE NOTICE 'insert sepd for user %, exercise %, descriptor %, assignment %, section %', arg_user_id, arg_exercise_id, arg_descriptor_id, arg_assignment_id, arg_section_id;
  RETURN QUERY
        SELECT nextval('sequence_student_exercise_problem_data'),
               course_users.user_id,
               content.descriptor_id,
               exercises.id,
               NULL,
               NULL,
               pool_exercise_problem_distribution.index
        FROM exercises
                 JOIN exercise_group ON exercise_group.id = exercises.group_id
                 JOIN assignments ON exercise_group.assignment_id = assignments.id
             JOIN section_assignments ON assignments.id = section_assignments.assignment_id
             JOIN course_users ON course_users.section_id = section_assignments.section_id
             LEFT JOIN single_exercises ON single_exercises.id = exercises.id
             LEFT JOIN pool_exercises ON pool_exercises.id = exercises.id
             LEFT JOIN pool_exercise_problem_distribution ON pool_exercise_problem_distribution.exercise_id = pool_exercises.id AND
                                                      pool_exercise_problem_distribution.user_id = course_users.user_id
             LEFT JOIN content ON content.id = COALESCE(pool_exercise_problem_distribution.problem_id, single_exercises.problem_id)
    WHERE course_users.discriminator = 'student'
      AND content.id IS NOT NULL
      AND
          (arg_exercise_id IS NULL OR exercises.id = arg_exercise_id)AND
          (arg_section_id IS NULL OR section_assignments.section_id = arg_section_id)AND (arg_assignment_id IS NULL OR exercise_group.assignment_id = arg_assignment_id)
      AND (arg_user_id IS NULL OR course_users.user_id = arg_user_id)
      AND (arg_descriptor_id IS NULL OR content.descriptor_id = arg_descriptor_id)
        GROUP BY course_users.user_id, exercises.id, content.id, index
  ON CONFLICT DO NOTHING
  RETURNING student_exercise_problem_data.id;
  PERFORM update_student_exercise_problem_data(
      arg_assignment_id := arg_assignment_id,
      arg_exercise_id := arg_exercise_id,
      arg_user_id := arg_user_id,
      arg_section_id := arg_section_id,
      arg_descriptor_id := arg_descriptor_id
  );
END;
$$;
CREATE FUNCTION public.update_fulltext_on_update_content_trigger_fn() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    wiki_text TEXT;
    content_descriptor_uuid TEXT;
BEGIN
    SELECT wikis.text, content_descriptor.uuid
    INTO wiki_text, content_descriptor_uuid
    FROM problems
        JOIN wikis ON problems.statement_id = wikis.id
        JOIN content on problems.id = content.id
        JOIN content_descriptor on content.descriptor_id = content_descriptor.id
    WHERE problems.id = new.id;
    UPDATE problems
    SET fulltext = (setweight(to_tsvector('grd_ts_configuration', coalesce(new.name, '')), 'A') ||
                    setweight(to_tsvector('grd_ts_configuration', coalesce(wiki_text, '')), 'B') ||
                    setweight(to_tsvector('grd_ts_configuration', coalesce(content_descriptor_uuid, '')), 'C'))
    WHERE problems.id = new.id;
    RETURN new;
END;
$$;
CREATE FUNCTION public.update_fulltext_on_update_problem_trigger_fn() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    content_name VARCHAR(128);
BEGIN
    SELECT content.name INTO content_name FROM content WHERE content.id = new.id;
    new.fulltext = setweight(to_tsvector('grd_ts_configuration', coalesce(content_name, '')), 'A') ||
                   setweight(to_tsvector('grd_ts_configuration', coalesce(new.wikitext, '')), 'B');
  RETURN new;
END;
$$;
CREATE FUNCTION public.update_fulltext_on_update_wiki_trigger_fn() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
UPDATE problems
SET fulltext = setweight(to_tsvector('grd_ts_configuration', coalesce(content.name, '')), 'A') ||
               setweight(to_tsvector('grd_ts_configuration', coalesce(new.text, '')), 'B') ||
               setweight(to_tsvector('grd_ts_configuration', coalesce(content_descriptor.uuid, '')), 'C') FROM content JOIN content_descriptor ON content.descriptor_id = content_descriptor.id
WHERE content.id = problems.id and problems.statement_id = new.id;
RETURN new;
END;
$$;
CREATE FUNCTION public.update_natural_name() RETURNS trigger
    LANGUAGE plpgsql
    AS $_$
DECLARE
  column_value TEXT;
  natural_name TEXT;
BEGIN
  --   TG_ARGV[0]       column name
  --   TG_ARGV[1]       natural column name
  EXECUTE format('SELECT ($1)."%I"::text', TG_ARGV [0])
  INTO column_value
  USING NEW;
  natural_name = get_natural_sort_name(column_value);
  EXECUTE format('UPDATE %I SET %I = $1::text WHERE id = $2::bigint', TG_TABLE_NAME, TG_ARGV [1])
  USING natural_name, NEW.id;
  RETURN NEW;
END;
$_$;
CREATE FUNCTION public.update_sd_on_delete_course_users_trigger_fn() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  RAISE NOTICE '% for course %, user %', tg_name, old.course_id, old.user_id;
  PERFORM delete_student_exercise_problem_data(arg_section_id := old.section_id, arg_user_id := old.user_id);
  PERFORM delete_student_exercise_data(arg_section_id := old.section_id, arg_user_id := old.user_id);
  PERFORM delete_student_assignment_data(arg_section_id := old.section_id, arg_user_id := old.user_id);
  PERFORM delete_student_course_data(arg_course_id := old.course_id, arg_user_id := old.user_id);
  RETURN old;
END;
$$;
CREATE FUNCTION public.update_sd_on_delete_exercises_trigger_fn() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    RAISE NOTICE '% for exercise %', tg_name, old.id;
    PERFORM delete_student_exercise_problem_data(arg_exercise_id := old.id);
    PERFORM delete_student_exercise_data(arg_exercise_id := old.id);
    PERFORM update_student_assignment_data(arg_assignment_id := exercise_group.assignment_id)
    FROM exercise_group
    WHERE exercise_group.id = old.group_id;
    PERFORM update_student_course_data(arg_course_id := assignments.course_id)
    FROM exercise_group
             JOIN assignments on exercise_group.assignment_id = assignments.id
    WHERE exercise_group.id = old.group_id;
    RETURN old;
END;
$$;
CREATE FUNCTION public.update_sd_on_delete_pool_exercise_problem_distribution_trigger_() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  RAISE NOTICE '% for user %, exercise %, problem %', tg_name, old.user_id, old.exercise_id, old.problem_id;
  PERFORM
  delete_student_exercise_problem_data(
          arg_exercise_id := old.exercise_id,
          arg_user_id := old.user_id,
          arg_descriptor_id := content.descriptor_id)
  FROM content
  WHERE content.id = old.problem_id;
  PERFORM update_student_exercise_data(arg_exercise_id := old.exercise_id, arg_user_id := old.user_id);
  PERFORM update_student_assignment_data(arg_assignment_id := exercise_group.assignment_id, arg_user_id := old.user_id)
  FROM exercises
           JOIN exercise_group on exercises.group_id = exercise_group.id
  WHERE exercises.id = old.exercise_id;
  PERFORM update_student_course_data(arg_course_id := assignments.course_id, arg_user_id := old.user_id)
  FROM exercises
           JOIN exercise_group ON exercises.group_id = exercise_group.id
           JOIN assignments ON exercise_group.assignment_id = assignments.id
  WHERE exercises.id = old.exercise_id;
  RETURN old;
END;
$$;
