CREATE FUNCTION public.update_sd_on_update_exercises_trigger_fn() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF (
           SELECT DISTINCT count(exercise_group.assignment_id)
           FROM exercise_group
           WHERE exercise_group.id = old.group_id
              OR exercise_group.id = new.group_id
       ) = 1
    THEN
        RETURN NULL;
    END IF;
    RAISE NOTICE '% for exercise % from % to %', tg_name, old.id, old.group_id, new.group_id;
    PERFORM delete_student_exercise_problem_data(arg_exercise_id := new.id);
    PERFORM delete_student_exercise_data(arg_exercise_id := new.id);
    PERFORM insert_student_exercise_problem_data(arg_exercise_id := new.id);
    PERFORM insert_student_exercise_data(arg_exercise_id := new.id);
    PERFORM update_student_assignment_data(arg_assignment_id := exercise_group.assignment_id)
    FROM exercise_group
    WHERE exercise_group.id = old.group_id;
    PERFORM update_student_assignment_data(arg_assignment_id := exercise_group.assignment_id)
    FROM exercise_group
    WHERE exercise_group.id = new.group_id;
    PERFORM update_student_course_data(arg_course_id := assignments.course_id)
    FROM exercise_group
             JOIN assignments on exercise_group.assignment_id = assignments.id
    WHERE exercise_group.id = new.group_id;
    RETURN NULL;
END;
$$;
