CREATE FUNCTION public.update_sd_on_update_solutions_trigger_fn() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE solution SOLUTIONS;
BEGIN
  CASE tg_op
    WHEN 'INSERT', 'UPDATE'
    THEN solution := new;
    WHEN 'DELETE'
    THEN solution := old;
  END CASE;
  RAISE NOTICE '% for solution %', tg_name, solution.id;
  IF solution.discriminator != 'EXERCISE'
  THEN RETURN NULL;
  END IF;
  PERFORM
  update_student_exercise_problem_data(
          arg_user_id := solution.author_id,
          arg_exercise_id := solution.exercise_id,
          arg_descriptor_id := content.descriptor_id)
  FROM content
  WHERE content.id = solution.problem_id;
  PERFORM update_student_exercise_data(arg_user_id := solution.author_id, arg_exercise_id := solution.exercise_id);
  PERFORM update_student_assignment_data(arg_user_id := solution.author_id, arg_assignment_id := exercise_group.assignment_id)
  FROM exercises
           JOIN exercise_group ON exercises.group_id = exercise_group.id
  WHERE exercises.id = solution.exercise_id;
  PERFORM update_student_course_data(arg_user_id := solution.author_id, arg_course_id := assignments.course_id)
  FROM exercises
           JOIN exercise_group ON exercises.group_id = exercise_group.id
           JOIN assignments on exercise_group.assignment_id = assignments.id
  WHERE exercises.id = solution.exercise_id;
  RETURN NULL;
END;
$$;
