CREATE FUNCTION public.update_student_assignment_data(arg_user_id bigint DEFAULT NULL::bigint, arg_section_id bigint DEFAULT NULL::bigint, arg_assignment_id bigint DEFAULT NULL::bigint) RETURNS SETOF bigint
    LANGUAGE plpgsql
    AS $$
BEGIN
    ASSERT arg_user_id IS NOT NULL OR
           arg_assignment_id IS NOT NULL OR
           arg_section_id IS NOT NULL,
        'All input parameters are NULL. This is most likely an error.';
    RAISE NOTICE 'update sad for user %, assignment %, section %', arg_user_id, arg_assignment_id, arg_section_id;
    RETURN QUERY
        WITH collected_data AS (
            SELECT student_assignment_data.id,
                   (CASE
                        WHEN count(included_exercise_data_without_ignored.score) = 0
                            THEN NULL
                        WHEN assignments_config.assignment_grading_schema = 'normalized_sum'
                            THEN round(
                                (sum(included_exercise_data_without_ignored.score) :: DOUBLE PRECISION
                                     /
                                 sum(included_exercise_data_without_ignored.max_score) :: DOUBLE PRECISION
                                    *
                                 100) :: NUMERIC,
                                2)
                        WHEN assignments_config.assignment_grading_schema = 'total_sum'
                            THEN sum(included_exercise_data_without_ignored.score) :: DOUBLE PRECISION
                       END)
                                                               AS score,
                   round(
                           (sum(included_exercise_data_without_ignored.score) :: DOUBLE PRECISION
                                /
                            sum(included_exercise_data_without_ignored.max_score) :: DOUBLE PRECISION
                               *
                            100) :: NUMERIC,
                           2)
                                                               AS normalized_sum_score,
                   sum(included_exercise_data_without_ignored.score) :: DOUBLE PRECISION
                                                               AS total_sum_score,
                   (CASE
                        WHEN count(included_exercise_data_without_ignored.score) = 0
                            THEN NULL
                        ELSE round(
                                (sum(included_exercise_data_without_ignored.score) :: DOUBLE PRECISION
                                     /
                                 sum(included_exercise_data_without_ignored.max_score) :: DOUBLE PRECISION
                                    *
                                 100) :: NUMERIC,
                                2)
                       END)
                                                               AS progress,
                   (CASE
                        WHEN count(included_exercise_data.solving_time) = 0
                            THEN NULL
                        ELSE sum(included_exercise_data.solving_time) END)
                                                               AS solving_time,
                   min(included_exercise_data.started_at)
                                                               AS start_time,
                   (CASE
                        WHEN count(included_exercise_data_without_ignored.*) = 0
                            THEN NULL
                        WHEN assignments_config.assignment_grading_schema = 'normalized_sum'
                            THEN 100
                        WHEN assignments_config.assignment_grading_schema = 'total_sum'
                            THEN sum(included_exercise_data_without_ignored.max_score) :: DOUBLE PRECISION
                       END)
                                                               AS max_score,
                   max(included_exercise_data.last_submission) AS last_submission
            FROM student_assignment_data
                     JOIN assignments_config ON assignments_config.assignment_id = student_assignment_data.assignment_id
                     JOIN exercise_group ON exercise_group.assignment_id = assignments_config.assignment_id
                     JOIN exercises ON exercises.group_id = exercise_group.id
                     LEFT JOIN student_exercise_data included_exercise_data
                               ON included_exercise_data.user_id = student_assignment_data.user_id AND included_exercise_data.exercise_id = exercises.id
                     LEFT JOIN (
                SELECT student_exercise_data.*
                FROM student_exercise_data
                         INNER JOIN exercises e ON student_exercise_data.exercise_id = e.id
                         INNER JOIN exercise_config c2 ON e.id = c2.exercise_id
                WHERE c2.ignore_score = FALSE
            ) included_exercise_data_without_ignored ON included_exercise_data_without_ignored.id = included_exercise_data.id
            WHERE (arg_assignment_id IS NULL OR student_assignment_data.assignment_id = arg_assignment_id)
              AND (arg_user_id IS NULL OR student_assignment_data.user_id = arg_user_id)
              AND (arg_section_id IS NULL OR EXISTS(SELECT 1
                                                    FROM section_assignments
                                                    WHERE section_assignments.section_id = arg_section_id
                                                      AND section_assignments.assignment_id = student_assignment_data.assignment_id))
            GROUP BY student_assignment_data.id, assignments_config.assignment_grading_schema
            )
            UPDATE student_assignment_data
                SET
                    score = collected_data.score,
                    normalized_sum_score = collected_data.normalized_sum_score,
                    total_sum_score = collected_data.total_sum_score,
                    progress = collected_data.progress,
                    solving_time = collected_data.solving_time,
                    started_at = collected_data.start_time,
                    max_score = collected_data.max_score,
                    last_submission = collected_data.last_submission
                FROM collected_data
                WHERE student_assignment_data.id = collected_data.id AND
                      (student_assignment_data.score IS DISTINCT FROM collected_data.score OR
                       student_assignment_data.normalized_sum_score IS DISTINCT FROM collected_data.normalized_sum_score OR
                       student_assignment_data.total_sum_score IS DISTINCT FROM collected_data.total_sum_score OR
                       student_assignment_data.progress IS DISTINCT FROM collected_data.progress OR
                       student_assignment_data.solving_time IS DISTINCT FROM collected_data.solving_time OR
                       student_assignment_data.started_at IS DISTINCT FROM collected_data.start_time OR
                       student_assignment_data.max_score IS DISTINCT FROM collected_data.max_score OR
                       student_assignment_data.last_submission IS DISTINCT FROM collected_data.last_submission)
                RETURNING student_assignment_data.id;
END;
$$;
CREATE FUNCTION public.update_student_course_data(arg_user_id bigint DEFAULT NULL::bigint, arg_course_id bigint DEFAULT NULL::bigint) RETURNS SETOF bigint
    LANGUAGE plpgsql
    AS $$
BEGIN
  ASSERT arg_user_id IS NOT NULL OR
         arg_course_id IS NOT NULL,
  'All input parameters are NULL. This is most likely an error.';
  RAISE NOTICE 'update scd for user %, course %', arg_user_id, arg_course_id;
  RETURN QUERY
  UPDATE student_course_data
  SET
    progress   = sq.progress,
    spent_time = sq.spent_time
  FROM (
      WITH user_and_course AS (
          SELECT university_users.id AS user_id, courses.id AS course_id
          FROM university_users,
               courses
          WHERE (arg_user_id IS NULL OR university_users.id = arg_user_id)
            AND (arg_course_id IS NULL OR courses.id = arg_course_id)
      ),
           assignment_exercise_ignored AS (
               SELECT assignments.id, ec.ignore_score
               FROM assignments
                        JOIN exercise_group eg ON assignments.id = eg.assignment_id
                        JOIN exercises e ON eg.id = e.group_id
                        JOIN exercise_config ec ON e.id = ec.exercise_id
               where (arg_course_id IS NULL OR assignments.course_id = arg_course_id)
           )
      SELECT user_and_course.user_id,
                user_and_course.course_id,
                round((sum(student_assignment_data.progress * COALESCE(assignments_config.score_weight, 1)) FILTER (WHERE assignments.published_at IS NOT NULL) / sum(COALESCE(assignments_config.score_weight, 1)) FILTER (WHERE assignments.published_at IS NOT NULL)) :: NUMERIC, 2) AS progress,
                sum(student_assignment_data.solving_time) FILTER (WHERE assignments.published_at IS NOT NULL) AS spent_time
      FROM user_and_course
           LEFT JOIN student_assignment_data ON student_assignment_data.user_id = user_and_course.user_id
           LEFT JOIN assignments_config ON assignments_config.assignment_id = student_assignment_data.assignment_id
           LEFT JOIN assignments ON assignments.id = student_assignment_data.assignment_id AND assignments.course_id = user_and_course.course_id
      WHERE EXISTS(SELECT * FROM assignment_exercise_ignored WHERE ignore_score = FALSE AND id = assignments.id) AND COALESCE(assignments_config.score_weight, 1) > 0
      GROUP BY user_and_course.user_id, user_and_course.course_id
       ) AS sq
  WHERE student_course_data.user_id = sq.user_id AND student_course_data.course_id = sq.course_id
  RETURNING student_course_data.id;
END;
$$;
CREATE FUNCTION public.update_student_exercise_data(arg_exercise_id bigint DEFAULT NULL::bigint, arg_user_id bigint DEFAULT NULL::bigint, arg_section_id bigint DEFAULT NULL::bigint, arg_assignment_id bigint DEFAULT NULL::bigint) RETURNS SETOF bigint
    LANGUAGE plpgsql
    AS $$
BEGIN
  ASSERT arg_exercise_id IS NOT NULL OR
         arg_user_id IS NOT NULL OR
         arg_section_id IS NOT NULL OR
         arg_assignment_id IS NOT NULL,
  'All input parameters are NULL. This is most likely an error.';
  RAISE NOTICE 'update sed for user %, exercise %, section %, assignment %', arg_user_id, arg_exercise_id, arg_section_id, arg_assignment_id;
  RETURN QUERY
  WITH collected_data AS (
      SELECT student_exercise_data.id,
             (CASE
                  WHEN count(student_exercise_problem_data.score) = 0
                      THEN NULL
                  ELSE round(
                          (sum(student_exercise_problem_data.score) :: DOUBLE PRECISION
                              /
                           count(student_exercise_problem_data.*)
                              ) :: NUMERIC,
                          2)
                 END)
                 AS score,
             (CASE
                  WHEN count(student_exercise_problem_data.progress) = 0
                      THEN NULL
                  ELSE round(
                          (sum(student_exercise_problem_data.progress) :: DOUBLE PRECISION
                              /
                           count(student_exercise_problem_data.*)
                              ) :: NUMERIC,
                          2)
                 END)
                 AS progress,
             (CASE
                  WHEN count(student_exercise_problem_data.solving_time) = 0
                      THEN NULL
                  ELSE sum(student_exercise_problem_data.solving_time)
                 END)
                 AS solving_time,
             min(student_exercise_problem_data.started_at)
                 AS start_time,
             exercise_config.points
                 AS max_score,
             max(student_exercise_problem_data.last_submission)
                 AS last_submission
      FROM student_exercise_data
               JOIN exercises ON exercises.id = student_exercise_data.exercise_id
               JOIN exercise_group ON exercises.group_id = exercise_group.id
               JOIN exercise_config ON exercise_config.exercise_id = exercises.id
               LEFT JOIN student_exercise_problem_data ON student_exercise_problem_data.user_id = student_exercise_data.user_id AND
                                                          student_exercise_problem_data.exercise_id = student_exercise_data.exercise_id
      WHERE (arg_exercise_id IS NULL OR exercises.id = arg_exercise_id)
        AND (arg_user_id IS NULL OR student_exercise_data.user_id = arg_user_id)
        AND (arg_assignment_id IS NULL OR exercise_group.assignment_id = arg_assignment_id)
        AND (arg_section_id IS NULL OR EXISTS(SELECT 1
                                              FROM section_assignments
                                              WHERE section_assignments.section_id = arg_section_id
                                                AND section_assignments.assignment_id = exercise_group.assignment_id))
      GROUP BY student_exercise_data.id, student_exercise_data.user_id, student_exercise_data.exercise_id, exercise_config.points
  )
  UPDATE student_exercise_data
      SET
          score = collected_data.score,
          progress = collected_data.progress,
          solving_time = collected_data.solving_time,
          started_at = collected_data.start_time,
          max_score = collected_data.max_score,
          last_submission = collected_data.last_submission
      FROM collected_data
      WHERE student_exercise_data.id = collected_data.id AND
            (student_exercise_data.score IS DISTINCT FROM collected_data.score OR
             student_exercise_data.progress IS DISTINCT FROM collected_data.progress OR
             student_exercise_data.solving_time IS DISTINCT FROM collected_data.solving_time OR
             student_exercise_data.started_at IS DISTINCT FROM collected_data.start_time OR
             student_exercise_data.max_score IS DISTINCT FROM collected_data.max_score OR
             student_exercise_data.last_submission IS DISTINCT FROM collected_data.last_submission)
      RETURNING student_exercise_data.id;
END;
$$;
CREATE FUNCTION public.update_student_exercise_problem_data(arg_assignment_id bigint DEFAULT NULL::bigint, arg_user_id bigint DEFAULT NULL::bigint, arg_exercise_id bigint DEFAULT NULL::bigint, arg_descriptor_id bigint DEFAULT NULL::bigint, arg_section_id bigint DEFAULT NULL::bigint) RETURNS SETOF bigint
    LANGUAGE plpgsql
    AS $$
BEGIN
    ASSERT arg_assignment_id IS NOT NULL OR
           arg_user_id IS NOT NULL OR
           arg_exercise_id IS NOT NULL OR
           arg_descriptor_id IS NOT NULL OR
           arg_section_id IS NOT NULL,
        'All input parameters are NULL. This is most likely an error.';
    RAISE NOTICE 'update sepd for user %, exercise %, descriptor %, assignment %, section %', arg_user_id, arg_exercise_id, arg_descriptor_id, arg_assignment_id, arg_section_id;
    RETURN QUERY
        WITH student_data AS (
            SELECT student_exercise_problem_data.*
            FROM student_exercise_problem_data
                     JOIN exercises ON exercises.id = student_exercise_problem_data.exercise_id
                     JOIN exercise_group ON exercises.group_id = exercise_group.id
                     JOIN assignments ON assignments.id = exercise_group.assignment_id
            WHERE (arg_exercise_id IS NULL OR student_exercise_problem_data.exercise_id = arg_exercise_id)
              AND (arg_descriptor_id IS NULL OR student_exercise_problem_data.descriptor_id = arg_descriptor_id)
              AND (arg_user_id IS NULL OR student_exercise_problem_data.user_id = arg_user_id)
              AND (arg_assignment_id IS NULL OR assignments.id = arg_assignment_id)
              AND (arg_section_id IS NULL OR EXISTS(SELECT 1
                                                    FROM section_assignments
                                                             INNER JOIN exercise_group ON exercise_group.assignment_id = section_assignments.assignment_id
                                                             INNER JOIN exercises e on exercise_group.id = e.group_id
                                                    WHERE section_assignments.section_id = arg_section_id))
            ), student_solutions AS (
            SELECT solutions.*
            FROM solutions
                     JOIN content ON content.id = solutions.problem_id
                     JOIN student_data ON student_data.exercise_id = solutions.exercise_id AND
                                          student_data.user_id = solutions.author_id AND
                                          student_data.descriptor_id = content.descriptor_id
            WHERE solutions.discriminator = 'EXERCISE'
              AND solutions.ignored IS FALSE
            ), submitted_after_deadline_solutions AS (
            SELECT student_solutions.*
            FROM student_solutions
                     JOIN exercises ON exercises.id = student_solutions.exercise_id
                     JOIN exercise_group ON exercises.group_id = exercise_group.id
                     JOIN assignments_config ON assignments_config.assignment_id = exercise_group.assignment_id
                     JOIN student_assignment_data ON student_assignment_data.user_id = student_solutions.author_id AND
                                                     student_assignment_data.assignment_id = exercise_group.assignment_id
            WHERE assignments_config.deadline IS NOT NULL
              AND student_solutions.completed_at IS NOT NULL
              AND ((student_assignment_data.extended_deadline IS NOT NULL AND
                    student_solutions.completed_at > student_assignment_data.extended_deadline) OR
                   (student_assignment_data.extended_deadline IS NULL AND
                    student_solutions.completed_at > assignments_config.deadline))
            ), graded_student_solutions AS (
            SELECT student_solutions.id,
                   student_solutions.score * (
                       CASE
                           WHEN student_solutions.with_penalty IS TRUE AND submitted_after_deadline_solutions.id IS NOT NULL AND se.instructions IS NOT TRUE
                               THEN 1.0 - assignments_config.penalty
                           ELSE 1
                           END) AS score,
                   student_solutions.completed_at
            FROM student_solutions
                     JOIN exercises ON exercises.id = student_solutions.exercise_id
                     LEFT JOIN single_exercises se on exercises.id = se.id
                     JOIN exercise_group ON exercises.group_id = exercise_group.id
                     JOIN assignments_config ON assignments_config.assignment_id = exercise_group.assignment_id
                     LEFT JOIN submitted_after_deadline_solutions ON submitted_after_deadline_solutions.id = student_solutions.id
            WHERE (assignments_config.deadline_allow_submission IN ('allowWithPenalty', 'allowWithoutPenalty', 'notAllow') OR
                   (assignments_config.deadline_allow_submission = 'allowWithoutAffectingGrade' AND se.instructions) OR
                   submitted_after_deadline_solutions.id IS NULL)
              AND student_solutions.completed_at IS NOT NULL
              AND student_solutions.score IS NOT NULL
            ), collected_data AS (
            SELECT student_data.exercise_id,
                   student_data.descriptor_id,
                   student_data.user_id,
                   ((CASE
                         WHEN count(graded_student_solutions) = 0
                             THEN NULL
                         WHEN exercise_config.problem_grading_schema = 'maximum'
                             THEN max(graded_student_solutions.score) :: DOUBLE PRECISION
                         WHEN exercise_config.problem_grading_schema = 'average'
                             THEN avg(graded_student_solutions.score) :: DOUBLE PRECISION
                         WHEN exercise_config.problem_grading_schema = 'last_submission'
                             THEN
                             (array_agg(graded_student_solutions.score
                                        ORDER BY graded_student_solutions.completed_at DESC NULLS LAST))[1]
                       END) :: DOUBLE PRECISION)             AS progress,
                   exercise_config.points                    AS points,
                   sum(student_solutions.solving_time)       AS solving_time,
                   (CASE
                        WHEN count(student_solutions) = 0
                            THEN NULL
                        ELSE min(student_solutions.started_at) END)
                                                             AS start_time,
                   count(student_solutions)                  AS student_solutions_count,
                   count(student_solutions.completed_at)     AS submitted_student_solutions_count,
                   count(submitted_after_deadline_solutions) AS submitted_after_deadline_solutions_count,
                   max(student_solutions.completed_at)       as last_submission
            FROM student_data
                     JOIN exercise_config ON exercise_config.exercise_id = student_data.exercise_id
                     JOIN content ON content.descriptor_id = student_data.descriptor_id
                     LEFT JOIN student_solutions ON student_solutions.exercise_id = student_data.exercise_id AND
                                                    student_solutions.problem_id = content.id AND
                                                    student_solutions.author_id = student_data.user_id
                     LEFT JOIN submitted_after_deadline_solutions ON submitted_after_deadline_solutions.id = student_solutions.id
                     LEFT JOIN graded_student_solutions ON graded_student_solutions.id = student_solutions.id
            GROUP BY student_data.exercise_id,
                     student_data.user_id,
                     student_data.descriptor_id,
                     exercise_config.problem_grading_schema,
                     exercise_config.points
            )
            UPDATE student_exercise_problem_data
                SET
                    score = round((collected_data.progress / 100 * collected_data.points) :: NUMERIC, 2),
                    progress = collected_data.progress,
                    solving_time = collected_data.solving_time,
                    started_at = collected_data.start_time,
                    solutions_count = collected_data.student_solutions_count,
                    submitted_solutions_count = collected_data.submitted_student_solutions_count,
                    max_score = collected_data.points,
                    submitted_after_deadline_solutions_count = collected_data.submitted_after_deadline_solutions_count,
                    last_submission = collected_data.last_submission
                FROM collected_data
                WHERE student_exercise_problem_data.exercise_id = collected_data.exercise_id AND
                      student_exercise_problem_data.descriptor_id = collected_data.descriptor_id AND
                      student_exercise_problem_data.user_id = collected_data.user_id AND
                      (student_exercise_problem_data.score IS DISTINCT FROM round((collected_data.progress / 100 * collected_data.points) :: NUMERIC, 2) OR
                       student_exercise_problem_data.progress IS DISTINCT FROM collected_data.progress OR
                       student_exercise_problem_data.solving_time IS DISTINCT FROM collected_data.solving_time OR
                       student_exercise_problem_data.started_at IS DISTINCT FROM collected_data.start_time OR
                       student_exercise_problem_data.solutions_count IS DISTINCT FROM collected_data.student_solutions_count OR
                       student_exercise_problem_data.submitted_solutions_count IS DISTINCT FROM collected_data.submitted_student_solutions_count OR
                       student_exercise_problem_data.max_score IS DISTINCT FROM collected_data.points OR
                       student_exercise_problem_data.submitted_after_deadline_solutions_count IS DISTINCT FROM
                       collected_data.submitted_after_deadline_solutions_count OR
                       student_exercise_problem_data.last_submission IS DISTINCT FROM collected_data.last_submission)
                RETURNING student_exercise_problem_data.id;
END;
$$;
