CREATE VIEW public.student_assignment_data_view AS
 SELECT course_users.user_id,
    a.id AS assignment_id,
    count(
        CASE
            WHEN (sed.progress >= (86)::double precision) THEN 1
            ELSE NULL::integer
        END) AS success,
    count(
        CASE
            WHEN ((sed.progress >= (75)::double precision) AND (sed.progress < (86)::double precision)) THEN 1
            ELSE NULL::integer
        END) AS good,
    count(
        CASE
            WHEN ((sed.progress >= (60)::double precision) AND (sed.progress < (75)::double precision)) THEN 1
            ELSE NULL::integer
        END) AS satisfied,
    count(
        CASE
            WHEN (sed.progress < (60)::double precision) THEN 1
            ELSE NULL::integer
        END) AS failed,
    count(e.*) AS total,
    count(sed.*) FILTER (WHERE (sed.score IS NOT NULL)) AS totalgraded
   FROM (((((public.exercises e
     JOIN public.exercise_group eg ON ((e.group_id = eg.id)))
     JOIN public.assignments a ON ((eg.assignment_id = a.id)))
     JOIN public.section_assignments ON ((a.id = section_assignments.assignment_id)))
     JOIN public.course_users ON ((section_assignments.section_id = course_users.section_id)))
     LEFT JOIN public.student_exercise_data sed ON (((e.id = sed.exercise_id) AND (course_users.user_id = sed.user_id))))
  WHERE (course_users.discriminator = 'student'::text)
  GROUP BY course_users.user_id, a.id;
CREATE VIEW public.student_course_data_view AS
 SELECT course_users.user_id,
    c.id AS course_id,
    count(
        CASE
            WHEN (sad.progress >= (86)::double precision) THEN 1
            ELSE NULL::integer
        END) AS success,
    count(
        CASE
            WHEN ((sad.progress >= (75)::double precision) AND (sad.progress < (86)::double precision)) THEN 1
            ELSE NULL::integer
        END) AS good,
    count(
        CASE
            WHEN ((sad.progress >= (60)::double precision) AND (sad.progress < (75)::double precision)) THEN 1
            ELSE NULL::integer
        END) AS satisfied,
    count(
        CASE
            WHEN (sad.progress < (60)::double precision) THEN 1
            ELSE NULL::integer
        END) AS failed,
    count(a.*) AS total,
    count(sad.*) FILTER (WHERE (sad.score IS NOT NULL)) AS totalgraded
   FROM (((((public.courses c
     JOIN public.sections ON ((sections.course_id = c.id)))
     JOIN public.course_users ON ((course_users.section_id = sections.id)))
     LEFT JOIN public.section_assignments ON ((section_assignments.section_id = course_users.section_id)))
     LEFT JOIN public.assignments a ON ((section_assignments.assignment_id = a.id)))
     LEFT JOIN public.student_assignment_data sad ON (((sad.assignment_id = a.id) AND (sad.user_id = course_users.user_id))))
  WHERE (((a.* IS NULL) OR (a.published_at IS NOT NULL)) AND (course_users.discriminator = 'student'::text))
  GROUP BY course_users.user_id, c.id;
