INSERT INTO public.problem_tutorials VALUES (38, 178, false, false, '[{"hint": {"message": ["Let’s go over a few reminders before you try this problem on your own.", "You can use a slash “/” to make fractions.<br><img width=\"260\" height=\"100\" src=\"http://i89.fastpic.ru/big/2017/0428/a9/8565b222f849db6daaeaae97ae1ecba9.gif\" alt=\"Pressing the slash key to start a fraction, typing the numerator, moving to the bottom with down arrow and typing the denominator. Repeating for another fraction.\">", "You can add parentheses after highlighting.<br><img width=\"238\" height=\"64\" src=\"http://i89.fastpic.ru/big/2017/0428/62/1b1887b421998fecda42c2ea7c710d62.gif\" alt=\"Highlighting an expression, then typing the left parenthesis key to insert parentheses around the text.\">", "You can edit a cell.<br><img width=\"302\" height=\"83\" src=\"http://i89.fastpic.ru/big/2017/0428/99/a785614e0cf6aa0a5e7b0064e7b16099.gif\" alt=\"Hovering the cursor over a cell, clicking the pencil icon, then editing the cell.\">", "And delete a cell.<br><img width=\"280\" height=\"88\" src=\"http://i89.fastpic.ru/big/2017/0428/6e/99b59f9ad81f539696bf7917ef757c6e.gif\" alt=\"Gradarius indicates a mistake was made, then the student removes the cell by clicking X.\">", "Go ahead and complete this problem on your own."]}, "trigger": {"type": "message"}}, {"trigger": {"type": "freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (39, 202, true, false, '[{"trigger": {"type": "questions", "questions": [{"text": "Let’s begin with a question: Imagine that, starting at the point <ltx>(1,0)</ltx>, an object moves at constant speed around the unit circle in the counterclockwise direction, completing one rotation every <ltx>2\\pi</ltx> seconds. Then what is <ltx>h(t)</ltx>, the height of the object <ltx>t</ltx> seconds after it starts moving? <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["h(t)=\\sin(t)"], "mistakeExplanations": ["Try again. Remember that you’re looking for a function that keeps track of the height of an object moving around the unit circle.", "Try again. Here’s a hint: The answer is a basic trigonometric function. Think about how the basic trigonometric functions are defined.", "That’s incorrect."]}], "giveUpTrials": 3, "giveUpExplanation": "The answer is <ltx>h(t)=\\sin(t)</ltx>. Please submit this answer to continue.", "successExplanation": "Well done! The height of the object as a function of time is described by nothing other than the sine function."}, {"text": "Now imagine that the object moves at constant speed around a circle of radius <ltx>3</ltx>, starting at the point <ltx>(3,0)</ltx> and completing one rotation every <ltx>2\\pi</ltx> seconds. What is <ltx>h(t)</ltx>, the function that describes the height of the object <ltx>t</ltx> seconds after it starts moving? <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["h(t)=3\\sin(t)"], "mistakeExplanations": ["Try again. Think about how to encode the radius of the circle in your answer.", "Try again. Here’s a hint: You’ll need to apply a transformation to the function <ltx>\\sin(t)</ltx>.", "That’s incorrect. The sine function must be multiplied by a factor of <ltx>3</ltx>."]}], "giveUpTrials": 3, "giveUpExplanation": "The answer is <ltx>h(t)=3\\sin(t)</ltx>. Please submit this answer to continue.", "successExplanation": "Nice! The sine function must be multiplied by a factor of <ltx>3</ltx>."}, {"text": "Suppose that the object moves at constant speed around a circle of radius <ltx>3</ltx>, starting at the point <ltx>(3,0)</ltx>, but completes one rotation per second. What is the height of the object as a function of time now? <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["h(t)=3\\sin(2\\pi t)"], "mistakeExplanations": ["Try again. Think about how to encode the period of the object in your answer.", "Try again. Here’s a hint: You’ll need to apply a transformation to the function <ltx>3\\sin(t)</ltx>", "That’s incorrect. The input of the function <ltx>3\\sin(t)</ltx> must be multiplied by a factor of <ltx>2\\pi</ltx>, so that as <ltx>t</ltx> changes from <ltx>0</ltx> to <ltx>1</ltx>, the input of sine changes from <ltx>0</ltx> to <ltx>2\\pi</ltx>, making the object complete a full rotation after one second."]}], "giveUpTrials": 3, "giveUpExplanation": "The answer is <ltx>h(t)=3\\sin(2\\pi t)</ltx>. Please submit this answer to continue.", "successExplanation": "Good job! The input of the function <ltx>3\\sin(t)</ltx> must be multiplied by a factor of <ltx>2\\pi</ltx>, so that as <ltx>t</ltx> changes from <ltx>0</ltx> to <ltx>1</ltx>, the input of sine changes from <ltx>0</ltx> to <ltx>2\\pi</ltx>, making the object complete a full rotation after one second."}, {"text": "Finally, let’s imagine that the object moves around a circle of radius <ltx>3</ltx>, completing one rotation per second, but that this time the circle is centered at the point <ltx>(0,1)</ltx>, and the object is at the point <ltx>(3,1)</ltx> at time <ltx>t=0</ltx>. What is the height of the object as a function of time? <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["h(t)=3\\sin(2 \\pi t)+1"], "mistakeExplanations": ["Try again. Think about how to encode the change in position of the circle in your answer.", "Try again. Here’s a hint: You’ll need to apply a transformation to the function <ltx>3\\sin(2 \\pi t)</ltx>.", "That’s incorrect. The function <ltx>3\\sin(2 \\pi t)</ltx> must be increased by <ltx>1</ltx>, since at a given moment in time <ltx>t \\geq 0</ltx>, the object’s height is <ltx>1</ltx> greater than what it would be if the circle were centered at the origin."]}], "giveUpTrials": 3, "giveUpExplanation": "The answer is <ltx>h(t)=3\\sin(2 \\pi t)+1</ltx>. Please submit this answer to continue.", "successExplanation": "Correct! The function <ltx>3\\sin(t)</ltx> must be increased by <ltx>1</ltx>, since at a given moment in time <ltx>t \\geq 0</ltx>, the object’s height is <ltx>1</ltx> greater than what it would be if the circle were centered at the origin."}]}}, {"trigger": {"rows": [{"text": "The previous exercises capture the basic ideas involved in modeling periodic behavior: Begin with a basic trigonometric function, like sine, then apply transformations to it in order to fit observed data. Such a function is called a sinusoidal function. By definition, a sinusoidal function <ltx>f</ltx> has the general form<p><ltx>f(t)=A\\sin(B(t-C))+D</ltx>,</p>where <ltx>A</ltx>, <ltx>B</ltx>, <ltx>C</ltx>, and <ltx>D</ltx> are constants. Let’s make sure you understand what these constants represent!", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"type": "questions", "video": {"content": "<video width=\"1024\" height=\"768\" src=\"https://authoring.gradarius.com/video/TrigModeling_Take2.mp4\" controls=\"true\"></video>", "questionTimes": []}, "questions": []}}, {"trigger": {"type": "questions", "questions": [{"text": "True or false: The function <ltx>f(t)=\\cos(t)</ltx> is a sinusoidal function. <q-single-choice id=\"1\" />", "inputs": [{"id": "1", "type": "choice", "options": ["True", "False"], "correctAnswers": [0], "mistakeExplanations": [null, "That''s incorrect."]}], "giveUpTrials": 0, "successExplanation": "Correct! Note that cosine is the same as sine shifted <ltx>\\frac{\\pi}{2}</ltx> units to the left, i.e. <ltx>\\cos(t)=\\sin\\left(t+\\frac{\\pi}{2}\\right)</ltx>. When cooking up a sinusoidal function, you can in general use either sine or cosine, but one choice may be more convenient depending on the data you’re given."}, {"text": "What is the phase shift of the sinusoidal function <ltx>\\sin(5t-1)</ltx>? <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["\\frac{1}{5}"], "mistakeExplanations": ["Try again. Remember that for sinusoidal functions, <i>phase shift</i> is just another way of saying <i>horizontal shift</i>.", "Try again. Here’s a hint: To find the phase shift, put the function into the form <ltx>A\\sin(B(t-C))+D</ltx>. The phase shift is the constant <ltx>C</ltx>.", "That’s incorrect."]}], "giveUpTrials": 3, "giveUpExplanation": "The answer is <ltx>\\frac{1}{5}</ltx>. Please submit this answer to continue.", "successExplanation": "Well done! Since <ltx>\\sin(5t-1)=\\sin\\left(5\\left(t-\\frac{1}{5}\\right)\\right)</ltx>, the phase shift is <ltx>\\frac{1}{5}</ltx>. You can graph the function to see this with your own eyes."}]}}, {"trigger": {"rows": [{"text": "Suppose that, at a certain spot on the beach, high tide is measured to be <ltx>8</ltx> ft at midnight and low tide is measured to be <ltx>0.2</ltx> ft some time later. Suppose that the next high tide occurs at noon.<ol class=\"lower-alpha\"><li>Find a trigonometric model <ltx>h\\left(t\\right)</ltx> that describes the height of the water level as a function of time.</li><li>Graph ​<ltx>h\\left(t\\right)</ltx>. (Submit this graph as part of your final answer.)</li><li>Estimate what the water level will be at 10:00 am.</li></ol>", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"rows": [{"text": "Let’s create a sinusoidal function that describes the height of the water level <ltx>t</ltx> hours after midnight. Since the water level is maximal at <ltx>t=0</ltx>, it makes sense to work with a cosine function, which is itself maximal at <ltx>0</ltx>.<br><br>Our basic model will be <ltx>h(t)=A\\cos(B(t-C))+D</ltx>. We simply need to determine the constants <ltx>A</ltx>, <ltx>B</ltx>, <ltx>C</ltx>, and <ltx>D</ltx>.", "type": "comment"}, {"type": "expressions", "cells": ["A = \\textcolor{edit}{0}{ }"]}], "type": "addRows"}}, {"hint": {"message": ["What is the amplitude <ltx>A = \\frac{\\text{max} - \\text{min}}{2}</ltx>?"], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 6, "cellIndex": 0}, "type": "cellSave", "result": ["A=3.9", "A=3.9"], "mistakeExplanations": ["Try again."]}}, {"trigger": {"rows": [{"type": "expressions", "cells": ["B = \\textcolor{edit}{0}{ }"]}], "type": "addRows"}}, {"hint": {"message": ["To find <ltx>B</ltx>, which controls the period, we need to recognize that the period is <ltx>12</ltx> hours (the length of time from one high tide to the next), then solve the equation <ltx>\\frac{2\\pi}{B}=12</ltx>. What is <ltx>B</ltx>?"], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 7, "cellIndex": 0}, "type": "cellSave", "result": ["B=\\frac{\\pi}{6}", "B=\\frac{ \\pi }{ 6 }"], "mistakeExplanations": ["Try again."]}}, {"trigger": {"rows": [{"type": "expressions", "cells": ["C = \\textcolor{edit}{0}{ }"]}], "type": "addRows"}}, {"hint": {"message": ["Since the water level is already maximal at time <ltx>t=0</ltx> (midnight), what should the phase shift <ltx>C</ltx> be?"], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 8, "cellIndex": 0}, "type": "cellSave", "result": ["C=0", "C=0"], "mistakeExplanations": ["Try again."]}}, {"trigger": {"rows": [{"type": "expressions", "cells": ["D = \\textcolor{edit}{0}{ }"]}], "type": "addRows"}}, {"hint": {"message": ["Finally, find the vertical shift <ltx>D = \\frac{\\text{max} + \\text{min}}{2}</ltx>."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 9, "cellIndex": 0}, "type": "cellSave", "result": ["D=4.1", "D=4.1"], "mistakeExplanations": ["Try again."]}}, {"trigger": {"rows": [{"type": "expressions", "cells": ["h(t) = \\textcolor{edit}{0}{ }"]}], "type": "addRows"}}, {"hint": {"message": ["Good! Now put everything together and enter the full trigonometric model."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 10, "cellIndex": 0}, "type": "cellSave", "result": ["h\\left(t\\right)=3.9\\cos\\left(\\frac{\\pi}{6}t\\right)+4.1", "h\\left(t\\right)=3.9 \\cdot \\cos\\left(\\frac{ \\pi }{ 6 } \\cdot t\\right)+4.1"], "mistakeExplanations": ["Try again. Remember that we’re working with the general model <ltx>h(t)=A\\cos(B(t-C))+D</ltx>. You just need to substitute the values of <ltx>A</ltx>, <ltx>B</ltx>, <ltx>C</ltx>, and <ltx>D</ltx> you already found."]}}, {"hint": {"message": ["Well done. That takes care of part (a). To answer parts (b) and (c), graph <ltx>h(t)</ltx>, then determine the water level at 10:00 am. Go ahead and do this on your own."]}, "trigger": {"type": "message"}}, {"trigger": {"rows": [{"text": "Answer parts (b) and (c) next. Go ahead and do this on your own.", "type": "comment"}], "type": "addRows"}}, {"trigger": {"type": "freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (40, 206, true, false, '[{"trigger": {"type": "questions", "video": {"content": "<video width=\"1024\" height=\"768\" src=\"https://authoring.gradarius.com/video/Logarithms-part-1.mp4\" controls=\"true\"></video>", "questionTimes": [198000]}, "message": "In this activity we apply the notion of invertibility in a particular case: we define logarithmic function as the inverse of exponent. Then we consider the basic properties of logarithms.", "questions": [{"text": "Evaluate <ltx>\\log_2 8</ltx>. <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["3"], "mistakeExplanations": ["Please try again."]}], "giveUpTrials": 0, "successExplanation": "Correct!"}]}}, {"trigger": {"rows": [{"text": "Here is what we learned from the video.<br><br>Consider the exponential function <ltx>f(x) = a^x</ltx>. Recall that its graph looks like this (see the figure below):<p style=\"text-align: center\"><img src=\"/controller/tutorials/Logarithms_1.png\" width=\"300\" height=\"300\"></p>Apparently, any horizontal line intersects the curve above only once, hence, the graph of <ltx>f</ltx> passes the Horizontal Line Test, which means that <ltx>f^{-1}</ltx> exists. The inverse of an exponential function is given a special name.<br><br><strong>Definition:</strong> The <i>logarithm</i> with base <ltx>a &gt; 0</ltx>, denoted <ltx>\\log_a x</ltx>, is the inverse of the exponential function <ltx>a^x</ltx>. The number <ltx>a</ltx> is called the <i>base</i> of the logarithm <ltx>\\log_a x</ltx>.<br><br>According to the definition above, <ltx>\\log_a x</ltx> is a power such that <ltx>a</ltx> raised to that power is equal to <ltx>x</ltx>, that is,<p style=\"text-align: center\"><ltx>a^{\\log_a x} = x</ltx>.</p>", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"rows": [{"text": "The domain, range, and the graph of the function <ltx>\\log_a x</ltx> can be easily obtained from the fact that logarithmic functions are inverse to exponents.<ul><li>The domain and range</li></ul><p style=\"margin-left: 40px\">Since</p><p style=\"text-align: center\"><ltx>Dom(a^x) = (-\\infty, \\infty)</ltx> and <ltx>Range(a^x) = (0, \\infty)</ltx>,</p><p style=\"margin-left: 40px\">we automatically obtain that</p><p style=\"text-align: center\"><ltx>Dom(\\log_a x) = (0, \\infty)</ltx> and <ltx>Range(\\log_a x) = (-\\infty, \\infty)</ltx>,</p><p style=\"margin-left: 40px\">which follows from the general principle</p><p style=\"text-align: center\"><ltx>Dom(f^{-1}) = Range(f)</ltx> and <ltx>Range(f^{-1}) = Dom(f)</ltx>.</p><ul><li>The graph</li></ul><p style=\"margin-left: 40px\">The graph of <ltx>f(x) = a^x</ltx> (blue curve) and its inverse <ltx>f^{-1}(x) = \\log_a x</ltx> (red curve) are both shown below. Notice the symmetry between the curves with respect to the diagonal <ltx>y = x</ltx> (green line).</p><p style=\"text-align: center\"><img src=\"/controller/tutorials/Logarithms_2.png\" width=\"300\" height=\"300\"></p>", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"rows": [{"text": "<strong>Example:</strong> Solve the equation <ltx>2^{x+1} = 5</ltx>.", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"type": "questions", "questions": [{"text": "Let us apply the logarithm with base <ltx>2</ltx> to both sides of the given equation.<br>Enter the new equation. <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["\\log_2 (2^{x+1}) = \\log_2 (5)"], "mistakeExplanations": ["Please try again."]}], "giveUpTrials": 0, "successExplanation": "Exactly!"}, {"text": "Now that we have<p style=\"text-align: center\"><ltx>\\log_2 (2^{x+1}) = \\log_2 (5)</ltx></p>let us use the fact that the logarithm and exponent are inverse to each other. It follows that the left hand side of the equation simplifies and we obtain <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["x+1 = \\log_2 (5)"], "mistakeExplanations": ["Please try again."]}], "giveUpTrials": 0, "successExplanation": "Correct!"}, {"text": "Finally, solve the equation<p style=\"text-align: center\"><ltx>x+1 = \\log_2 5</ltx></p>For <ltx>x</ltx> and obtain <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["x = \\log_2 (5) - 1", "\\log_2 (5) - 1"], "mistakeExplanations": ["Please try again."]}], "giveUpTrials": 0, "successExplanation": "Correct!"}]}}, {"hint": {"message": ["Now, let us consider the basic properties of logarithms."]}, "trigger": {"type": "message"}}, {"trigger": {"type": "questions", "video": {"content": "<video width=\"1024\" height=\"768\" src=\"https://authoring.gradarius.com/video/Logarithms-part-2.mp4\" controls=\"true\"></video>", "questionTimes": [257000, 304000, 342000, 370000]}, "questions": [{"text": "Express <ltx>\\log_9 (y)</ltx> in terms of a logarithm with base <ltx>3</ltx>. <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["\\frac{1}{2} \\log_3 (y)", "\\frac{1}{2} \\log_3 y", "\\frac{\\log_3 y}{2}", "\\frac{\\log_3 y}{\\log_3 9}"], "mistakeExplanations": ["Please try again."]}], "giveUpTrials": 3, "successExplanation": "Correct!"}, {"text": "Bring the coefficient <ltx>\\frac{1}{2}</ltx> of the logarithm in <ltx>\\frac{1}{2} \\log_3 y</ltx> inside the logarithm. <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["\\log_3 (\\sqrt{y})", "\\log_3 y^{\\frac{1}{2}}", "\\log_3 y^{0.5}", "\\log_3 \\sqrt{y}"], "mistakeExplanations": ["Please try again."]}], "giveUpTrials": 0, "successExplanation": "Correct!"}, {"text": "Bring the coefficient <ltx>5</ltx> of the logarithm in <ltx>5 \\log_3 z</ltx> inside the logarithm. <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["\\log_3 (z^5)"], "mistakeExplanations": ["Please try again."]}], "giveUpTrials": 0, "successExplanation": "Correct!"}, {"text": "Combine all three logarithms in the expression <ltx>\\log_3 x - \\log_3 \\sqrt{y} + \\log_3 (z^5)</ltx> into a single logarithm. <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["\\log_3 (\\left( \\frac{x z^5}{\\sqrt{y}} \\right))"], "mistakeExplanations": ["Please try again."]}], "giveUpTrials": 0, "successExplanation": "Correct!"}]}}, {"trigger": {"rows": [{"text": "Here is what we learned from the video.<br><br>The following properties of <ltx>\\log_a x</ltx> follow directly from their definition and the basic properties of exponential functions.<ul><li><ltx>\\log_a (a^x) = x</ltx> for any <ltx>x \\in \\R</ltx> and <ltx>a^{\\log_a x} = x</ltx> for any <ltx>x &gt; 0</ltx></li></ul><p style=\"margin-left: 55px\">This immediately follows from the fact that <ltx>\\log_a x</ltx> is inverse to <ltx>a^x</ltx>, that is, the functions undo the actions of each other.</p>", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"rows": [{"text": "<ul><li><ltx>\\log_a (x^y) = y \\log_a x</ltx> for any <ltx>x &gt; 0</ltx></li></ul><p style=\"margin-left: 55px\">This follows from the fact that exponential functions have the property that <ltx>(a^x)^y =a^{xy}</ltx>.</p>", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"rows": [{"text": "<ul><li><ltx>\\log_a (xy) = \\log_a x + \\log_a y</ltx> for any <ltx>x, y &gt; 0</ltx></li></ul><p style=\"margin-left: 55px\">This follows from the fact that exponential functions have the property that <ltx>a^{x+y} =a^x a^y</ltx>.</p>", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"rows": [{"text": "<ul><li><ltx>\\log_a \\left(\\frac{x}{y}\\right) = \\log_a x - \\log_a y</ltx> for any <ltx>x, y &gt; 0</ltx></li></ul><p style=\"margin-left: 55px\">This is a straightforward consequence of the previous two properties.</p>", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"rows": [{"text": "Finally, we consider so called <i>natural</i> logarithm: the natural logarithm is the logarithm with base <ltx>e \\approx 2.718281828459 \\ldots</ltx>. It is written using the special notation<p style=\"text-align: center\"><ltx>\\ln x = \\log_e x</ltx>.</p>Logarithm <ltx>\\log_a x</ltx> with any base <ltx>a</ltx> can be converted to the natural logarithm using the <i>change of base formula</i>:<p style=\"text-align: center\"><ltx>\\log_a x = \\frac{\\ln x}{\\ln a}</ltx></p>The formula can be easily proved using the properties of logarithms as follows.<br>The equation <ltx>y = \\log_a x</ltx> implies that <ltx>a^y = x</ltx>, and applying <ltx>\\ln</ltx> to both sides of the latter equation we obtain<p style=\"text-align: center\"><ltx>\\ln(a^y) = \\ln x</ltx>.</p>Now, using the properties of logarithms we obtain<p style=\"text-align: center\"><ltx>y \\ln a = \\ln x</ltx>,</p>or<p style=\"text-align: center\"><ltx>y = \\frac{\\ln x}{\\ln a}</ltx>,</p>which simply means<p style=\"text-align: center\"><ltx>\\log_a x = \\frac{\\ln x}{\\ln a}</ltx>.</p>", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"rows": [{"text": "<strong>Example:</strong> Let us apply the properties of logarithms to represent the expression<p style=\"text-align: center\"><ltx>2 \\log_5 (x-1) - 8 \\log_{25} y</ltx></p>as a single logarithm with base <ltx>5</ltx>.", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"type": "questions", "questions": [{"text": "First of all, we apply the change of base formula and express <ltx>\\log_{25} y</ltx> in terms of a logarithm with base <ltx>5</ltx>. Enter the result: <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["\\frac{1}{2} \\log_5 (y)"], "mistakeExplanations": ["Please try again."]}], "giveUpTrials": 0, "successExplanation": "Correct!"}]}}, {"trigger": {"rows": [{"text": "Exactly, according to the formula we obtain<p style=\"text-align: center\"><ltx>\\log_{25} y = \\frac{\\log_5 y}{\\log_5 25} = \\frac{\\log_5 y}{2} = \\frac{1}{2} \\log_5 y</ltx>.</p>", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"rows": [{"text": "Hence, we now have<p style=\"text-align: center\"><ltx>2 \\log_5 (x-1) - 4 \\log_{25} y = 2 \\log_5 (x-1) - 8 \\cdot \\frac{1}{2} \\log_5 y</ltx><br><ltx>= 2 \\log_5 (x-1) - 4 \\log_5 y</ltx></p>and then we bring the coefficients inside<p style=\"text-align: center\"><ltx>2\\log_5 (x-1) - 4 \\log_5 y = \\log_5 (x-1)^2 - \\log_5 (y^4)</ltx>.</p>", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"trigger": {"type": "questions", "questions": [{"text": "Finally, we combine the logarithms together: enter a single logarithms representing<p style=\"text-align: center\"><ltx>\\log_5 (x-1)^2 - \\log_5 (y^4)</ltx>:</p><p></p> <q-expression id=\"1\" />", "inputs": [{"id": "1", "type": "expression", "correctAnswers": ["\\log_5 (\\left( \\frac{(x-1)^2}{y^4} \\right))"], "mistakeExplanations": ["Please try again."]}], "giveUpTrials": 0, "successExplanation": "Correct!"}]}}, {"trigger": {"rows": [{"text": "Right, we obtain<p style=\"text-align: center\"><ltx>\\log_5 (x-1)^2 - \\log_5 (y^4) = \\log_5 \\left( \\frac{(x-1)^2}{y^4} \\right)</ltx></p>and that is the final answer.", "type": "comment"}], "type": "addRows", "waitForInput": true}}, {"hint": {"message": ["Now, apply the the properties of logarithms to write the expression given in the statement as a single logarithm."]}, "trigger": {"type": "message"}}, {"trigger": {"rows": [{"text": "Express <ltx>\\log_{2}\\left(x-1\\right)+2 \\cdot \\log_{4}\\left(x\\right)-6 \\cdot \\log_{8}\\left(x+1\\right)</ltx> as a single logarithm with base <ltx>4</ltx>.", "type": "comment"}], "type": "addRows"}}, {"trigger": {"type": "freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (42, 171, false, false, '[{"hint": {"target": {"id": "pd", "type": "unique"}, "message": ["In this tutorial you’re going to learn how Gradarius writes inverse trig functions. The notation might be what you’re used to, or it might be a little different, so pay attention!"], "placement": "bottom"}, "trigger": {"type": "message"}}, {"hint": {"target": {"id": "fastActionNewRow", "type": "unique"}, "message": ["To solve this equation, we need to use the inverse cosine. In Gradarius, you can enter inverse cosine by typing “arccos” or using the Trigonometry pad in the lower right. Start a new row."], "placement": "right"}, "trigger": {"type": "action", "action": "addRow"}}, {"hint": {"message": ["Type “arccos”"], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "type": "cellEdit", "result": ["arccos", "\\arccos", "\\arccos\\left( \\right)"]}}, {"hint": {"message": ["Notice how the letters changed from italics to normal type. This means “arccos” is an object Gradarius understands. Now we can enter the left side of the equation. Type <ltx>\\cos \\left( x + \\frac{\\pi}{3} \\right)</ltx> inside of the parentheses, so that the cell reads <ltx>\\arccos \\left( \\cos \\left( x + \\frac{\\pi}{3} \\right) \\right)</ltx>"], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "type": "cellEdit", "result": ["\\arccos \\left( \\cos \\left( x + \\frac{\\pi}{3} \\right) \\right)"]}}, {"hint": {"message": ["You have to apply arccos to both sides to keep them equal. Apply arccos to the right side and save your work. The cell should read <ltx>\\arccos\\left(\\cos\\left(x+\\frac{\\pi}{3}\\right)\\right)=\\arccos\\left(-\\frac{1}{2}\\right).</ltx>"], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "type": "cellSave", "result": ["\\arccos\\left(\\cos\\left(x+\\frac{\\pi}{3}\\right)\\right)=\\arccos\\left(-\\frac{1}{2}\\right)", "\\arccos\\left(\\cos\\left(x+\\frac{ \\pi }{ 3 }\\right)\\right)=\\arccos\\left(-\\frac{ 1 }{ 2 }\\right)"]}}, {"hint": {"target": {"type": "wysiwyg", "group": "Trigonometry"}, "message": ["There are many trigonometric functions you can use such as <ltx>\\arcsin(x)</ltx>, <ltx>\\cosh(x)</ltx>, <ltx>\\cot(x)</ltx>, and others. You can view them all in the Trigonometry pad. You can now use that <ltx>\\arccos\\left(\\cos\\left(x\\right)\\right)=x + 2 \\cdot \\pi \\cdot n</ltx> to complete the problem."], "placement": "left"}, "trigger": {"type": "message"}}, {"trigger": {"type": "freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (50, 219, true, true, '[{"trigger":{"type":"questions","questions":[{"text":"Expecting two expressions in any order - first: <q-expression id=\"1\" /> and second: <q-expression id=\"2\" />","successExplanation":"Both expressions are correct!","giveUpTrials":0,"inputs":[{"id":"1","type":"expression","poolId":"pool"},{"id":"2","type":"expression","poolId":"pool"}],"pools":[{"id":"pool","mistakeExplanations":["Q1. Only one of the expressions is correct.","Q1. Both expressions are incorrect."],"correctAnswers":["1","2"]}]},{"text":"Expecting three expressions - first: <q-expression id=\"1\" />, second: <q-expression id=\"2\" /> and third: <q-expression id=\"3\" />","successExplanation":"All expressions are correct!","giveUpTrials":0,"inputs":[{"id":"1","type":"expression","poolId":"pool"},{"id":"2","type":"expression","poolId":"pool"},{"id":"3","type":"expression","poolId":"pool"}],"pools":[{"id":"pool","mistakeExplanations":["Q2. Only one of the expressions is incorrect.","Q2. Two expressions are incorrect.","Q2. Three expression are incorrect."],"correctAnswers":["1","2","3"]}]}]}},{"trigger":{"type":"freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (43, 181, false, false, '[{"hint": {"message": ["Integration by parts is the easiest way to solve some integrals. You can always enter your work by just adding new rows, but Gradarius has an integrate by parts action that can help you organize your work and avoid mistakes. Here’s how it works."]}, "trigger": {"type": "message"}}, {"hint": {"message": ["Select the integral."], "placement": "bottom"}, "trigger": {"type": "selection", "items": [{"target": {"type": "problemCell", "index": 0}}]}}, {"hint": {"message": ["The action search box will look for any match to what you’re typing. This means the fastest way to search is sometimes typing something that’s not used frequently. There are many “Integral” actions, so try typing “by” in the search box to find the “Integrate by parts” action."], "placement": "left"}, "trigger": {"type": "action", "action": "PartsInt"}}, {"hint": {"message": ["You created a subproblem to do the integration by parts. Choice of <ltx>u</ltx> and <ltx>v’</ltx> are very important in integration by parts. For this problem, the best choice is <ltx>u=x</ltx>, <ltx>v’=e^x</ltx>. Enter <ltx>x</ltx> in the first box and save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "actionCell", "paramId": "u_x", "rowIndex": 0}, "type": "cellSave", "result": ["x", "x"]}}, {"hint": {"message": ["Enter <ltx>e^x</ltx> in the second box and save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "actionCell", "paramId": "dv_x", "rowIndex": 0}, "type": "cellSave", "result": ["e^{x}", "e^{x}"]}}, {"hint": {"message": ["Gradarius now sets up the rows to calculate <ltx>\\frac{du}{dx}</ltx> and <ltx>v</ltx>. The derivative of <ltx>x</ltx> is 1. Please use “Rewrite”."], "placement": "top"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 1, "cellIndex": 1}, "type": "cellAction", "action": "rewrite"}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 1, "cellIndex": 2}, "message": ["Enter 1 on this line."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 1, "cellIndex": 2}, "type": "cellSave", "result": ["1", "1"]}}, {"hint": {"message": ["The integral of <ltx>e^x</ltx> is <ltx>e^x</ltx>. Use “Rewrite”."], "placement": "top"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 2, "cellIndex": 1}, "type": "cellAction", "action": "rewrite"}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 2, "cellIndex": 2}, "message": ["Enter <ltx>e^x</ltx> here. By convention, we do not enter the constant of integration here while doing integration by parts."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 2, "cellIndex": 2}, "type": "cellSave", "result": ["e^x", "e^{x}"]}}, {"hint": {"message": ["Now we can rewrite the integral. The integration by parts formula is <ltx>\\int u \\cdot v’ dx = u \\cdot v - \\int u’ \\cdot v dx</ltx>. This indicates the next cell should read <ltx>x \\cdot e^x - \\int e^x dx</ltx>. Please rewrite the integral."], "placement": "top"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 4, "cellIndex": 0}, "type": "cellAction", "action": "rewrite"}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 4, "cellIndex": 1}, "message": ["Enter <ltx>x \\cdot e^x - \\int e^x dx</ltx> and then save your work."], "placement": "top"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 4, "cellIndex": 1}, "type": "cellSave", "result": ["xe^x-\\int e^xdx", "x \\cdot e^{x}-\\int{e^{x} d x}"]}}, {"hint": {"message": ["The last step in a subproblem is to save your result. Roll over the equals sign and choose “Add result”."], "placement": "top"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 4, "cellIndex": 1}, "type": "cellAction", "action": "addSubproblemResult", "actionParameters": [{"key": "parameterId", "value": "result"}]}}, {"hint": {"message": ["Click done."], "placement": "top"}, "trigger": {"type": "click", "target": {"id": "subproblemDone", "type": "unique"}}}, {"hint": {"message": ["You’ve completed the integration by parts! You now have an easy to calculate integral. You can finish this problem."]}, "trigger": {"type": "message"}}, {"trigger": {"type": "freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (44, 214, true, true, '[{"trigger": {"rows": [{"text": "Estimate the limit <ltx>\\lim_{x\\to3}\\left(\\frac{x^2-x-6}{x-3}\\right)</ltx> numerically.", "type": "comment"}, {"type": "expressions", "cells": ["\\lim_{x\\to3}\\left(\\frac{x^2-x-6}{x-3}\\right)"]}], "type": "addRows"}}, {"hint": {"target": {"type": "actions"}, "message": ["You can now practice evaluating a limit numerically using the Evaluate action."], "placement": "left"}, "trigger": {"type": "message"}}, {"trigger": {"type": "immediateAction", "items": [{"target": {"type": "expressionCell", "rowIndex": 1, "cellIndex": 0}, "selection": "\\textcolor{#3237FF}{0}{\\lim_{x\\to3}\\left(\\frac{x^2-x-6}{x-3}\\right)}"}], "action": "SubstLim"}}, {"hint": {"target": {"id": "fastActionNewRow", "type": "unique"}, "message": ["Start a new row."], "placement": "left"}, "trigger": {"type": "action", "action": "addRow"}}, {"hint": {"message": ["Enter 5"], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 2, "cellIndex": 0}, "type": "cellEdit", "result": ["5"]}}, {"hint": {"message": ["Save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 2, "cellIndex": 0}, "type": "cellSave", "result": ["5", "5"]}}, {"trigger": {"rows": [{"text": "A pattern is already emerging, but it''s good to evaluate the function to the right of <ltx>x=3</ltx> to gain a more complete understanding of the limit. Evaluate the function at <ltx>x=3.1</ltx>, <ltx>x=3.01</ltx>, and <ltx>x=3.001</ltx>, and then submit your answer.", "type": "comment"}], "type": "addRows"}}, {"trigger": {"type": "freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (45, 177, false, false, '[{"hint": {"message": ["This tutorial will help you understand how to create fractions and delete cells that you want to remove from your solution."]}, "trigger": {"type": "message"}}, {"hint": {"message": ["Begin by selecting the expression <ltx>\\frac{2 \\cdot x^{2} \\cdot \\left(3 \\cdot x\\right)}{4 \\cdot x^{-2}}</ltx> in the problem statement."], "placement": "right"}, "trigger": {"type": "selection", "items": [{"target": {"type": "problemCell", "index": 0}}]}}, {"hint": {"target": {"id": "fastActionNewRow", "type": "unique"}, "message": ["Now copy it to a new row."], "placement": "right"}, "trigger": {"type": "action", "action": "copyToNewRow"}}, {"hint": {"message": ["Save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "type": "cellSave", "result": ["\\frac{ 2 \\cdot x^{2} \\cdot \\left(3 \\cdot x\\right) }{ 4 \\cdot x^{-2} }", "\\frac{ 2 \\cdot x^{2} \\cdot \\left(3 \\cdot x\\right) }{ 4 \\cdot x^{-2} }"]}}, {"hint": {"message": ["Choose to rewrite the expression."], "placement": "top"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "type": "cellAction", "action": "rewrite"}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "message": ["Simplify the numerator and replace it with <ltx>6x^3</ltx>. Then save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "type": "cellSave", "result": ["\\frac{6x^3}{4\\cdot x^{-2}}", "\\frac{ 6 \\cdot x^{3} }{ 4 \\cdot x^{-2} }"]}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "message": ["The fact that Gradarius hasn’t flagged this step with a red stop sign means that you’re on the right track!"], "placement": "bottom"}, "trigger": {"type": "message"}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1, "subtarget": "btn"}, "message": ["Choose to rewrite the expression."], "placement": "top"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "type": "cellAction", "action": "rewrite"}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 2}, "message": ["Next make a mistake by rewriting the expression as <ltx>6x^{3} \\cdot 4x^2</ltx>. Then save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 2}, "type": "cellSave", "result": ["6x^3\\cdot4x^2", "6 \\cdot x^{3} \\cdot 4 \\cdot x^{2}"]}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 2}, "message": ["Notice how Gradarius recognizes that you’ve made a mistake. By clicking on the red stop sign next to the cell, you can get more information about what went wrong."], "placement": "bottom"}, "trigger": {"type": "message"}}, {"hint": {"message": ["Suppose you’d like to remove an entire cell from your work. To do so, hover your mouse over the cell and click on the X in the upper right-hand corner.<br><img width=\"280\" height=\"88\" src=\"http://i91.fastpic.ru/big/2017/0428/27/a059b87ebfe942ef269a60a91b5aac27.gif\" alt=\"Gradarius indicates that a cell is incorrect and the student deletes the cell by hovering over it with the cursor, then clicking X.\">", "If you want to delete a cell that is not the most recent cell, you’ll need to delete several cells. Each cell is the result of the prior cell. This creates dependencies, so you’ll have to delete multiple cells in these cases.<br><img width=\"524\" height=\"227\" src=\"http://i91.fastpic.ru/big/2017/0428/f5/bd8c494a9da8f7f286a8596071fb7af5.gif\" alt=\"Deleting the most recent cell by clicking X, then deleting multiple cells by clicking X in the second and third cells in a row of four and then clicking Remove in the pop-up box.\">", "If you decide to delete the first cell in the row, the row will disappear. Remember that you can create a new row if desired.<br><img width=\"618\" height=\"235\" src=\"http://i91.fastpic.ru/big/2017/0428/23/4b20043af275ec68a9b24bf12328c823.gif\" alt=\"Deleting an entire row by deleting the first cell, then clicking Remove in the pop-up box.\">"]}, "trigger": {"type": "message"}}, {"hint": {"message": ["Go ahead and finish this problem on your own."]}, "trigger": {"type": "message"}}, {"trigger": {"type": "freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (46, 215, true, true, '[{"trigger":{"type":"questions","questions":[{"text":"First Question text. Cells are part of the text here: <q-expression id=\"first\" /> and <q-expression id=\"second\" />","successExplanation":"Q1 is correct!","giveUpTrials":0,"inputs":[{"id":"first","type":"expression","mistakeExplanations":["Q1, input 1 is wrong."],"correctAnswers":["110"]},{"id":"second","type":"expression","mistakeExplanations":["Q1, input 2 is wrong."],"correctAnswers":["120"]}]},{"text":"Second Question text. With only one cell: <q-expression id=\"first\" /> ","successExplanation":"Q2 is correct!","giveUpTrials":0,"inputs":[{"id":"first","type":"expression","mistakeExplanations":["Q2, input 1 is wrong."],"correctAnswers":["210"]}]}]}},{"trigger":{"type":"freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (47, 216, true, true, '[{"trigger":{"type":"questions","questions":[{"text":"First question. With two cells: <q-expression id=\"first\" /> and <q-expression id=\"second\" />","successExplanation":"Q1 is correct!","giveUpExplanation":"Q1 give up explanation!","giveUpTrials":2,"inputs":[{"id":"first","type":"expression","mistakeExplanations":["Q1, input 1 is wrong."],"correctAnswers":["110"]},{"id":"second","type":"expression","mistakeExplanations":["Q1, input 2 is wrong."],"correctAnswers":["120"]}]},{"text":"Second question. With three expressions: <q-expression id=\"first\" />,  <q-expression id=\"second\" /> and  <q-expression id=\"third\" />   ","successExplanation":"Q2 is correct!","giveUpExplanation":"Q2 give up explanation!","giveUpTrials":0,"inputs":[{"id":"first","type":"expression","mistakeExplanations":["Q2, input 1 is wrong."],"correctAnswers":["210"]},{"id":"second","type":"expression","mistakeExplanations":["Q2, input 2 is wrong."],"correctAnswers":["220"]},{"id":"third","type":"expression","mistakeExplanations":["Q2, input 3 is wrong."],"correctAnswers":["230"]}]},{"text":"Third question. Only one cell is here: <q-expression id=\"first\" />","successExplanation":"Q3 is correct!","giveUpExplanation":"Q3 give up explanation!","giveUpTrials":0,"inputs":[{"id":"first","type":"expression","mistakeExplanations":["Q3, input 1 is wrong once.","Q3, input 1 is wrong two or more times."],"correctAnswers":["310"]}]}]}},{"trigger":{"type":"freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (41, 207, true, true, '[{"trigger":{"type":"questions","message":"In this activity, we will be examining continuity specifically focusing on continuity from one side, discontinuity and types of discontinuity. We will also look at the holes and gaps in the domain of a function and the local nature of continuity.","video":{"content":"<grd-youtube-video video-id=\"6t-AisEx3vU\" />","notes":"Notes: <a href=\"https://authoring.gradarius.com/notes/Topic 2_%20Limits%20and%20Continuity.pdf\" target=\"_blank\">Limits and Continuity</a>","questionTimes":[449000,798000]},"questions":[{"text":"<p><grd-intro-img width=\"400\" height=\"400\" alt=\"Action\">q1</grd-intro-img></p>True or False? This function <ltx>(f(x)=\\frac{1}{x})</ltx> is continuous on its domain. <q-single-choice id=\"1\" />","successExplanation":"Correct! The only possible location of a discontinuity would be at <ltx>x=0</ltx>, but <ltx>0</ltx> is not in the domain of the function.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":[null,"Incorrect. The only possible location of a discontinuity would be at <ltx>x=0</ltx>, but <ltx>0</ltx> is not in the domain of the function."],"options":["True","False"],"correctAnswers":[0]}]},{"text":"<p><grd-intro-img width=\"400\" height=\"400\" alt=\"Action\">q2</grd-intro-img></p>For what values of <ltx>t</ltx> is the function <ltx>g(t) = \\frac{4t + 10}{t^{2}-2t-15}</ltx> not continuous? <br><ltx>t=</ltx><q-expression id=\"1\" />, <ltx>t=</ltx><q-expression id=\"2\" />","successExplanation":"Correct! Rational functions are not continuous at those inputs that force the function''s equation to be divided by zero. Look at the denominator. <ltx>t^{2}-2t-15 = (t-5)(t+3)</ltx>, thus the denominator is zero at <ltx>t = -3,</ltx> <ltx>5</ltx>.","giveUpTrials":0,"inputs":[{"id":"1","type":"expression","poolId":"pool"},{"id":"2","type":"expression","poolId":"pool"}],"pools":[{"id":"pool","mistakeExplanations":["Partially correct. Rational functions are not continuous at those inputs that force the function''s equation to be divided by zero. Look at the denominator: <ltx>t^2-2t-15 = (t-5)(t+3)</ltx>. The denominator is zero at <ltx>t=-3</ltx> and <ltx>t=5</ltx>, thus the function is not continuous at these points.","Incorrect. In this graph, the limit does not exist at two points because the limit from the left side is different from the limit from the right. One of those points is <ltx>t=5</ltx>. What is the other point?"],"correctAnswers":["5","-3"]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Determine what, if any, value to assign to <ltx>f(a)</ltx> to make <ltx>f(x) = \\frac{x^2 - 2x - 8}{x-4}</ltx> continuous at <ltx>x = a</ltx>."}],"waitForInput":true}},{"trigger":{"type":"questions","questions":[{"text":"<p><img src=\"https://authoring.gradarius.com/img/Topic_2_Continuity_Part_A_3.png\" width=\"300\" height=\"300\"></p>Here’s a graph of the function <ltx>f(x)</ltx>. You can also create a graph using the Add to Graph Action, but it does not show holes. What is the point at which the function is undefined?  <q-expression id=\"1\" />","successExplanation":"Correct! There is a hole in the graph of <ltx>f(x)</ltx>, and it is undefined at <ltx>x=4</ltx>.","giveUpTrials":0,"inputs":[{"id":"1","type":"expression","mistakeExplanations":["Incorrect. For instance, a function would be undefined at points where there is a hole in the graph or the graph goes to <ltx>\\infty</ltx>.","Incorrect. The circle on the graph represents a hole where the function is undefined. What is the <ltx>x</ltx> value there?","Incorrect. There is a hole in the graph of <ltx>f(x)</ltx>, and it is undefined at <ltx>x=4</ltx>."],"correctAnswers":["4","x = 4"]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"If you want the function in the graph to be continuous at <ltx>x=4</ltx>, and you want to plug the hole, what value would you use to fill the gap? Enter your answer in the final answer space to complete the activity."}],"waitForInput":false}},{"trigger":{"type":"freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (53, 300, false, false, '[{"trigger":{"type":"action","action":"addTablePoints"},"hint":{"message":["Begin by creating a new table."],"placement":"right"}},{"trigger":{"type":"tableAddButtonClick","target":{"type":"tableCell","rowIndex":0,"tableRowIndex":0,"tableColumnIndex":1,"state":"button"}},"hint":{"message":["Push here to insert function"],"placement":"right"}},{"trigger":{"type":"cellSave","cell":{"type":"tableCell","rowIndex":0,"tableRowIndex":0,"tableColumnIndex":1,"state":"cell"},"result":["\\sin(x)"]},"hint":{"message":["Type <ltx>\\sin(x)</ltx> into the empty cell and then save your work."],"placement":"bottom"}},{"trigger":{"type":"tableAddButtonClick","target":{"type":"tableCell","rowIndex":0,"tableRowIndex":1,"tableColumnIndex":0,"state":"button"}},"hint":{"message":["Push here to insert a value"],"placement":"right"}},{"trigger":{"type":"cellSave","cell":{"type":"tableCell","rowIndex":0,"tableRowIndex":1,"tableColumnIndex":0,"state":"cell"},"result":["111"]},"hint":{"message":["Type <ltx>111</ltx> into the empty cell and then save your work."],"placement":"bottom"}},{"trigger":{"type":"tableAddButtonClick","target":{"type":"tableCell","rowIndex":0,"tableRowIndex":2,"tableColumnIndex":0,"state":"button"}},"hint":{"message":["Push here to insert a value"],"placement":"right"}},{"trigger":{"type":"cellSave","cell":{"type":"tableCell","rowIndex":0,"tableRowIndex":2,"tableColumnIndex":0,"state":"cell"},"result":["2"]},"hint":{"message":["Type <ltx>2</ltx> into the empty cell and then save your work."],"placement":"bottom"}},{"trigger":{"type":"tableAddButtonClick","target":{"type":"tableCell","rowIndex":0,"tableRowIndex":0,"tableColumnIndex":2,"state":"button"}},"hint":{"message":["Now insert another function"],"placement":"right"}},{"trigger":{"type":"cellSave","cell":{"type":"tableCell","rowIndex":0,"tableRowIndex":0,"tableColumnIndex":2,"state":"cell"},"result":["x"]},"hint":{"message":["Type <ltx>x</ltx> into the empty cell and then save your work."],"placement":"bottom"}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Evaluate the limits <ltx>\\lim_{x\\to0^+}\\left(\\tan\\left(x-\\frac{\\pi}{2}\\right)\\right)</ltx> and <ltx>\\lim_{x\\to0^-}\\left(\\tan\\left(x-\\frac{\\pi}{2}\\right)\\right)</ltx>."}],"waitForInput":true}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["\\tan\\left(x-\\frac{\\pi}{2}\\right)"]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":2,"cellIndex":0},"result":["\\tan\\left(x-\\frac{\\pi}{2}\\right)"]},"hint":{"message":["Let''s see the graph of the function. Please save cell."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":2,"cellIndex":0}}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":2,"cellIndex":0}}]},"hint":{"message":["Select the function and use the “Add function(s) to graph” action."],"placement":"bottom","persist":true}},{"trigger":{"type":"action","action":"addFunctionToGraph"}},{"trigger":{"type":"message"},"hint":{"message":["The effect of adding <ltx>-\\frac{\\pi}{2}</ltx> in the function is to shift the graph of <ltx>\\tan(x)</ltx>to the right by <ltx>\\frac{\\pi}{2}</ltx>. Here is the graph of <ltx>\\tan\\left(x-\\frac{\\pi}{2}\\right)</ltx>."],"placement":"top","target":{"type":"row","rowIndex":3}}},{"trigger":{"type":"freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (6, 161, false, false, '[{"hint": {"message": ["Let’s see how to write exponents in Gradarius. In the next step, you’ll begin by copying the whole equation to a new row. This is often a good first step."]}, "trigger": {"type": "message"}}, {"hint": {"message": ["Select the equation in the problem."], "placement": "right"}, "trigger": {"type": "selection", "items": [{"target": {"type": "problemCell", "index": 0}}]}}, {"hint": {"target": {"id": "fastActionNewRow", "type": "unique"}, "message": ["Copy the equation to a new row."], "placement": "left"}, "trigger": {"type": "action", "action": "copyToNewRow"}}, {"hint": {"message": ["Save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "type": "cellSave", "result": ["2 \\cdot \\left(x^{2}-4 \\cdot x\\right)=3 \\cdot x^{2}-\\left(x^{2}+4\\right)", "2 \\cdot \\left(x^{2}-4 \\cdot x\\right)=3 \\cdot x^{2}-\\left(x^{2}+4\\right)"]}}, {"hint": {"message": ["Use Rewrite to create a new cell."], "placement": "top"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "type": "cellAction", "action": "rewrite"}}, {"hint": {"message": ["Use delete or backspace to clear the contents of the cell."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "type": "cellEdit", "result": [""]}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "message": ["After distribution, the left side of the equation would be <ltx>2 \\cdot x^{2}-8 \\cdot x</ltx> and the right side would be <ltx>3 \\cdot x^{2}-x^{2}-4</ltx>."], "placement": "bottom"}, "trigger": {"type": "message"}}, {"hint": {"message": ["Exponents can be typed easily using the ^ key on the keyboard. Use the right or down arrow to bring the cursor out of the exponent.<br><img width=\"239\" height=\"92\" src=\"http://i89.fastpic.ru/big/2017/0421/68/740000b3b3a64007f701c641bf426868.gif\" alt=\"Typing the caret key for an exponent, then using right arrow to move out of the exponent.\">", "Exponents can also be entered using the Algebra pad in the right panel. Use the right or down arrow to bring the cursor out of the exponent.<br><img width=\"238\" height=\"94\" src=\"http://i89.fastpic.ru/big/2017/0421/7b/efb572f2ca7a440a86aaf10a17c67e7b.gif\" alt=\"Clicking the Exponent button in the Algebra pad, then using down arrow to move out of the exponent.\">"]}, "trigger": {"type": "message"}}, {"hint": {"message": ["To begin typing the new left side of the equation, type <ltx>2x</ltx>."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "type": "cellEdit", "result": ["2x"]}}, {"hint": {"target": {"type": "wysiwyg", "group": "Algebra"}, "message": ["Begin the exponent by clicking <ltx>x^n</ltx> in the Algebra pad or using the ^ key on your keyboard (on the 6 key)."], "placement": "left"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "type": "cellEdit", "result": ["2x^{ }"]}}, {"hint": {"message": ["Now type 2 in the exponent, and move the cursor out of the exponent by using the right or down arrow keys. "], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "type": "cellEdit", "result": ["2x^{2}"]}}, {"hint": {"message": ["Now write the rest of the equation using your new exponent-writing skill where appropriate: <ltx>2x^2-8x = 3x^2-x^2-4</ltx>. Then save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "type": "cellSave", "result": ["2x^2-8x=3x^2-x^2-4", "2 \\cdot x^{2}-8 \\cdot x=3 \\cdot x^{2}-x^{2}-4"]}}, {"hint": {"target": {"type": "wysiwyg", "group": "Algebra"}, "message": ["You can always use the Algebra pad to enter math, but there’s usually also a keyboard shortcut like the ^ key that makes writing math quick."], "placement": "left"}, "trigger": {"type": "message"}}, {"hint": {"message": ["Go ahead and finish the rest of this problem."]}, "trigger": {"type": "message"}}, {"trigger": {"type": "freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (15, 169, false, false, '[{"hint": {"message": ["In this tutorial, you’ll learn how to write interval notation in Gradarius."]}, "trigger": {"type": "message"}}, {"hint": {"message": ["Select the inequality."], "placement": "right"}, "trigger": {"type": "selection", "items": [{"target": {"type": "problemCell", "index": 0}}]}}, {"hint": {"target": {"id": "fastActionNewRow", "type": "unique"}, "message": ["Copy the inequality to a new row."], "placement": "right"}, "trigger": {"type": "action", "action": "copyToNewRow"}}, {"hint": {"message": ["Save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "type": "cellSave", "result": ["4 \\cdot x+1 \\le 9", "4 \\cdot x+1 \\le 9"]}}, {"hint": {"message": ["After you subtract <ltx>1</ltx> from both sides of the inequality, the inequality would be <ltx>4x \\leq 8</ltx>. Let’s see how to write <ltx>\\leq</ltx> in Gradarius.", "One way to write inequality symbols is to use the Algebra Pad.<br><img width=\"338\" height=\"94\" src=\"http://i89.fastpic.ru/big/2017/0511/81/5ca15a29f3be5cfbdd8f9f1e051e3081.gif\" alt=\"One side of an inequality is typed, then an inequality button is selected from the Algebra pad.\">", "Another way to write inequality symbols is to use your keyboard, typing &lt;= for <ltx>\\leq</ltx> or typing &gt;= for <ltx>\\geq</ltx>.<br><img width=\"382\" height=\"97\" src=\"http://i89.fastpic.ru/big/2017/0511/69/2dbd7858fbe31f6a92a2efcc32b79969.gif\" alt=\"One side of the inequality is typed, then the right arrow key and the equals sign are pressed. This creates a greater than or equal to symbol.\">"]}, "trigger": {"type": "message"}}, {"hint": {"message": ["Choose to rewrite the inequality."], "placement": "top"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "type": "cellAction", "action": "rewrite"}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "message": ["Write <ltx>4x \\leq 8</ltx> and then save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "type": "cellSave", "result": ["4x\\le8", "4 \\cdot x \\le 8"]}}, {"hint": {"message": ["Choose to rewrite the inequality."], "placement": "top"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 1}, "type": "cellAction", "action": "rewrite"}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 2}, "message": ["Divide both sides by <ltx>4</ltx> to get <ltx>x \\leq 2</ltx> and save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 2}, "type": "cellSave", "result": ["x\\le2", "x \\le 2"]}}, {"hint": {"message": ["Let’s go over some tips on how to write solutions in interval notation. All the notation you might need can be found in Sets and Intervals Pad.<br><img width=\"580\" height=\"314\" src=\"http://i89.fastpic.ru/big/2017/0511/79/15d95a7710bf3b171aede8e9ef225179.png\" alt=\"Sets and Intervals Pad\">", "You can also write intervals using the parentheses and brackets found on your keyboard. Use “inf” to obtain the infinity symbol.<br><img width=\"314\" height=\"95\" src=\"http://i89.fastpic.ru/big/2017/0511/d9/e8eb1c86b6476375306522bed3cb83d9.gif\" alt=\"Writing intervals using parentheses and brackets, and typing I N F to obtain the infinity symbol.\">", "If you need to write more than one interval with a union symbol, use “cup” for the union symbol (or choose it from Sets and Intervals Pad).<br><img width=\"356\" height=\"94\" src=\"http://i89.fastpic.ru/big/2017/0511/81/d4d42dd647062a8d90e74357fa9aad81.gif\" alt=\"Writing a union symbol between two intervals.\">", "One note of caution! Gradarius needs to know if you’re entering a point or an interval. If you’re writing an interval, make sure to use the correct button from the Sets and Intervals Pad.<br><img width=\"758\" height=\"328\" src=\"http://i89.fastpic.ru/big/2017/0511/bd/a1872b2cceecf984bf97f16ab5246ebd.png\" alt=\"Sets and Intervals Pad with the “Interval” and “Point” selections called out.\">"]}, "trigger": {"type": "message"}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 2}, "message": ["Go ahead and finish this problem by writing the solution in interval notation."], "placement": "bottom"}, "trigger": {"type": "message"}}, {"trigger": {"type": "freeSolve"}}]', false, false);
INSERT INTO public.problem_tutorials VALUES (29, 176, false, false, '[{"hint": {"message": ["Writing fractions is easiest when you begin the fraction before writing the math. Let’s see how this works."]}, "trigger": {"type": "message"}}, {"hint": {"message": ["You can start a fraction using the “/” (slash) key. Use the up and down arrows to move between numerator and denominator.<br><img width=\"260\" height=\"100\" src=\"http://i90.fastpic.ru/big/2017/0428/34/49e6cb806aef0d0d3cf4e33d64109f34.gif\" alt=\"Pressing the slash key to start a fraction, typing the numerator, moving to the bottom with down arrow and typing the denominator. Repeating for another fraction.\">", "You can also start a fraction using the Algebra pad. You can use the mouse to navigate to a different part of the fraction.<br><img width=\"316\" height=\"91\" src=\"http://i90.fastpic.ru/big/2017/0428/20/88fbd6ad03028a16f7c9fd4b76261120.gif\" alt=\"Clicking the slash button in the Algebra pad to start a fraction, then moving the cursor with arrow keys.\">", "Move in and out of the fraction using your mouse or by using the arrow keys.<br><img width=\"218\" height=\"115\" src=\"http://i90.fastpic.ru/big/2017/0428/17/20316f67d6d2a5d7c5d4bb15055f5417.gif\" alt=\"Moving into different parts of fractions by placing the cursor and clicking, then by using arrow keys.\">"]}, "trigger": {"type": "message"}}, {"hint": {"target": {"id": "fastActionNewRow", "type": "unique"}, "message": ["Let’s get started. Create a new row."], "placement": "right"}, "trigger": {"type": "action", "action": "addRow"}}, {"hint": {"message": ["Use the slash key “/” or the Algebra pad to begin a fraction. Then type <ltx>x^2-9</ltx> in the numerator."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "type": "cellEdit", "result": ["\\frac{x^{2}-9}{}"]}}, {"hint": {"target": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "message": ["Move the cursor to the denominator. Type <ltx>x+3</ltx> and then save your work."], "placement": "bottom"}, "trigger": {"cell": {"type": "expressionCell", "rowIndex": 0, "cellIndex": 0}, "type": "cellSave", "result": ["\\frac{x^2-9}{x+3}", "\\frac{ x^{2}-9 }{ x+3 }"]}}, {"hint": {"message": ["Good! This problem isn’t finished. Factor the numerator to simplify the expression and finish the problem on your own."]}, "trigger": {"type": "message"}}, {"trigger": {"type": "freeSolve"}}]', false, false);
