INSERT INTO public.problem_tutorials VALUES (61, 480, true, false, '[{"trigger":{"type":"message"},"hint":{"message":["Welcome to Gradarius! These Tutorials will help you learn the fastest ways to enter your work. Take a look at this problem, and click “Got It” when you’re ready to start."],"placement":"bottom","target":{"type":"problemCell","index":0}}},{"trigger":{"type":"action","action":"addRow"},"hint":{"message":["We need a place to enter our work. Click on “Create new row”"],"placement":"left","target":{"type":"unique","id":"fastActionNewRow"}}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["-3 \\cdot x=9","-3x=9"]},"hint":{"message":["The “box” you just created is called a cell. Cells are where you can write equations or expressions. To solve this equation we might first subtract 6 from both sides. Please write the resulting equation, <ltx>-3 \\cdot x=9</ltx>, in the new row."],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["-3x=9","-3 \\cdot x=9"]},"hint":{"message":["Press enter on the keyboard or use the circular enter icon to save your work."],"placement":"bottom"}},{"trigger":{"type":"cellAction","action":"rewrite","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0}},"hint":{"message":["You want a space to begin writing the next simplification of the equation. To create a new cell, you have to hover the cursor over the green arrow. This will open a pop-up menu showing “Rewrite”. You can either click the arrow, or move the pointer down to “Rewrite” and click."],"placement":"top"}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":1},"result":["x=-3"]},"hint":{"message":["If you divide both sides of <ltx>-3x=9</ltx> by <ltx>-3</ltx>, then the result is <ltx>x=-3</ltx>. Please edit the equation in the cell to read <ltx>x=-3</ltx>."],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":1},"result":["x=-3","x=-3"]},"hint":{"message":["Press enter on the keyboard or use the circular enter icon to save your work."],"placement":"bottom"}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":0,"cellIndex":1}}]},"hint":{"message":["OK! Now that you have the solution to the equation, you need to submit the answer. Select the object <ltx>x=-3</ltx> by clicking on it."],"placement":"right"}},{"trigger":{"type":"showFinalAnswerRow"}},{"trigger":{"type":"addFinalAnswer","placeholder":{"type":"placeholder","index":0}},"hint":{"message":["Click the plus icon to add <ltx>x=-3</ltx> to the answer space."],"placement":"right"}},{"trigger":{"type":"click","target":{"type":"unique","id":"faSubmit"}},"hint":{"message":["Now you can submit your answer."],"placement":"top"}}]', false, false);
