INSERT INTO public.problem_tutorials VALUES (70, 498, true, true, '[{"trigger":{"type":"addRows","rows":[{"type":"comment","text":["This self-paced course is designed to introduce you to—and help you master—essential topics in algebra. ","The course is powered by Gradarius, a unique math platform that allows you to write math in a fully free-form manner, all while giving you detailed, step-by-step feedback.","<p>&nbsp;</p>","<b>What is this course about?</b><p>&nbsp;</p>","Algebra is many things. It is a set of tools for expressing relationships among quantities. It also gives us powerful techniques for <em>determining</em> those quantities, ","thereby helping us answer questions about the world.","<p>&nbsp;</p>","Topics include real and complex numbers, linear and quadratic equations and inequalities, ","linear and quadratic functions, polynomials and rational expressions, ","exponential functions and logarithms, systems of equations."]}],"waitForInput":true}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":["<b>Why is this the right way to learn math?</b>","<p>&nbsp;</p>","We based our pedagogical approach on decades of teaching experience and an in-depth survey of modern educational research, as follows:","<ul><li>We believe that the best way to learn math is through problem-solving.</li><ul>","<ul><li>Problem-solving is most effective when it is about more than just getting the right answers.</li></ul>","<ul><li>Understanding and correcting your errors is an essential element to learning, so feedback should be instantaneous, specific, and comprehensive.</li></ul>","<ul><li>Students learn efficiently and build confidence when they overcome challenging problems, so the difficulty level should be user-specific and supported by multiple levels of instruction that give just enough support at just the right time.</li></ul>"]}],"label":"FINISH","waitForInput":true}},{"trigger":{"type":"message"},"hint":{"message":["<p>Thank you for reading!</p> We highly recommend that you review “How to get the most from this course?”  as well as complete all Gradarius Onboarding Tutorials. This will help you to work through the course more effectively and efficiently.</p>"]}}]', false, false);
