INSERT INTO public.solution_tutorial_progress VALUES (527, 14, '2020-11-04 15:40:45', '[{"trigger":{"type":"questions","message":"In this activity, we will be examining the local maximum and local minimum, global maximum and global minimum, as well as critical numbers, the extreme value theorem, and the first and second derivative test.","video":{"content":"<grd-youtube-video video-id=\"NIuP_RTIRpA\" />","notes":"Notes: <a href=\"https://authoring.gradarius.com/notes/Topic%2011-%20Maxima%20and%20Minima.pdf\" target=\"_blank\">Topic 11: Maxima and Minima</a>","questionTimes":[405000,845000]},"questions":[{"text":"Which of the following is true?<p style=\"text-align: left\"><img src=\"https://authoring.gradarius.com/img/Topic_11_Maxima_and_Minima_1.png\" width=\"300\" height=\"300\"></p><q-single-choice id=\"1\" />","successExplanation":"Correct. <ltx>f(-3)</ltx> is not less than or equal to every <ltx>f(x)</ltx> in an open interval around <ltx>x = -3</ltx>, only for values in the domain greater than <ltx>-3</ltx>.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":["Incorrect. <ltx>f(-3)</ltx> is a not less than or equal to every <ltx>f(x)</ltx> in an open interval around <ltx>x = -3</ltx>.","Incorrect. <ltx>f(-3)</ltx> is not greater than or equal to every <ltx>f(x)</ltx> in an open interval around <ltx>x = -3</ltx>.",null],"options":["<ltx>f(-3)</ltx> is a relative minimum since <ltx>f(-3)</ltx> is less than or equal to every <ltx>f(x)</ltx> in an open interval around <ltx>x = -3</ltx>.","<ltx>f(-3)</ltx> is a relative maximum since <ltx>f(-3)</ltx> is greater than or equal to every <ltx>f(x)</ltx> in an open interval around <ltx>x = -3</ltx>.","<ltx>f(-3)</ltx> is not a relative minimum since <ltx>f(-3)</ltx> is not less than or equal to every <ltx>f(x)</ltx> in an open interval around <ltx>x = -3</ltx>."],"correctAnswers":[2]}]},{"text":"True or False? If a singular (meaning the derivative is not defined) point exists in a graph, it is possible for a minima or maxima exist at that point. <q-single-choice id=\"1\" />","successExplanation":"Correct! While the derivative may not exist at a singular point, a minima or maxima can exist given it fulfills the conditions necessary in the First Derivative Test for Relative Extrema.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":[null,"Incorrect. While the derivative may not exist at a singular point, a minima or maxima can exist given it fulfills the conditions necessary in the First Derivative Test for Relative Extrema."],"options":["True","False"],"correctAnswers":[0]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Consider the function <ltx>4x - x^{2}</ltx> on the interval <ltx>-1 \\le x \\le 6</ltx>. Where does the absolute maximum occur? Where does the absolute minimum occur?"}],"waitForInput":true}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["\\frac{d}{dx}(4 x-  x^{2})","\\frac{d}{dx}(4 x-  x^{2})"]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":2,"cellIndex":1},"result":["4-2x","4-2 \\cdot x"]},"hint":{"message":["First, find the stationary points by computing the derivative."],"placement":"top","target":{"type":"expressionCell","rowIndex":2,"cellIndex":1}}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":2,"cellIndex":1}}]},"hint":{"message":["Now that you have the derivative, find the x-values where it equals zero. This can be done by setting it equal to zero in a new row and solving, or selecting <ltx>4 - 2x</ltx> and using the Zeros Action. Try using the Zeros action."],"placement":"top","persist":true}},{"trigger":{"type":"action","action":"ZerosFunc"}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":2,"cellIndex":1}}]},"hint":{"message":["The only place the derivative is zero is <ltx>x=2</ltx>, so this is the only stationary point.<br>Next, apply the first derivative test to find out if it’s a maximum, minimum, or neither. Evaluate the derivative at <ltx>x=0</ltx> and <ltx>x=4</ltx> using the Evaluate action on <ltx>4-2x</ltx>."],"placement":"right","persist":true}},{"trigger":{"type":"action","action":"EvalFunc"}},{"trigger":{"type":"cellSave","cell":{"type":"actionCell","rowIndex":4,"paramId":"var_x"},"result":["0","0"]}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":2,"cellIndex":1}}]}},{"trigger":{"type":"action","action":"EvalFunc"}},{"trigger":{"type":"cellSave","cell":{"type":"actionCell","rowIndex":5,"paramId":"var_x"},"result":["4","4"]},"hint":{"message":["The only place the derivative is zero is <ltx>x=2</ltx>, so this is the only stationary point. Next, apply the first derivative test to find out if it’s a maximum, minimum, or neither. Evaluate the derivative at <ltx>x=0</ltx> and <ltx>x=4</ltx> using the Evaluate action on <ltx>4-2x</ltx>."],"placement":"right","target":{"type":"expressionCell","rowIndex":2,"cellIndex":1}}},{"trigger":{"type":"questions","questions":[{"text":"At <ltx>x=0</ltx>, the derivative is positive, and at <ltx>x=4</ltx>, it’s negative. By the first derivative test, is the function at <ltx>x=2</ltx> a maximum, minimum, or neither? <q-dropdown id=\"1\" />","successExplanation":"Correct! The function is a maximum because it is increasing to the left of <ltx>x=2</ltx> and decreasing to the right of <ltx>x=2</ltx>.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":[null,"Incorrect. The function is increasing to the left of <ltx>x=2</ltx>, then decreasing to the right of <ltx>x=2</ltx>. Is it a maximum or neither?","Incorrect. The derivative changes signs so it has to be either a max or min."],"options":["maximum","minimum","Neither"],"correctAnswers":[0]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"<ltx>x=2</ltx> is the only stationary point, and there is no singular point, so it has to be the absolute maximum. Now to complete the problem, find the absolute minimum point by evaluating the function at the endpoints, <ltx>x=-1</ltx> and <ltx>x=6</ltx>"}],"waitForInput":false}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"goToStep","data":{"step":11}},{"event":"goToStep","data":{"step":12}},{"event":"goToStep","data":{"step":13}},{"event":"goToStep","data":{"step":14}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (528, 15, '2020-11-04 15:40:56', '[{"trigger":{"type":"questions","message":"In this activity, we will be examining the rate of change of the accumulation function of some varying quantity. As well as the Fundamental Theorem of Calculus.","video":{"content":"<grd-youtube-video video-id=\"JQM-m3Z0Ufk\" />","notes":"<a href=\"https://authoring.gradarius.com/notes/Topic%2020-%20The%20Fundamental%20Theorem%20of%20Calculus.pdf\" target=\"_blank\">The Fundamental Theorem of Calculus</a>","questionTimes":[112000,113000]},"questions":[{"text":"True or False? The added constant <ltx>\\left (+ C \\right)</ltx> that occurs in the answer for indefinite integrals is unnecessary in definite integrals. <q-single-choice id=\"1\" />","successExplanation":"Correct! The added constant (<ltx>+ C</ltx>) that occurs in the answer for indefinite integrals is unnecessary in definite integrals because the the two generated <ltx>C</ltx>s would cancel each other out when <ltx>F(b)-F(a)</ltx> occurs.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":[null,"Incorrect. The added constant (+ <ltx>C</ltx>) that occurs in the answer for indefinite integrals is unnecessary in definite integrals because the the two generated <ltx>C</ltx>s would cancel each other out when <ltx>F(b)-F(a)</ltx> occurs. "],"options":["True","False"],"correctAnswers":[0]}]},{"text":"Evaluate the following integral: <ltx>\\int_5^4 2x dx = \\left[ x^2 \\right]_5^4</ltx>. (Simplify your answer.)<q-expression id=\"1\" />","successExplanation":"Correct! Despite the upper limit of an integral typically being larger than the lower limit, this integral would be evaluated the same way as a standard one. Thus, the answer would be <ltx>-9</ltx>.","giveUpExplanation":"<ltx>\\left[ x^2 \\right]_5^4 = 4^2-5^2 = -9</ltx>.","giveUpTrials":2,"inputs":[{"id":"1","type":"expression","mistakeExplanations":["Incorrect. Despite the upper limit typically being larger than the lower limit, you can still evaluate from <ltx>5</ltx> to <ltx>4</ltx>.","Incorrect. In this case, <ltx>\\left[ x^2 \\right]_5^4=4^2-5^2</ltx>."],"correctAnswers":["-9","-9.0"]}],"matchType":"exact"}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"The rate of change of the cost function per day is given by the function <ltx>f(x) = \\frac{6}{x^2} + 4x</ltx>, where <ltx>f(x)</ltx> is measured in thousands of dollars per day. Estimate the total cost from day one to day three."}],"waitForInput":true}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"The total cost is the <strong>antiderivative</strong> of the rate of change of the total cost, so we will evaluate a definite integral. To estimate the total cost from day one to day three:<br><br>The lower limit of the definite integral is <ltx>1</ltx>.<br>The upper limit of the definite integral is <ltx>3</ltx>.<br>The function in the integrand is <ltx>\\frac{6}{x^2} + 4x</ltx>."}],"waitForInput":true}},{"trigger":{"type":"message"},"hint":{"message":["You can enter definite integrals using keyboard shortcuts. Let’s see how this works."]}},{"trigger":{"type":"action","action":"addRow"},"hint":{"message":["Click “Create new row”."],"placement":"right","target":{"type":"unique","id":"fastActionNewRow"}}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":3,"cellIndex":0},"result":["\\int_{ }^{ }"]},"hint":{"message":["Type “dint”."],"placement":"bottom"}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":3,"cellIndex":0},"result":["\\int_{1}^{3}"]},"hint":{"message":["You just created a definite integral sign. Enter the limits for the integral, <ltx>a=1</ltx> and <ltx>b=3</ltx>. You can move around using the arrow keys.<br><img width=\"152\" height=\"76\" src=\"https://authoring.gradarius.com/img/Topic_20-The_Fundamental_Theorem_of_Calculus_1.gif\" alt=\"Entering limits and an integrand in a definite integral. Remember to write the differential.\">"],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":3,"cellIndex":0},"result":["\\int_{1}^{3} \\frac{6}{x^2}+4xdx"]},"hint":{"message":["Now that you’ve entered the limits, move the cursor to the right of the integral sign and enter the function so that the integral looks like <ltx>\\int_{1}^{3} \\frac{6}{x^2}+4xdx</ltx>. Then save your work."],"placement":"bottom"}},{"trigger":{"type":"cellAction","action":"rewrite","cell":{"type":"expressionCell","rowIndex":3,"cellIndex":0}},"hint":{"message":["Great! You’ve set up the integral. Now it needs to be evaluated. Click the equals sign to rewrite the cell."],"placement":"top"}},{"trigger":{"type":"message"},"hint":{"message":["A convenient shorthand for <ltx>F(b) - F(a)</ltx> in Gradarius is bracket notation: <ltx>\\left[F(x)\\right]_a^b</ltx>.<br><img width=\"294\" height=\"108\" src=\"https://authoring.gradarius.com/img/Topic_20-The_Fundamental_Theorem_of_Calculus_2.gif\" alt=\"Using square brackets to evaluate a definite integral.\">"],"placement":"bottom","target":{"type":"expressionCell","rowIndex":3,"cellIndex":1}}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":3,"cellIndex":1},"result":["\\left[\\frac{-6}{x}+2x^2\\right]","\\left[-\\frac{6}{x}+2x^2\\right]"]},"hint":{"message":["The antiderivative for this integral is <ltx>\\frac{-6}{x}+2x^2</ltx>. Clear the cell contents and use square brackets to enter <ltx>\\left[\\frac{-6}{x}+2x^2\\right]</ltx>."],"placement":"bottom"}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":3,"cellIndex":1},"result":["\\left[\\frac{-6}{x}+2x^2\\right]^3","\\left[-\\frac{6}{x}+2x^2\\right]^3"]},"hint":{"message":["You now have to enter the limits of the integral. Use the caret “^” to enter 3 as the upper limit."],"placement":"bottom"}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":3,"cellIndex":1},"result":["\\left[\\frac{-6}{x}+2x^2\\right]_{}^3","\\left[-\\frac{6}{x}+2x^2\\right]_{}^3"]},"hint":{"message":["Move the cursor to the right, and then use the Shift+dash “-” keys to enter an underscore “_”."],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":3,"cellIndex":1},"result":["\\left[-\\frac{6}{x}+2x^2\\right]_1^3"]},"hint":{"message":["The underscore will let you place <ltx>1</ltx> as the lower limit. After you’ve done this, save your work."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["You’ve found the antiderivative. Now finish evaluating the integral and submit your answer as a number."]}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"goToStep","data":{"step":11}},{"event":"goToStep","data":{"step":12}},{"event":"goToStep","data":{"step":13}},{"event":"goToStep","data":{"step":14}},{"event":"goToStep","data":{"step":15}},{"event":"end","data":null}]');
