INSERT INTO public.solution_tutorial_progress VALUES (506, 13, '2020-11-04 15:36:55', '[{"trigger":{"type":"message"},"hint":{"message":["Solving a problem is not just about getting the final answer — it’s also about showing your work.","Although you have the freedom to enter your solution in many different ways, Gradarius will be on the lookout for certain <i>essential steps</i> in your work. These are steps that any full solution to the problem should contain.","In Tutor Mode, Gradarius will flag essential steps with a green checkmark immediately after you enter them, thus letting you know that you’ve entered a key part of the solution, and also that you’re on the right track."]}},{"trigger":{"type":"action","action":"addRow"},"hint":{"message":["Begin by creating a new row."],"placement":"right","target":{"type":"unique","id":"fastActionNewRow"}}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["f\\left(x-3\\right)=2\\left(x-3\\right)+3","f\\left(x-3\\right)=2 \\cdot \\left(x-3\\right)+3"]},"hint":{"message":["Type <ltx>f(x-3)=2(x-3)+3</ltx> into the empty cell and then save your work."],"placement":"bottom"}},{"trigger":{"type":"cellAction","action":"rewrite","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0}},"hint":{"message":["The blue checkmark means you''ve entered a step contained in the expert solution. So far so good! Next, rewrite and then simplify the right side. Firstly, use Rewrite to begin a new cell."],"placement":"top"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":1},"result":["f\\left(x-3\\right)=2x-3","f\\left(x-3\\right)=2 \\cdot x-3"]},"hint":{"message":["Edit the expression to read <ltx>f(x-3)=2x-3</ltx> and then save your work."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["When you type a left parenthesis, Gradarius will automatically create the right \")\" for you. You can retype it, but you don''t have to.","Just use the right arrow to move past the right \")\" and it will become permanent.<br><img width=\"388\" height=\"74\" src=\"http://i89.fastpic.ru/big/2017/0425/2b/5e486284909dba3e07e337d74a480d2b.gif\" alt=\"Moving past the right parenthesis.\">"]}},{"trigger":{"type":"action","action":"addRow"},"hint":{"message":["Next, create a new row to continue your solution."],"placement":"right","target":{"type":"unique","id":"fastActionNewRow"}}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":1,"cellIndex":0},"result":["f\\left(x-3\\right)-f\\left(x\\right)=2x-3-\\left(2x+3\\right)"]},"hint":{"message":["Enter <ltx>f(x-3)-f(x)=2x-3-(2x+3)</ltx> into the empty cell."],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":1,"cellIndex":0},"result":["f\\left(x-3\\right)-f\\left(x\\right)=2\\cdot x-3-\\left(2\\cdot x+3\\right)","f\\left(x-3\\right)-f\\left(x\\right)=2 \\cdot x-3-\\left(2 \\cdot x+3\\right)"]},"hint":{"message":["Save your work."],"placement":"bottom"}},{"trigger":{"type":"click","target":{"type":"assist","status":"success","subtarget":"icon"}},"hint":{"message":["Good! Notice how Gradarius has flagged this step with a green checkmark. Click on the checkmark."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["Gradarius lets you know that you’ve entered an essential step of the solution and therefore that you’re on the right track."],"placement":"bottom","target":{"type":"assist","status":"success","subtarget":"area"}}},{"trigger":{"type":"message"},"hint":{"message":["Note how the first step you entered wasn’t flagged as an essential step, since, although useful, it wasn’t a necessary part of the solution. You could have started with the step that was marked essential."],"placement":"bottom","target":{"type":"assist","status":"noproblem","subtarget":"icon"}}},{"trigger":{"type":"message"},"hint":{"message":["Some problems may have multiple essential steps. Other problems may have no essential steps if they’re relatively straightforward.","Depending on the grading strategy chosen by your instructor, Gradarius may also use essential steps to award partial credit, even if your final answer is incorrect.","Now that you understand how essential steps work, go ahead and complete this problem on your own."]}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"goToStep","data":{"step":11}},{"event":"goToStep","data":{"step":12}},{"event":"goToStep","data":{"step":13}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (525, 20, '2020-11-04 15:40:22', '[{"trigger":{"type":"questions","message":"In this activity, we will be examining when a function approaches positive or negative infinity, in which some functions are bounded by a horizontal asymptote.","video":{"content":"<grd-youtube-video video-id=\"gPkSFDSt39Y\" />","notes":"<a href=\"https://authoring.gradarius.com/notes/2.1-Limits-At-Infinity.pdf\" target=\"_blank\">Notes</a>","questionTimes":[505000,1089000]},"questions":[{"text":"How many horizontal asymptotes would the graph of the function have if it was shifted up <ltx>+2</ltx>? <q-single-choice id=\"1\" />","successExplanation":"Correct! The graph would still have two horizontal asymptotes, one at <ltx>-\\frac{\\pi}{2}+2</ltx> and one at <ltx>\\frac{\\pi}{2}+2</ltx>, because <ltx>\\lim_{x\\to\\infty}f(x)</ltx> and <ltx>\\lim_{x\\to-\\infty}f(x)</ltx> still exist and are shifted up by <ltx>2</ltx>.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":["Incorrect. The graph will still have two horizontal asymptotes. What is necessary for the graph to have asymptotes?","Incorrect. The graph will still have two horizontal asymptotes. What is necessary for the graph to have asymptotes?",null],"options":["0","1","2"],"correctAnswers":[2]}]},{"text":"What do we mean when we say <ltx>\\frac{1}{5x}</ltx> is a close approximation of <ltx>f(x)</ltx>? <q-single-choice id=\"1\" />","successExplanation":"Correct! Although <ltx>\\frac{1}{5x}</ltx> and <ltx>f(x)</ltx> do approach the same asymptote, a close approximation specifically refers to the conclusion that the difference between two functions, <ltx>\\frac{1}{5x}-f(x)</ltx>, gets as close to zero as we desire (provided we take x sufficiently large and negative in this case).","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":["Incorrect. Although <ltx>\\frac{1}{5x}</ltx> and <ltx>f(x)</ltx> do approach the same asymptote, a close approximation specifically refers to the conclusion that the difference between two functions, <ltx>\\frac{1}{5x}-f(x)</ltx>, gets as close to zero as we desire (provided we take x sufficiently large and negative in this case).",null,"Incorrect. Close approximations are not determined by the sum <ltx>\\frac{1}{5x}+f(x)</ltx>."],"options":["<ltx>\\frac{1}{5x}</ltx> and <ltx>f(x)</ltx> approach the same asymptote.","The difference <ltx>\\frac{1}{5x}-f(x)</ltx> gets as close to zero as we desire (provided we take x sufficiently large and negative).","The sum <ltx>\\frac{1}{5x}+f(x)</ltx> gets as close to one as we desire (provided we take <ltx>x</ltx> sufficiently large and negative)."],"correctAnswers":[1]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Determine the behavior of <ltx>f(x)=\\frac{x+1}{6x^2-x+1}</ltx> as <ltx>x\\to\\infty<ltx>.</ltx></ltx>"}],"waitForInput":true}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["\\lim_{x\\to\\infty}\\frac{x+1}{6x^2-x+1}"]}],"waitForInput":false}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":2,"cellIndex":0},"selection":"\\frac{x+1}{6x^2-x+1}"}]},"hint":{"message":["First, evaluate <ltx>\\lim_{x\\to\\infty}\\frac{x+1}{6x^2-x+1}</ltx> numerically to determine if the function has an asymptote. Start by selecting just the function, then using the “Evaluate at” Action at the point <ltx>x=100</ltx>."],"placement":"right","persist":true}},{"trigger":{"type":"action","action":"EvalFunc"}},{"trigger":{"type":"cellSave","cell":{"type":"actionCell","rowIndex":3,"paramId":"var_x"},"result":["100","100"]}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["\\frac{101}{59901}=0.00168612"]}],"waitForInput":false}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":2,"cellIndex":0},"selection":"\\frac{x+1}{6x^2-x+1}"}]},"hint":{"message":["Here’s the decimal version as well. Use the Evaluate at Action on the function again at the point <ltx>x=1000</ltx>."],"placement":"right","target":{"type":"expressionCell","rowIndex":4,"cellIndex":0},"persist":true}},{"trigger":{"type":"action","action":"EvalFunc"}},{"trigger":{"type":"cellSave","cell":{"type":"actionCell","rowIndex":5,"paramId":"var_x"},"result":["1000","1000"]}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["\\frac{1001}{5999001}=0.00016686"]}],"waitForInput":false}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":2,"cellIndex":0},"selection":"\\frac{x+1}{6x^2-x+1}"}]},"hint":{"message":["Use the Evaluate at Action one more time at <ltx>x=10000</ltx>."],"placement":"right","target":{"type":"expressionCell","rowIndex":6,"cellIndex":0},"persist":true}},{"trigger":{"type":"action","action":"EvalFunc"}},{"trigger":{"type":"cellSave","cell":{"type":"actionCell","rowIndex":7,"paramId":"var_x"},"result":["10000","10000"]}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["\\frac{10001}{599990001} = 1.66686 \\cdot 10^{-5}"]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":8,"cellIndex":0},"result":["\\frac{10001}{599990001}=1.66686\\cdot10^{-5}","\\frac{ 10001 }{ 599990001 }=1.66686 \\cdot 10^{-5}"]},"hint":{"message":["Here’s the decimal version. Please save the cell."],"placement":"right"}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"As <ltx>x</ltx> increases by a factor of ten, the function gets closer to zero by about a factor of ten. This means the limit of the function approaches zero as <ltx>x</ltx> approaches infinity."}],"waitForInput":true}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["\\frac{x+1}{6x^2-x+1}","\\frac{}{}\\frac{1+x^{-1}}{1-\\frac{x^{-1}}{6}+\\frac{x^{-2}}{6}}"]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":10,"cellIndex":1},"result":["\\frac{1}{6x}\\cdot\\frac{1+x^{-1}}{1-\\frac{x^{-1}}{6}+\\frac{x^{-2}}{6}}","\\frac{ 1 }{ 6 \\cdot x } \\cdot \\frac{ 1+x^{-1} }{ 1-\\frac{ x^{-1} }{ 6 }+\\frac{ x^{-2} }{ 6 } }"],"matchType":"calculus"},"hint":{"message":["This function is approaching zero as <ltx>x\\to\\infty</ltx>. Now determine which function <ltx>f(x)</ltx> is very close to as <ltx>x</ltx> gets large. Which factor should go in front of the fraction to make this equality true?"],"placement":"right"}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"You’ve rewritten the fraction into a form that allows you to see it’s behavior as x approaches <ltx>\\infty</ltx>. Use this information to complete the problem."}],"waitForInput":true}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"goToStep","data":{"step":11}},{"event":"goToStep","data":{"step":12}},{"event":"goToStep","data":{"step":13}},{"event":"goToStep","data":{"step":14}},{"event":"goToStep","data":{"step":15}},{"event":"goToStep","data":{"step":16}},{"event":"goToStep","data":{"step":17}},{"event":"goToStep","data":{"step":18}},{"event":"goToStep","data":{"step":19}},{"event":"goToStep","data":{"step":20}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (522, 17, '2020-11-04 15:39:23', '[{"trigger":{"type":"questions","questions":[{"text":"Let’s begin with a question: Imagine that, starting at the point <ltx>(1,0)</ltx>, an object moves at constant speed around the unit circle in the counterclockwise direction, completing one rotation every <ltx>2\\pi</ltx> seconds. Then what is <ltx>h(t)</ltx>, the height of the object <ltx>t</ltx> seconds after it starts moving? <q-expression id=\"1\" />","successExplanation":"Well done! The height of the object as a function of time is described by nothing other than the sine function.","giveUpExplanation":"The answer is <ltx>h(t)=\\sin(t)</ltx>. Please submit this answer to continue.","giveUpTrials":3,"inputs":[{"id":"1","type":"expression","mistakeExplanations":["Try again. Remember that you’re looking for a function that keeps track of the height of an object moving around the unit circle.","Try again. Here’s a hint: The answer is a basic trigonometric function. Think about how the basic trigonometric functions are defined.","That’s incorrect."],"correctAnswers":["h(t)=\\sin(t)"]}]},{"text":"Now imagine that the object moves at constant speed around a circle of radius <ltx>3</ltx>, starting at the point <ltx>(3,0)</ltx> and completing one rotation every <ltx>2\\pi</ltx> seconds. What is <ltx>h(t)</ltx>, the function that describes the height of the object <ltx>t</ltx> seconds after it starts moving? <q-expression id=\"1\" />","successExplanation":"Nice! The sine function must be multiplied by a factor of <ltx>3</ltx>.","giveUpExplanation":"The answer is <ltx>h(t)=3\\sin(t)</ltx>. Please submit this answer to continue.","giveUpTrials":3,"inputs":[{"id":"1","type":"expression","mistakeExplanations":["Try again. Think about how to encode the radius of the circle in your answer.","Try again. Here’s a hint: You’ll need to apply a transformation to the function <ltx>\\sin(t)</ltx>.","That’s incorrect. The sine function must be multiplied by a factor of <ltx>3</ltx>."],"correctAnswers":["h(t)=3\\sin(t)"]}]},{"text":"Suppose that the object moves at constant speed around a circle of radius <ltx>3</ltx>, starting at the point <ltx>(3,0)</ltx>, but completes one rotation per second. What is the height of the object as a function of time now? <q-expression id=\"1\" />","successExplanation":"Good job! The input of the function <ltx>3\\sin(t)</ltx> must be multiplied by a factor of <ltx>2\\pi</ltx>, so that as <ltx>t</ltx> changes from <ltx>0</ltx> to <ltx>1</ltx>, the input of sine changes from <ltx>0</ltx> to <ltx>2\\pi</ltx>, making the object complete a full rotation after one second.","giveUpExplanation":"The answer is <ltx>h(t)=3\\sin(2\\pi t)</ltx>. Please submit this answer to continue.","giveUpTrials":3,"inputs":[{"id":"1","type":"expression","mistakeExplanations":["Try again. Think about how to encode the period of the object in your answer.","Try again. Here’s a hint: You’ll need to apply a transformation to the function <ltx>3\\sin(t)</ltx>","That’s incorrect. The input of the function <ltx>3\\sin(t)</ltx> must be multiplied by a factor of <ltx>2\\pi</ltx>, so that as <ltx>t</ltx> changes from <ltx>0</ltx> to <ltx>1</ltx>, the input of sine changes from <ltx>0</ltx> to <ltx>2\\pi</ltx>, making the object complete a full rotation after one second."],"correctAnswers":["h(t)=3\\sin(2\\pi t)"]}]},{"text":"Finally, let’s imagine that the object moves around a circle of radius <ltx>3</ltx>, completing one rotation per second, but that this time the circle is centered at the point <ltx>(0,1)</ltx>, and the object is at the point <ltx>(3,1)</ltx> at time <ltx>t=0</ltx>. What is the height of the object as a function of time? <q-expression id=\"1\" />","successExplanation":"Correct! The function <ltx>3\\sin(t)</ltx> must be increased by <ltx>1</ltx>, since at a given moment in time <ltx>t \\geq 0</ltx>, the object’s height is <ltx>1</ltx> greater than what it would be if the circle were centered at the origin.","giveUpExplanation":"The answer is <ltx>h(t)=3\\sin(2 \\pi t)+1</ltx>. Please submit this answer to continue.","giveUpTrials":3,"inputs":[{"id":"1","type":"expression","mistakeExplanations":["Try again. Think about how to encode the change in position of the circle in your answer.","Try again. Here’s a hint: You’ll need to apply a transformation to the function <ltx>3\\sin(2 \\pi t)</ltx>.","That’s incorrect. The function <ltx>3\\sin(2 \\pi t)</ltx> must be increased by <ltx>1</ltx>, since at a given moment in time <ltx>t \\geq 0</ltx>, the object’s height is <ltx>1</ltx> greater than what it would be if the circle were centered at the origin."],"correctAnswers":["h(t)=3\\sin(2 \\pi t)+1"]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"The previous exercises capture the basic ideas involved in modeling periodic behavior: Begin with a basic trigonometric function, like sine, then apply transformations to it in order to fit observed data. Such a function is called a sinusoidal function. By definition, a sinusoidal function <ltx>f</ltx> has the general form<p><ltx>f(t)=A\\sin(B(t-C))+D</ltx>,</p>where <ltx>A</ltx>, <ltx>B</ltx>, <ltx>C</ltx>, and <ltx>D</ltx> are constants. Let’s make sure you understand what these constants represent!"}],"waitForInput":true}},{"trigger":{"type":"questions","video":{"content":"<video width=\"1024\" height=\"768\" src=\"https://authoring.gradarius.com/video/TrigModeling_Take2.mp4\" controls=\"true\"></video>","questionTimes":[]},"questions":[]}},{"trigger":{"type":"questions","questions":[{"text":"True or false: The function <ltx>f(t)=\\cos(t)</ltx> is a sinusoidal function. <q-single-choice id=\"1\" />","successExplanation":"Correct! Note that cosine is the same as sine shifted <ltx>\\frac{\\pi}{2}</ltx> units to the left, i.e. <ltx>\\cos(t)=\\sin\\left(t+\\frac{\\pi}{2}\\right)</ltx>. When cooking up a sinusoidal function, you can in general use either sine or cosine, but one choice may be more convenient depending on the data you’re given.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":[null,"That''s incorrect."],"options":["True","False"],"correctAnswers":[0]}]},{"text":"What is the phase shift of the sinusoidal function <ltx>\\sin(5t-1)</ltx>? <q-expression id=\"1\" />","successExplanation":"Well done! Since <ltx>\\sin(5t-1)=\\sin\\left(5\\left(t-\\frac{1}{5}\\right)\\right)</ltx>, the phase shift is <ltx>\\frac{1}{5}</ltx>. You can graph the function to see this with your own eyes.","giveUpExplanation":"The answer is <ltx>\\frac{1}{5}</ltx>. Please submit this answer to continue.","giveUpTrials":3,"inputs":[{"id":"1","type":"expression","mistakeExplanations":["Try again. Remember that for sinusoidal functions, <i>phase shift</i> is just another way of saying <i>horizontal shift</i>.","Try again. Here’s a hint: To find the phase shift, put the function into the form <ltx>A\\sin(B(t-C))+D</ltx>. The phase shift is the constant <ltx>C</ltx>.","That’s incorrect."],"correctAnswers":["\\frac{1}{5}"]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Suppose that, at a certain spot on the beach, high tide is measured to be <ltx>8</ltx> ft at midnight and low tide is measured to be <ltx>0.2</ltx> ft some time later. Suppose that the next high tide occurs at noon.<ol class=\"lower-alpha\"><li>Find a trigonometric model <ltx>h\\left(t\\right)</ltx> that describes the height of the water level as a function of time.</li><li>Graph ​<ltx>h\\left(t\\right)</ltx>. (Submit this graph as part of your final answer.)</li><li>Estimate what the water level will be at 10:00 am.</li></ol>"}],"waitForInput":true}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Let’s create a sinusoidal function that describes the height of the water level <ltx>t</ltx> hours after midnight. Since the water level is maximal at <ltx>t=0</ltx>, it makes sense to work with a cosine function, which is itself maximal at <ltx>0</ltx>.<br><br>Our basic model will be <ltx>h(t)=A\\cos(B(t-C))+D</ltx>. We simply need to determine the constants <ltx>A</ltx>, <ltx>B</ltx>, <ltx>C</ltx>, and <ltx>D</ltx>."},{"type":"expressions","cells":["A = \\textcolor{edit}{0}{ }"]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":6,"cellIndex":0},"mistakeExplanations":["Try again."],"result":["A=3.9","A=3.9"]},"hint":{"message":["What is the amplitude <ltx>A = \\frac{\\text{max} - \\text{min}}{2}</ltx>?"],"placement":"bottom"}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["B = \\textcolor{edit}{0}{ }"]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":7,"cellIndex":0},"mistakeExplanations":["Try again."],"result":["B=\\frac{\\pi}{6}","B=\\frac{ \\pi }{ 6 }"]},"hint":{"message":["To find <ltx>B</ltx>, which controls the period, we need to recognize that the period is <ltx>12</ltx> hours (the length of time from one high tide to the next), then solve the equation <ltx>\\frac{2\\pi}{B}=12</ltx>. What is <ltx>B</ltx>?"],"placement":"bottom"}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["C = \\textcolor{edit}{0}{ }"]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":8,"cellIndex":0},"mistakeExplanations":["Try again."],"result":["C=0","C=0"]},"hint":{"message":["Since the water level is already maximal at time <ltx>t=0</ltx> (midnight), what should the phase shift <ltx>C</ltx> be?"],"placement":"bottom"}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["D = \\textcolor{edit}{0}{ }"]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":9,"cellIndex":0},"mistakeExplanations":["Try again."],"result":["D=4.1","D=4.1"]},"hint":{"message":["Finally, find the vertical shift <ltx>D = \\frac{\\text{max} + \\text{min}}{2}</ltx>."],"placement":"bottom"}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["h(t) = \\textcolor{edit}{0}{ }"]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":10,"cellIndex":0},"mistakeExplanations":["Try again. Remember that we’re working with the general model <ltx>h(t)=A\\cos(B(t-C))+D</ltx>. You just need to substitute the values of <ltx>A</ltx>, <ltx>B</ltx>, <ltx>C</ltx>, and <ltx>D</ltx> you already found."],"result":["h\\left(t\\right)=3.9\\cos\\left(\\frac{\\pi}{6}t\\right)+4.1","h\\left(t\\right)=3.9 \\cdot \\cos\\left(\\frac{ \\pi }{ 6 } \\cdot t\\right)+4.1"]},"hint":{"message":["Good! Now put everything together and enter the full trigonometric model."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["Well done. That takes care of part (a). To answer parts (b) and (c), graph <ltx>h(t)</ltx>, then determine the water level at 10:00 am. Go ahead and do this on your own."]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Answer parts (b) and (c) next. Go ahead and do this on your own."}],"waitForInput":false}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"goToStep","data":{"step":11}},{"event":"goToStep","data":{"step":12}},{"event":"goToStep","data":{"step":13}},{"event":"goToStep","data":{"step":14}},{"event":"goToStep","data":{"step":15}},{"event":"goToStep","data":{"step":16}},{"event":"goToStep","data":{"step":17}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (529, 17, '2020-11-04 15:41:12', '[{"trigger":{"type":"questions","message":"In this activity, we will be examining integration problems and how to compute new types of integrals using the product rule of differentiation. This method is called integration by parts.","video":{"content":"<grd-youtube-video video-id=\"9axIE3bu9so\" />","notes":"<a href=\"https://authoring.gradarius.com/notes/Topic%2021-%20Integration%20by%20Parts.pdf\" target=\"_blank\">Integration by Parts</a>","questionTimes":[254000,808000]},"questions":[{"text":"Choose what’s wrong/missing in the following formula for integration by parts: <ltx>\\int u \\left(dv\\right) = uv - \\int v \\left(du\\right)</ltx> <q-single-choice id=\"1\" />","successExplanation":"Correct! This formula is correct as is. It is highly recommended you commit it to memory.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":["Incorrect. This formula is correct as is. You should commit it to memory.","Incorrect. This formula is correct as is. You should commit it to memory.","Incorrect. This formula is correct as is. You should commit it to memory.",null],"options":["<ltx>v(du)</ltx> should be labeled as <ltx>v(du)(dx)</ltx>","<ltx>v(du)</ltx> should be labeled as <ltx>v(dv)</ltx>","<ltx>uv</ltx> should be labeled as <ltx>uv(du)</ltx>","Nothing is wrong with this formula"],"correctAnswers":[3]}]},{"text":"True or False? <ltx>\\int x \\left((x^2-1)^3 \\right)dx</ltx> requires use of integration by parts. <q-single-choice id=\"1\" />","successExplanation":"Correct! Using the substitution <ltx>u=x^2-1</ltx>, the equation can be reduced to <ltx>\\int udu</ltx>. This can be solved using the power rule.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":["Incorrect. Using the substitution <ltx>u=x^2-1</ltx>, the equation can be reduced to <ltx>\\int udu</ltx>. This can be solved using the power rule.",null],"options":["True","Fals