INSERT INTO public.solution_tutorial_progress VALUES (532, 7, '2020-11-04 15:42:03', '[{"trigger":{"type":"questions","message":"In this activity, we will be examining the two different types of integrals.","video":{"content":"<grd-youtube-video video-id=\"UBH02DEI8A0\" />","notes":"<a href=\"https://authoring.gradarius.com/notes/Topic%2025-%20Improper%20Integrals.pdf\" target=\"_blank\">Improper Integrals</a>","questionTimes":[307000,882000]},"questions":[{"text":"If you have an integral <ltx>\\int_{-\\infty}^{\\infty} f(x)dx</ltx>, what is the <u>first step</u> you need to take in order to solve it? <q-single-choice id=\"1\" />","successExplanation":"Correct! Breaking the integral into two parts is necessary before you substitute in t and take the limit of the integral. This allows you to use the formula separately on both parts.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":["Incorrect. Breaking the integral into two parts is necessary before you substitute in <ltx>t</ltx> and take the limit of the integral. This allows you to use the formulas separately on both parts.",null,"Incorrect. This choice applies a limit, but does not substitute the limit variable into the integral in any way. What is the first step you need to be able to apply the limit formulas?","Incorrect. You have to use limits to evaluate this integral. What is the first step you need to be able to apply the limit formulas?"],"options":["Substitute <ltx>-t</ltx> for <ltx>-\\infty</ltx> and <ltx>t</ltx> for <ltx>\\infty</ltx> <ltx>\\left( \\int_{-t}^{t} f(x)dx \\right)</ltx>","Break up the integral into two parts <ltx>\\int_{-\\infty}^{a} f(x)dx+\\int_{a}^{\\infty} f(x)dx</ltx>","Take the limit of the integral <ltx>\\lim_{t \\to \\infty} \\int_{-\\infty}^{\\infty}f(x)dx</ltx>","Nothing special, just integrate it"],"correctAnswers":[1]}]},{"text":"True or False? If you have an integral that is evaluated from a discontinuous point to infinity, the first step you should take is to break the integral apart. <q-single-choice id=\"1\" />","successExplanation":"Correct! Breaking an integral apart is the first step you would take in this scenario.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":[null,"Incorrect. Breaking an integral apart is the first step you would take in this scenario."],"options":["True","False"],"correctAnswers":[0]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Evaluate <ltx>\\int_{1}^{\\infty}\\frac{1}{x^3}dx</ltx>. If the integral diverges, leave the answer placeholder blank."}],"waitForInput":true}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["\\lim_{\\textcolor{edit}{0}{t} \\to \\textcolor{edit}{0}{}}\\int_{1}^{t}\\frac{1}{x^3}dx"]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":2,"cellIndex":0},"result":["\\lim_{t\\to\\infty}\\left(\\int_1^t\\frac{1}{x^3}dx\\right)","\\lim_{t \\to \\infty}\\left(\\int_{1}^{t}{\\frac{ 1 }{ x^{3} } d x}\\right)"]},"hint":{"message":["This is an improper integral with <ltx>\\infty</ltx> in the upper limit. We will use the variable t and we will take the limit as t approaches a particular value. What should the value in the limit be?"],"placement":"right"}},{"trigger":{"type":"cellAction","action":"rewrite","cell":{"type":"expressionCell","rowIndex":2,"cellIndex":0}},"hint":{"message":["Please rewrite the cell"],"placement":"top"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":2,"cellIndex":1},"result":["\\lim_{t\\to\\infty}\\left(\\left[-\\frac{1}{2x^2}\\right]_1^t\\right)","\\lim_{t \\to \\infty}\\left(\\left[-\\frac{ 1 }{ 2 \\cdot x^{2} }\\right]_{1}^{t}\\right)"],"matchType":"calculus"},"hint":{"message":["Now write the antiderivative for this integral."],"placement":"right"}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Now evaluate the limit to find the final answer and complete the problem."}],"waitForInput":true}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"end","data":null}]');
