INSERT INTO public.solution_tutorial_progress VALUES (531, 9, '2020-11-04 15:41:54', '[{"trigger":{"type":"questions","message":"In this activity, we will be examining curve sketching, concavity (upward and downward), as well as the inflection point.","video":{"content":"<grd-youtube-video video-id=\"CQI7kmRNWXU\" />","notes":"<a href=\"https://authoring.gradarius.com/notes/Topic%2015-%20Analyzing%20Graphs.pdf\" target=\"_blank\">Analyzing Graphs</a>","questionTimes":[659000,1238000]},"questions":[{"text":"Solve: <ltx>\\lim_{x \\to -\\infty} \\frac{1}{x}</ltx> <q-expression id=\"1\" />","successExplanation":"Correct! <ltx>\\lim_{x \\to -\\infty} \\frac{1}{x}=0</ltx>. One can estimate the limit numerically. You can evaluate the function by using inputs that get increasingly large in magnitude, but are negative. Notice, the outputs approach zero.","giveUpExplanation":"<ltx>\\lim_{x \\to -\\infty} \\frac{1}{x}=0</ltx>. One can estimate the limit numerically. You can evaluate the function by using inputs that get increasingly large in magnitude, but are negative. Notice, the outputs approach zero.","giveUpTrials":2,"inputs":[{"id":"1","type":"expression","mistakeExplanations":["Incorrect. Notice the limit is going to negative infinity. Try plugging in more and more negative values into the function. What to you get?","Incorrect. For example, <ltx>-\\frac{1}{1} &lt; -\\frac{1}{10} &lt; -\\frac{1}{100} &lt; 0</ltx>. What does this mean about the limit?"],"correctAnswers":["0"]}]},{"text":"<p><img src=\"https://authoring.gradarius.com/img/Topic_15_Analyzing_Graphs_1.png\" width=\"400px\" height=\"400px\"></p>What is the <ltx>\\lim_{x \\to 0} \\frac{1}{x}</ltx>? <q-single-choice id=\"1\" />","successExplanation":"Correct! For a limit to exist at a specific input, the right-handed limit and the left-handed limit of the function at that specific input must be the same value. <ltx>\\lim_{x \\to 0^+} \\frac{1}{x}=\\infty</ltx> and <ltx>\\lim_{x \\to 0^-} \\frac{1}{x}=-\\infty</ltx>","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":["Incorrect. Do not average the values of the limits. For a limit to exist at a specific input, the right-handed limit and the left-handed limit of the function at that specific input must be the same value.<br><br>",null,"For a limit to exist at a specific input, the right-handed limit and the left-handed limit of the function at that specific input must be the same value. <ltx>\\lim_{x \\to 0^+} \\frac{1}{x}=\\infty</ltx> and <ltx>\\lim_{x \\to 0^-} \\frac{1}{x}=-\\infty</ltx>.<br><br>","For a limit to exist at a specific input, the right-handed limit and the left-handed limit of the function at that specific input must be the same value. <ltx>\\lim_{x \\to 0^+} \\frac{1}{x}=\\infty</ltx> and <ltx>\\lim_{x \\to 0^-} \\frac{1}{x}=-\\infty</ltx>."],"options":["Zero","The limit does not exist","Infinity","Negative infinity"],"correctAnswers":[1]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"For the function <ltx>f(x) = x - ln(x)</ltx>, there exists an inflection point at <ltx>x =</ltx> _____.  If there are no inflection points, leave the answer placeholder blank."}],"waitForInput":true}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["f''(x) ="]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":2,"cellIndex":0},"result":["f''\\left(x\\right)=1-\\frac{1}{x}","f''\\left(x\\right)=1-\\frac{ 1 }{ x }"]},"hint":{"message":["You’ll need to find the second derivative. Start by finding the first derivative."],"placement":"right"}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["f''''(x) ="]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":3,"cellIndex":0},"result":["f''''\\left(x\\right)=\\frac{1}{x^2}","f''''\\left(x\\right)=\\frac{ 1 }{ x^{2} }"]},"hint":{"message":["The second derivative is <ltx>f''''(x) =</ltx> ___________ "],"placement":"right"}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":3,"cellIndex":0}}]},"hint":{"message":["The next step is to set the second derivative equal to zero and solve. Select the second derivative and use the Zeros action."],"placement":"top"}},{"trigger":{"type":"action","action":"ZerosFunc"},"hint":{"message":["The next step is to set the second derivative equal to zero and solve. Select the second derivative and use the Zeros action."],"placement":"left"}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Normally at this point you would find out the sign of the second derivative on either side of its zeros, but there are no places where the second derivative equals zero! What does this imply about this function’s inflection points? To answer, select the correct option in the final answer space."}],"waitForInput":true}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"end","data":null}]');
