INSERT INTO public.solution_tutorial_progress VALUES (505, 15, '2020-11-04 15:36:47', '[{"trigger":{"type":"message"},"hint":{"message":["Gradarius can help you catch mistakes the second you make them, and then offer coaching to fix the problem. Let’s see how this works."]}},{"trigger":{"type":"selection","items":[{"target":{"type":"problemCell","index":0}}]},"hint":{"message":["Start by copying the whole equation to a new row. Select the equation in the problem."],"placement":"bottom"}},{"trigger":{"type":"action","action":"copyToNewRow"},"hint":{"message":["Copy the equation to a new row."],"placement":"left","target":{"type":"unique","id":"fastActionNewRow"}}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["2 \\cdot x-4=1-\\left(x-4\\right)","2 \\cdot x-4=1-\\left(x-4\\right)"]},"hint":{"message":["Save your work."],"placement":"bottom"}},{"trigger":{"type":"cellAction","action":"rewrite","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0}},"hint":{"message":["Now, rewrite the equation to begin working with it."],"placement":"top"}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":1},"result":["2 \\cdot x-4=1-x-4","2x-4=1-x-4"]},"hint":{"message":["What happens if you make a mistake? Start to distribute the minus sign across the parentheses, but make a mistake by writing the right side as <ltx>-x-4</ltx>."],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":1},"result":["2\\cdot x-4=1-x-4","2 \\cdot x-4=1-x-4"]},"hint":{"message":["Save the equation."],"placement":"bottom"}},{"trigger":{"type":"click","target":{"type":"assist","status":"error","subtarget":"icon"}},"hint":{"message":["The red stop sign indicates something is wrong. You won’t lose any points when you see the red icon. But this will give you an opportunity to fix things! Try clicking on the stop sign icon to find out more information."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["When you click on the stop sign, Gradarius will try to give you an indication of where things went wrong. Here, it caught that there’s a problem with plus and minus signs."],"placement":"bottom","target":{"type":"assist","status":"error","subtarget":"area"}}},{"trigger":{"type":"click","target":{"type":"assistArea","status":"error"}},"hint":{"message":["Let’s say you need a little more info. Click “Show me more.”"],"placement":"bottom","target":{"type":"assistArea","status":"error"}}},{"trigger":{"type":"message"},"hint":{"message":["When you click “Show me more,” there will be more information on the mistake, along with coaching to get you back on track."],"placement":"bottom","target":{"type":"assistArea","status":"error"}}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":1},"result":["2 \\cdot x-4=1-x-4"]},"hint":{"message":["Now that we know what''s wrong, we can try to fix the error.","To edit a cell, click on the pencil icon in the upper left corner.<br><img width=\"302\" height=\"83\" alt=\"Hovering the cursor over a cell displays the pencil icon.\" src=\"http://i91.fastpic.ru/big/2017/0424/92/f44ca35566cab504b8f02c17a345ed92.gif\">"],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":1},"result":["2x-4=1-x+4","2 \\cdot x-4=1-x+4"]},"hint":{"message":["Change the right side of the equation to <ltx>1-x+4</ltx> and save your work"],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["When you do problems using pencil and paper, you don’t know whether you are making mistakes. When you write your work in Gradarius, it can catch mistakes and help you figure out how to fix them so that you get full credit for your problems."]}},{"trigger":{"type":"message"},"hint":{"message":["Now go ahead and finish the problem."]}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"goToStep","data":{"step":11}},{"event":"goToStep","data":{"step":12}},{"event":"goToStep","data":{"step":13}},{"event":"goToStep","data":{"step":14}},{"event":"goToStep","data":{"step":15}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (869, 8, '2020-11-04 15:36:29', '[{"trigger":{"type":"message"},"hint":{"message":["Welcome to Gradarius! These Tutorials will help you learn the fastest ways to enter your work. Take a look at this problem, and click “Got It” when you’re ready to start."],"placement":"bottom","target":{"type":"problemCell","index":0}}},{"trigger":{"type":"action","action":"addRow"},"hint":{"message":["We need a place to enter our work. Click on “Create new row”"],"placement":"left","target":{"type":"unique","id":"fastActionNewRow"}}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["-3 \\cdot x=9","-3x=9"]},"hint":{"message":["The “box” you just created is called a cell. Cells are where you can write equations or expressions. To solve this equation we might first subtract 6 from both sides. Please write the resulting equation, <ltx>-3 \\cdot x=9</ltx>, in the new row."],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["-3x=9","-3 \\cdot x=9"]},"hint":{"message":["Press enter on the keyboard or use the circular enter icon to save your work."],"placement":"bottom"}},{"trigger":{"type":"cellAction","action":"rewrite","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0}},"hint":{"message":["You want a space to begin writing the next simplification of the equation. To create a new cell, you have to hover the cursor over the green arrow. This will open a pop-up menu showing “Rewrite”. You can either click the arrow, or move the pointer down to “Rewrite” and click."],"placement":"top"}},{"trigger":{"type":"message"},"hint":{"message":["When you use Rewrite, Gradarius will rewrite the prior expression or equation for you. In many cases, this will make it faster to write because you can place the cursor where you want to make changes and edit the mathematics in the cell. However, if you''d like a blank cell, simply begin typing while the whole cell is highlighted and the existing math in the cell will go away."],"placement":"top","target":{"type":"expressionCell","rowIndex":0,"cellIndex":1}}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":1},"result":["x=-3"]},"hint":{"message":["If you divide both sides of <ltx>-3x=9</ltx> by <ltx>-3</ltx>, then the result is <ltx>x=-3</ltx>. Please edit the equation in the cell to read <ltx>x=-3</ltx>."],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":1},"result":["x=-3","x=-3"]},"hint":{"message":["Press enter on the keyboard or use the circular enter icon to save your work."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["Good! When you use Rewrite to continue your work across a row, Gradarius will be able to check your work as you go!"]}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":0,"cellIndex":1}}]},"hint":{"message":["OK! Now that you have the solution to the equation, you need to submit the answer. Select the object <ltx>x=-3</ltx> by clicking on it."],"placement":"right"}},{"trigger":{"type":"addFinalAnswer","placeholder":{"type":"placeholder","index":0}},"hint":{"message":["Click the plus icon to add <ltx>x=-3</ltx> to the answer space."],"placement":"right"}},{"trigger":{"type":"click","target":{"type":"unique","id":"faSubmit"}},"hint":{"message":["Now you can submit your answer."],"placement":"top"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"goToStep","data":{"step":11}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (513, 12, '2020-11-04 15:38:08', '[{"trigger":{"type":"message"},"hint":{"message":["This problem will show you how to enter one-sided limits in Gradarius. Basically, you work with each sub-function separately."],"placement":"bottom","target":{"type":"unique","id":"pd"}}},{"trigger":{"type":"selection","items":[{"target":{"type":"problemCell","index":1},"selection":"10^{x}"}]},"hint":{"message":["Select <ltx>10^x</ltx> in the piecewise function."],"placement":"bottom"}},{"trigger":{"type":"action","action":"LimFunc"},"hint":{"message":["Enter the function into a limit by searching for “Limit”"],"placement":"left"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["\\lim_{\\textcolor{edit}{10241}{x}\\to\\textcolor{edit}{10247}{0^-}}10^x","\\lim_{\\textcolor{edit}{10241}{x} \\to \\textcolor{edit}{10247}{0^{-}}}10^{x}"]},"hint":{"message":["Now you have to enter the point the limit is going to, but because this sub-function is used only for <ltx>x \\leq 0</ltx>, you need the left side limit: <ltx>0^-</ltx>. To enter left side limits you type the number, then “^-”. Type “0^-” then save your work."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":0,"cellIndex":0}}},{"trigger":{"type":"cellAction","action":"rewrite","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0}},"hint":{"message":["Choose rewrite."],"placement":"top"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":1},"result":["1","1"]},"hint":{"message":["This limit evaluates to 1. Type 1 and save your work."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":0,"cellIndex":1}}},{"trigger":{"type":"selection","items":[{"target":{"type":"problemCell","index":1},"selection":"x^{2}+1"}]},"hint":{"message":["Now you need the right-side limit. Select <ltx>x^2+1</ltx>."],"placement":"bottom"}},{"trigger":{"type":"action","action":"LimFunc"},"hint":{"message":["Enter it into a limit using the Limit action."],"placement":"left"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":1,"cellIndex":0},"result":["\\lim_{\\textcolor{edit}{15222}{x}\\to\\textcolor{edit}{15228}{0^+}}\\left(x^2+1\\right)","\\lim_{\\textcolor{edit}{15222}{x} \\to \\textcolor{edit}{15228}{0^{+}}}\\left(x^{2}+1\\right)"]},"hint":{"message":["To enter a right side limit, you type the number, then “^+”. Type “0^+” then save your work."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":1,"cellIndex":0}}},{"trigger":{"type":"cellAction","action":"rewrite","cell":{"type":"expressionCell","rowIndex":1,"cellIndex":0}},"hint":{"message":["Choose rewrite."],"placement":"top"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":1,"cellIndex":1},"result":["1","1"]},"hint":{"message":["This limit evaluates to 1. Type 1 and save your work."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":1,"cellIndex":1}}},{"trigger":{"type":"message"},"hint":{"message":["Now that you’ve calculated both limits, you can solve the problem. Use the box below to select the correct option."]}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"goToStep","data":{"step":11}},{"event":"goToStep","data":{"step":12}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (514, 9, '2020-11-04 15:38:16', '[{"trigger":{"type":"selection","items":[{"target":{"type":"problemCell","index":0}}]},"hint":{"message":["In this problem we will examine how to enter derivatives. You can either use the “Derivative” action, or if the variable is x, type “d/dx” to set up a derivative. First try the “Derivative” action. Select the function in the problem description."],"placement":"bottom"}},{"trigger":{"type":"action","action":"DerivFunc"},"hint":{"message":["Find and use the “Derivative” action with the search box."],"placement":"left"}},{"trigger":{"type":"message"},"hint":{"message":["This sets up a derivative of the function. Gradarius will check if you are setting up the derivative with respect to the correct variable. Check that the variable is correct."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":0,"cellIndex":0}}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["\\frac{ d  }{d \\textcolor{edit}{0}{x}}\\left(7 \\cdot x\\right)","\\frac{ d  }{d \\textcolor{edit}{0}{x}}\\left(7 \\cdot x\\right)"]},"hint":{"message":["The variable in the derivative should be “x”. If it’s correct, press enter."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":0,"cellIndex":0}}},{"trigger":{"type":"action","action":"addRow"},"hint":{"message":["You can use the shortcut “d/dx” to enter derivatives yourself. Start a new row."],"placement":"right","target":{"type":"unique","id":"fastActionNewRow"}}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":1,"cellIndex":0},"result":["\\frac{d}{dx}"]},"hint":{"message":["Type “d/dx” to set up derivative notation."],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":1,"cellIndex":0},"result":["\\frac{d}{dx}\\left(7\\cdot x\\right)","\\frac{ d  }{d x}\\left(7 \\cdot x\\right)"]},"hint":{"message":["Use the arrow keys or mouse to move out of the fraction, then type 7x and save your work. The cell should say d/dx 7x."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["The derivative is now set up. Be sure to check for multiplication signs when you are setting up derivatives. <ltx>\\frac{d}{d \\cdot x}</ltx> is not a derivative, it means d divided by d times x!"],"placement":"bottom","target":{"type":"expressionCell","rowIndex":1,"cellIndex":0}}},{"trigger":{"type":"message"},"hint":{"message":["Because rows are separate calculations inside Gradarius, you can now use either row to finish the problem."]}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (504, 11, '2020-11-04 15:36:37', '[{"trigger":{"type":"message"},"hint":{"message":["You can use copy and paste shortcuts to make writing solutions easier.<br>Begin this problem by distributing the 5 on the left-hand side of the equation."],"placement":"bottom","target":{"type":"unique","id":"pd"}}},{"trigger":{"type":"action","action":"addRow"},"hint":{"message":["Start a new row."],"placement":"left","target":{"type":"unique","id":"fastActionNewRow"}}},{"trigger":{"type":"cellEdit","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["5x-5="]},"hint":{"message":["Enter the expanded left-hand side of the equation, followed by an equal sign: <ltx>5x-5 =</ltx>."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["Now enter the right-hand side. But rather than type it, copy and paste it for practice."]}},{"trigger":{"type":"selection","items":[{"target":{"type":"problemCell","index":0},"selection":"4 \\cdot x-3"}]},"hint":{"message":["Select <ltx>4 \\cdot x-3</ltx> in the problem statement by dragging your cursor across it."],"placement":"bottom"}},{"trigger":{"type":"click","target":{"type":"unique","id":"copy"}},"hint":{"message":["Great! You can copy and paste <ltx>4 \\cdot x-3</ltx> to the right-hand side of your equation. Click the Copy icon."],"placement":"right"}},{"trigger":{"type":"click","target":{"type":"expressionCell","rowIndex":0,"cellIndex":0}},"hint":{"message":["Place your cursor to the right of the equal sign."],"placement":"bottom"}},{"trigger":{"type":"click","target":{"type":"unique","id":"paste"}},"hint":{"message":["Click the Paste icon."],"placement":"right"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["5x-5=4x-3","5 \\cdot x-5=4 \\cdot x-3"]},"hint":{"message":["Save your work."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["You can also copy and paste using keyboard shortcuts.<br><br>On a PC, use Ctrl-C and Ctrl-V to copy and paste, and Ctrl-Z to undo the last step.<br>On a Mac, use Cmd-C and Cmd-V to copy and past, and Cmd-Z to undo the last step."]}},{"trigger":{"type":"message"},"hint":{"message":["Now you know how to copy and paste mathematical expressions in Gradarius. Go ahead and finish the problem."]}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"goToStep","data":{"step":11}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (515, 5, '2020-11-04 15:38:22', '[{"trigger":{"type":"message"},"hint":{"message":["The “Differentiate” action lets you take derivatives of both sides of an equation quickly. It’s especially helpful with implicit differentiation."]}},{"trigger":{"type":"selection","items":[{"target":{"type":"problemCell","index":1}}]},"hint":{"message":["First, select the equation."],"placement":"bottom","target":{"type":"problemCell","index":1}}},{"trigger":{"type":"action","action":"DerEqn"},"hint":{"message":["Now use the search box to find and and use the “Differentiate” action."],"placement":"left"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":1},"result":["\\frac{d}{d\\textcolor{edit}{722}{x}}\\left(y^2-x\\cdot y\\right)=\\frac{d}{d\\textcolor{edit}{751}{x}}\\left(1\\right)","\\frac{ d  }{d \\textcolor{edit}{722}{x}}\\left(y^{2}-x \\cdot y\\right)=\\frac{ d  }{d \\textcolor{edit}{751}{x}}\\left(1\\right)"]},"hint":{"message":["There are two variables in this equation, so you must specify the variable for the derivative. Type <ltx>x</ltx> in both boxes, then save your work."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":0,"cellIndex":1}}},{"trigger":{"type":"message"},"hint":{"message":["You’ve set up derivatives on both sides of the equation. If an equation has two variables, it''s best to work with <ltx>\\frac{d}{dx}</ltx> notation so that Gradarius knows the variable of your derivative. Now you can finish the problem."]}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (516, 10, '2020-11-04 15:38:30', '[{"trigger":{"type":"message"},"hint":{"message":["Some problems may ask you to submit tables for your final answer. Doing things like finding extrema and curvature takes lots of information. You can use Analyze First Derivative or Analyze Second Derivative actions to create tables so you can summarize your work."]}},{"trigger":{"type":"selection","items":[{"target":{"type":"problemCell","index":0}}]},"hint":{"message":["Usually you’ll have to find critical points and intervals of increase/decrease on your own, but for this problem it’s already been done. To start analyzing, select the function."],"placement":"bottom"}},{"trigger":{"type":"selection","items":[{"target":{"type":"problemCell","index":0}},{"target":{"type":"problemCell","index":2}}]},"hint":{"message":["Select the critical point."],"placement":"bottom","target":{"type":"problemCell","index":2}}},{"trigger":{"type":"action","action":"addTablePropertiesFirstDerivative"},"hint":{"message":["Use the search box to find and use “Analyze First Derivative”."],"placement":"left"}},{"trigger":{"type":"message"},"hint":{"message":["The “Analyze First Derivative” action built a table to help summarize all of your work."],"placement":"bottom","target":{"type":"unique","id":"tableProperties"}}},{"trigger":{"type":"table","rowNumber":1,"columnNumber":1,"value":"-"},"hint":{"message":["You can enter the sign of the derivative in the interval with the drop down menu. The derivative was negative on the <ltx>\\oi{-\\infty,-1}</ltx> interval, so choose “-”."],"placement":"right","target":{"type":"unique","id":"tablePropertiesValues"}}},{"trigger":{"type":"table","rowNumber":2,"columnNumber":1,"value":"\\searrow"},"hint":{"message":["You can also enter whether the function was increasing or decreasing. A negative derivative means the function was decreasing on the <ltx>\\oi{-\\infty,-1}</ltx> interval. Choose the arrow pointing right and down."],"placement":"right","target":{"type":"unique","id":"tablePropertiesValues"}}},{"trigger":{"type":"table","rowNumber":1,"columnNumber":3,"value":"+"},"hint":{"message":["Fill in the sign of the derivative and increase/decrease for the <ltx>\\oi{-1,\\infty}</ltx> interval. The derivative was positive on this interval, so choose “+”."],"placement":"right","target":{"type":"unique","id":"tablePropertiesValues"}}},{"trigger":{"type":"table","rowNumber":2,"columnNumber":3,"value":"\\nearrow"},"hint":{"message":["The derivative was positive on the  <ltx>\\oi{-1,\\infty}</ltx> interval, which means the function was increasing. Choose the arrow pointing right and up."],"placement":"right","target":{"type":"unique","id":"tablePropertiesValues"}}},{"trigger":{"type":"message"},"hint":{"message":["Now all that’s left is to choose if the critical point was a maximum, minimum, or was not an extremum at all. Click the menu arrow in the second column to do this, and then “Select table” and copy it to the final answer to finish the problem."],"placement":"bottom","target":{"type":"unique","id":"tableProperties"}}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"end","data":null}]');
