INSERT INTO public.solution_tutorial_progress VALUES (526, 10, '2020-11-04 15:40:32', '[{"trigger":{"type":"questions","message":"In this activity, we will examine when the value of a function approaches positive or negative infinity, in which some functions are bounded by a vertical asymptote.","video":{"content":"<grd-youtube-video video-id=\"HsNRe3mOLPA\" />","notes":"<a href=\"https://authoring.gradarius.com/notes/2.2-Infinite-Limits.pdf\" target=\"_blank\">Notes</a>","questionTimes":[617000,1052000]},"questions":[{"text":"Why do we choose <ltx>\\delta = 0.001</ltx>? <q-single-choice id=\"1\" />","successExplanation":"Correct! <ltx>\\delta</ltx> shows us how close <ltx>x</ltx> is to zero. For the case <ltx>N = 100000000</ltx>, we choose <ltx>delta = 0.001</ltx> because <ltx>f(0.001) = 1000000</ltx>.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":[null,"Incorrect. <ltx>\\delta</ltx> shows us how close <ltx>x</ltx> is to zero. For the case <ltx>N = 100000000</ltx>, we choose <ltx>delta = 0.001</ltx> because <ltx>f(0.001) = 1000000</ltx>.","Incorrect. <ltx>\\delta</ltx> shows us how close <ltx>x</ltx> is to zero. For the case <ltx>N = 100000000</ltx>, we choose <ltx>delta = 0.001</ltx> because <ltx>f(0.001) = 1000000</ltx>."],"options":["Because <ltx>f(0.001) = 1000000</ltx>","Because <ltx>f(0.01) = 1000000</ltx>","Because <ltx>f(0.1) = 1000000</ltx>"],"correctAnswers":[0]}]},{"text":"What would <ltx>\\lim_{x\\to4^-}f(x)</ltx> have to be so that the limit as <ltx>x</ltx> approaches <ltx>4</ltx> of <ltx>f(x)</ltx> would exist? <q-expression id=\"1\" />","successExplanation":"Correct! In order for the limit <ltx>\\lim_{x\\to4}f(x)</ltx> to exist, <ltx>\\lim_{x\\to4^-}f(x)</ltx> has to equal <ltx>\\lim_{x\\to4^+}f(x)=1</ltx> in order to conclude that the limit of <ltx>f(x)</ltx> exists. ","giveUpExplanation":"In order for the limit <ltx>\\lim_{x\\to4}f(x)</ltx> to exist, <ltx>\\lim_{x\\to4^-}f(x)</ltx> has to equal <ltx>\\lim_{x\\to4^+}f(x)=1</ltx>. Therefore, the answer is <ltx>1</ltx>.","giveUpTrials":2,"inputs":[{"id":"1","type":"expression","mistakeExplanations":["Incorrect. What has to be true about the right and left-side limits so that the limit would exist?","Incorrect. In order for <ltx>\\lim_{x\\to4}f(x)</ltx> to exist, <ltx>\\lim_{x\\to4^-}f(x)</ltx> has to equal <ltx>\\lim_{x\\to4^+}f(x)</ltx>."],"correctAnswers":["1"]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Evaluate the limits <ltx>\\lim_{x\\to0^+}\\left(\\tan\\left(x-\\frac{\\pi}{2}\\right)\\right)</ltx> and <ltx>\\lim_{x\\to0^-}\\left(\\tan\\left(x-\\frac{\\pi}{2}\\right)\\right)</ltx>."}],"waitForInput":true}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":[" "]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":2,"cellIndex":0},"result":["\\tan\\left(x-\\frac{\\pi}{2}\\right)","\\tan\\left(x-\\frac{ \\pi }{ 2 }\\right)"]},"hint":{"message":["Let''s see the graph of the function. Please enter <ltx>\\tan\\left(x-\\frac{\\pi}{2}\\right)</ltx>."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":2,"cellIndex":0}}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":2,"cellIndex":0}}]},"hint":{"message":["Select the function and use the “Add function(s) to graph” action."],"placement":"bottom","persist":true}},{"trigger":{"type":"action","action":"addFunctionToGraph"}},{"trigger":{"type":"message"},"hint":{"message":["The effect of <ltx>-\\frac{\\pi}{2}</ltx> in the function is to shift the graph of <ltx>\\tan(x)</ltx>to the right by <ltx>\\frac{\\pi}{2}</ltx>. Here is the graph of <ltx>\\tan\\left(x-\\frac{\\pi}{2}\\right)</ltx>."],"placement":"top","target":{"type":"row","rowIndex":3}}},{"trigger":{"type":"addRows","rows":[{"type":"expressions","cells":["\\lim_{x\\to0^+}\\left(\\tan\\left(x-\\frac{\\pi}{2}\\right)\\right)"," "]}],"waitForInput":false}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":4,"cellIndex":1},"result":["-\\infty","-\\infty"]},"hint":{"message":["Evaluate this limit using the graph."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":4,"cellIndex":1}}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Now evaluate the left-side limit and submit your answers to complete the problem."}],"waitForInput":true}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (518, 14, '2020-11-04 15:38:51', '[{"trigger":{"type":"message"},"hint":{"message":["Integration by parts is the easiest way to solve some integrals. You can always enter your work by just adding new rows, but Gradarius has an integrate by parts action that can help you organize your work and avoid mistakes. Here’s how it works."]}},{"trigger":{"type":"selection","items":[{"target":{"type":"problemCell","index":0}}]},"hint":{"message":["Select the integral."],"placement":"bottom"}},{"trigger":{"type":"action","action":"PartsInt"},"hint":{"message":["The action search box will look for any match to what you’re typing. This means the fastest way to search is sometimes typing something that’s not used frequently. There are many “Integral” actions, so try typing “by” in the search box to find the “Integrate by parts” action."],"placement":"left"}},{"trigger":{"type":"cellSave","cell":{"type":"actionCell","rowIndex":0,"paramId":"u_x"},"result":["x","x"]},"hint":{"message":["You created a subproblem to do the integration by parts. Choice of <ltx>u</ltx> and <ltx>v’</ltx> are very important in integration by parts. For this problem, the best choice is <ltx>u=x</ltx>, <ltx>v’=e^x</ltx>. Enter <ltx>x</ltx> in the first box and save your work."],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"actionCell","rowIndex":0,"paramId":"dv_x"},"result":["e^{x}","e^{x}"]},"hint":{"message":["Enter <ltx>e^x</ltx> in the second box and save your work."],"placement":"bottom"}},{"trigger":{"type":"cellAction","action":"rewrite","cell":{"type":"expressionCell","rowIndex":1,"cellIndex":1}},"hint":{"message":["Gradarius now sets up the rows to calculate <ltx>\\frac{du}{dx}</ltx> and <ltx>v</ltx>. The derivative of <ltx>x</ltx> is 1. Please use “Rewrite”."],"placement":"top"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":1,"cellIndex":2},"result":["1","1"]},"hint":{"message":["Enter 1 on this line."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":1,"cellIndex":2}}},{"trigger":{"type":"cellAction","action":"rewrite","cell":{"type":"expressionCell","rowIndex":2,"cellIndex":1}},"hint":{"message":["The integral of <ltx>e^x</ltx> is <ltx>e^x</ltx>. Use “Rewrite”."],"placement":"top"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":2,"cellIndex":2},"result":["e^x","e^{x}"]},"hint":{"message":["Enter <ltx>e^x</ltx> here. By convention, we do not enter the constant of integration here while doing integration by parts."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":2,"cellIndex":2}}},{"trigger":{"type":"cellAction","action":"rewrite","cell":{"type":"expressionCell","rowIndex":4,"cellIndex":0}},"hint":{"message":["Now we can rewrite the integral. The integration by parts formula is <ltx>\\int u \\cdot v’ dx = u \\cdot v - \\int u’ \\cdot v dx</ltx>. This indicates the next cell should read <ltx>x \\cdot e^x - \\int e^x dx</ltx>. Please rewrite the integral."],"placement":"top"}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":4,"cellIndex":1},"result":["xe^x-\\int e^xdx","x \\cdot e^{x}-\\int{e^{x} d x}"]},"hint":{"message":["Enter <ltx>x \\cdot e^x - \\int e^x dx</ltx> and then save your work."],"placement":"top","target":{"type":"expressionCell","rowIndex":4,"cellIndex":1}}},{"trigger":{"type":"cellAction","action":"addSubproblemResult","actionParameters":[{"key":"parameterId","value":"result"}],"cell":{"type":"expressionCell","rowIndex":4,"cellIndex":1}},"hint":{"message":["The last step in a subproblem is to save your result. Roll over the equals sign and choose “Add result”."],"placement":"top"}},{"trigger":{"type":"click","target":{"type":"unique","id":"subproblemDone"}},"hint":{"message":["Click done."],"placement":"top"}},{"trigger":{"type":"message"},"hint":{"message":["You’ve completed the integration by parts! You now have an easy to calculate integral. You can finish this problem."]}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"goToStep","data":{"step":11}},{"event":"goToStep","data":{"step":12}},{"event":"goToStep","data":{"step":13}},{"event":"goToStep","data":{"step":14}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (508, 13, '2020-11-04 15:37:17', '[{"trigger":{"type":"message"},"hint":{"message":["Suppose you are assigned a problem and you get stuck. Gradarius allows you to chat with your instructor or teaching assistant. Go ahead and get this problem started. "]}},{"trigger":{"type":"selection","items":[{"target":{"type":"problemCell","index":0}}]},"hint":{"message":["Select the equation."],"placement":"right"}},{"trigger":{"type":"action","action":"copyToNewRow"},"hint":{"message":["Copy the equation to a new row."],"placement":"right","target":{"type":"unique","id":"fastActionNewRow"}}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["\\frac{ x^{2}-3 \\cdot x-4 }{ x^{2}+1 }=0","\\frac{ x^{2}-3 \\cdot x-4 }{ x^{2}+1 }=0"]},"hint":{"message":["Save your work."],"placement":"bottom"}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":0,"cellIndex":0}}]},"hint":{"message":["To solve for <ltx>x</ltx>, you might choose to multiply both sides of the equation by <ltx>x^2+1</ltx>. Gradarius has “Actions” that you can use to make solving equations faster. To use an action, begin by selecting the equation you want to take an action on."],"placement":"bottom"}},{"trigger":{"type":"action","action":"MultEqn"},"hint":{"message":["Without moving your cursor, begin typing “Multiply by” and you will see the typed text appear in the search box. You do not need to move your cursor to the search box - as soon as an object selection is made, your typing will appear in the search box.<br>Use the up and down arrows to highlight the action you’d like to take (Multiply by). Then press enter to select this action."],"placement":"left","target":{"type":"actions"}}},{"trigger":{"type":"cellEdit","cell":{"type":"actionCell","rowIndex":1,"paramId":"t"},"result":["x^{2}+1"]},"hint":{"message":["Type <ltx>x^2+1</ltx> to multiply by this expression on both sides."],"placement":"bottom"}},{"trigger":{"type":"cellSave","cell":{"type":"actionCell","rowIndex":1,"paramId":"t"},"result":["x^{2}+1","x^{2}+1"]},"hint":{"message":["Good! Press enter to complete the action."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["Suppose that you’re a bit stuck at this point and would like to contact your instructor or teaching assistant.","Gradarius has a chat tool that you can use to ask your instructor questions. To access the chat tool, click on the chat icon in the upper right corner of the side menu.<br><img width=\"499\" height=\"290\" src=\"/controller/tutorials/tutorial 15.gif\" alt=\"Clicking on the message tab, and a message is typed and sent to the instructor. The instructor replies.\">"]}},{"trigger":{"type":"click","target":{"type":"chat"}},"hint":{"message":["Now you try it! Click on the messages tab."],"placement":"left"}},{"trigger":{"type":"chatMessage","response":"Hi, glad you found the chat tool!","responseUser":{"id":-1000,"name":"Instructor Instructor","firstName":"Instructor","lastName":"Instructor","email":"instructor@graradius.com"}},"hint":{"message":["Type the message “Just trying out the chat tool.” and send the message."],"placement":"left"}},{"trigger":{"type":"message"},"hint":{"message":["Your instructor will see the message."],"placement":"left","target":{"type":"chat","subtarget":"input"}}},{"trigger":{"type":"message"},"hint":{"message":["Go ahead and finish this problem."]}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"goToStep","data":{"step":10}},{"event":"goToStep","data":{"step":11}},{"event":"goToStep","data":{"step":12}},{"event":"goToStep","data":{"step":13}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (524, 4, '2020-11-04 15:39:58', '[{"trigger":{"type":"questions","message":"In this activity, we will be examining continuity specifically focusing on continuity from one side, discontinuity and types of discontinuity. We will also look at the holes and gaps in the domain of a function and the local nature of continuity.","video":{"content":"<grd-youtube-video video-id=\"6t-AisEx3vU\" />","notes":"Notes: <a href=\"https://authoring.gradarius.com/notes/Topic 2_%20Limits%20and%20Continuity.pdf\" target=\"_blank\">Limits and Continuity</a>","questionTimes":[449000,798000]},"questions":[{"text":"<p><grd-intro-img width=\"400\" height=\"400\" alt=\"Action\">q1</grd-intro-img></p>True or False? This function <ltx>(f(x)=\\frac{1}{x})</ltx> is continuous on its domain. <q-single-choice id=\"1\" />","successExplanation":"Correct! The only possible location of a discontinuity would be at <ltx>x=0</ltx>, but <ltx>0</ltx> is not in the domain of the function.","giveUpTrials":0,"inputs":[{"id":"1","type":"choice","mistakeExplanations":[null,"Incorrect. The only possible location of a discontinuity would be at <ltx>x=0</ltx>, but <ltx>0</ltx> is not in the domain of the function."],"options":["True","False"],"correctAnswers":[0]}]},{"text":"<p><grd-intro-img width=\"400\" height=\"400\" alt=\"Action\">q2</grd-intro-img></p>For what values of <ltx>t</ltx> is the function <ltx>g(t) = \\frac{4t + 10}{t^{2}-2t-15}</ltx> not continuous? <br><ltx>t=</ltx><q-expression id=\"1\" />, <ltx>t=</ltx><q-expression id=\"2\" />","successExplanation":"Correct! Rational functions are not continuous at those inputs that force the function''s equation to be divided by zero. Look at the denominator. <ltx>t^{2}-2t-15 = (t-5)(t+3)</ltx>, thus the denominator is zero at <ltx>t = -3,</ltx> <ltx>5</ltx>.","giveUpTrials":0,"inputs":[{"id":"1","type":"expression","poolId":"pool"},{"id":"2","type":"expression","poolId":"pool"}],"pools":[{"id":"pool","mistakeExplanations":["Partially correct. Rational functions are not continuous at those inputs that force the function''s equation to be divided by zero. Look at the denominator: <ltx>t^2-2t-15 = (t-5)(t+3)</ltx>. The denominator is zero at <ltx>t=-3</ltx> and <ltx>t=5</ltx>, thus the function is not continuous at these points.","Incorrect. In this graph, the limit does not exist at two points because the limit from the left side is different from the limit from the right. One of those points is <ltx>t=5</ltx>. What is the other point?"],"correctAnswers":["5","-3"]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"Determine what, if any, value to assign to <ltx>f(a)</ltx> to make <ltx>f(x) = \\frac{x^2 - 2x - 8}{x-4}</ltx> continuous at <ltx>x = a</ltx>."}],"waitForInput":true}},{"trigger":{"type":"questions","questions":[{"text":"<p><img src=\"https://authoring.gradarius.com/img/Topic_2_Continuity_Part_A_3.png\" width=\"300\" height=\"300\"></p>Here’s a graph of the function <ltx>f(x)</ltx>. You can also create a graph using the Add to Graph Action, but it does not show holes. What is the point at which the function is undefined?  <q-expression id=\"1\" />","successExplanation":"Correct! There is a hole in the graph of <ltx>f(x)</ltx>, and it is undefined at <ltx>x=4</ltx>.","giveUpTrials":0,"inputs":[{"id":"1","type":"expression","mistakeExplanations":["Incorrect. For instance, a function would be undefined at points where there is a hole in the graph or the graph goes to <ltx>\\infty</ltx>.","Incorrect. The circle on the graph represents a hole where the function is undefined. What is the <ltx>x</ltx> value there?","Incorrect. There is a hole in the graph of <ltx>f(x)</ltx>, and it is undefined at <ltx>x=4</ltx>."],"correctAnswers":["4","x = 4"]}]}]}},{"trigger":{"type":"addRows","rows":[{"type":"comment","text":"If you want the function in the graph to be continuous at <ltx>x=4</ltx>, and you want to plug the hole, what value would you use to fill the gap? Enter your answer in the final answer space to complete the activity."}],"waitForInput":false}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"end","data":null}]');
INSERT INTO public.solution_tutorial_progress VALUES (509, 9, '2020-11-04 15:37:24', '[{"trigger":{"type":"message"},"hint":{"message":["To solve this problem, it would be helpful to square both sides of the equation. To do this quickly, you can use the Gradarius action “Raise to power”."],"placement":"bottom","target":{"type":"unique","id":"pd"}}},{"trigger":{"type":"selection","items":[{"target":{"type":"problemCell","index":0}}]},"hint":{"message":["Select the equation."],"placement":"right"}},{"trigger":{"type":"action","action":"copyToNewRow"},"hint":{"message":["Copy the equation to a new row."],"placement":"right","target":{"type":"unique","id":"fastActionNewRow"}}},{"trigger":{"type":"cellSave","cell":{"type":"expressionCell","rowIndex":0,"cellIndex":0},"result":["\\sqrt{x+3}=5","\\sqrt{x+3}=5"]},"hint":{"message":["Save your work."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["Gradarius has several “Equation Actions” to help you work efficiently as you solve equations. Let’s look at a few of these.","The Action “Add” quickly adds the same term to both sides of the equation. To use an equation action, select the equation and then just start typing “Add.” You do not need to move your cursor to the search box!<br><img width=\"710\" height=\"429\" src=\"http://i86.fastpic.ru/big/2017/0501/44/1b1207fc6ac380d8a8065818e503fc44.gif\" alt=\"An equation is selected, and the letters A D D are typed. The “Add” action is chosen from the list, and a number is added to both sides of the equation.\">","You can also use “Add” to subtract a number - just add a negative number on both sides. Remember that you don’t need to move your cursor to the search box! Just select the equation and start typing the name of the action you want to use.<br><img width=\"752\" height=\"484\" src=\"http://i86.fastpic.ru/big/2017/0501/f5/cd5eafafa8dc93209422c597e544f2f5.gif\" alt=\"An equation is selected, and the letters A D D are typed. The “Add” action is chosen from the list, and a negative number is added to both sides of the equation.\">","The equation action “Multiply by” can be used to multiply both sides of an equation by a number or an expression. In the search box, you can use the down and up arrows to move through the list. Press enter to select the action you want to use.<br><img width=\"426\" height=\"230\" src=\"http://i91.fastpic.ru/big/2017/0511/14/0e36371682651799e66b512ba243c114.gif\" alt=\"An equation is selected, and the letters M U L are typed. The “Multiply by” action is chosen from the list, and both sides of the equation are multiplied by a number.\">","“Raise to power” raises both sides of the equation to a power of your choice.<br><img width=\"708\" height=\"384\" src=\"http://i86.fastpic.ru/big/2017/0501/36/14e864e348f39f146ace50413cff6f36.gif\" alt=\"An equation is selected, and the letters R A I are typed. The “Raise to power” action is chosen from the list, and both sides of the equation are raised to a power.\">","Now you’ll try using an equation action!"]}},{"trigger":{"type":"selection","items":[{"target":{"type":"expressionCell","rowIndex":0,"cellIndex":0}}]},"hint":{"message":["Select the equation."],"placement":"right"}},{"trigger":{"type":"action","action":"RaiseToPowerEqn"},"hint":{"message":["Without moving your cursor anywhere, start typing “Raise to power”. You will see the search text appear in the search box. When you see the right action, select it."],"placement":"right"}},{"trigger":{"type":"cellSave","cell":{"type":"actionCell","rowIndex":1,"paramId":"t"},"result":["2","2"]},"hint":{"message":["Square both sides of the equation (place a <ltx>2</ltx> in the box and press enter)."],"placement":"bottom"}},{"trigger":{"type":"message"},"hint":{"message":["Now that both sides of the equation are squared, go ahead and finish solving the problem."],"placement":"bottom","target":{"type":"expressionCell","rowIndex":0,"cellIndex":1}}},{"trigger":{"type":"freeSolve"}}]', '[{"event":"start","data":null},{"event":"goToStep","data":{"step":0}},{"event":"goToStep","data":{"step":1}},{"event":"goToStep","data":{"step":2}},{"event":"goToStep","data":{"step":3}},{"event":"goToStep","data":{"step":4}},{"event":"goToStep","data":{"step":5}},{"event":"goToStep","data":{"step":6}},{"event":"goToStep","data":{"step":7}},{"event":"goToStep","data":{"step":8}},{"event":"goToStep","data":{"step":9}},{"event":"end","data":null}]');
