INSERT INTO public.wikis VALUES (1, '<p>Definition text&nbsp;<ltx status="ok" id="fde77896-0">x^{2}</ltx></p>');
INSERT INTO public.wikis VALUES (2, '<p>Find the integral of <ltx status="ok" id="67c0d2a8-0">f\left(x\right)=x</ltx>&nbsp;from <ltx status="ok" id="67c0d2a8-1">a=1</ltx>&nbsp;to <ltx status="ok" id="67c0d2a8-2">b=3</ltx>. Simplify your answer.</p>');
INSERT INTO public.wikis VALUES (3, '<p>Let&nbsp;<ltx status="ok" id="3cbeafca-0">f\left(x\right)=2 \cdot x+3</ltx>. Find&nbsp;<ltx status="ok" id="3cbeafca-1">f\left(x-3\right)-f\left(x\right)</ltx>.</p>');
INSERT INTO public.wikis VALUES (4, '<p>Solve the equation&nbsp;<ltx status="ok" id="def48d96-0">\sqrt{x+3}=5</ltx>.</p>');
INSERT INTO public.wikis VALUES (5, '<p>Consider the linear equation&nbsp;<ltx status="ok" id="6bc7ab9f-0">4 \cdot x+2 \cdot y=10</ltx>.</p><p></p><ol class="lower-alpha"><li>Rewrite <ltx status="ok" id="6bc7ab9f-1">4 \cdot x+2 \cdot y=10</ltx>&nbsp;in slope-intercept form.<br></li><li>What is the slope of the line?<br></li></ol><p></p>');
INSERT INTO public.wikis VALUES (6, '<p>Does the limit at <ltx status="ok" id="a687d5f4-0">x=0</ltx>&nbsp;exist for <ltx status="ok" id="a687d5f4-1">f\left(x\right)=\begin{cases} 10^{x}, &amp; x \le 0 \\ x^{2}+1, &amp; x&gt;0 \end{cases}</ltx>.</p>');
INSERT INTO public.wikis VALUES (7, '<h3>Learning Objectives</h3><p>By the end of this topic you will be able to:&nbsp;</p><ul><li>Identify integration problems that are efficiently solved by integration by parts.<br></li><li>Compute indefinite integrals by parts, making the needed substitutions explicit.<br></li></ul><h3>Concepts and Skills</h3><p></p><ul><li>Understand that the process is just the inverse of differentiating a product, i.e. the integral form of the product rule for differentiation<br></li><li>There may be several choices for the needed substitutions; experience will help decide which are a better choice<br></li></ul><p></p>');
INSERT INTO public.wikis VALUES (8, '<p>Solve the equation&nbsp;<ltx status="ok" id="a65d91d1-0">2 \cdot \left(x^{2}-4 \cdot x\right)=3 \cdot x^{2}-\left(x^{2}+4\right)</ltx>.</p>');
INSERT INTO public.wikis VALUES (9, '<p>Solve the equation <ltx status="ok" id="8ad98e03-0">-3 \cdot x+6=15</ltx>.</p>');
INSERT INTO public.wikis VALUES (10, '<p>Learning Objectives</p><h3>By the end of this topic, you should be able to:</h3><ul><li>Determine graphically, numerically and algebraically where a function has an infinite limit.<br></li><li>Determine graphically, numerically and algebraically the limit at&nbsp;<ltx status="ok" id="cd866b65-0">\infty</ltx> and the limit at&nbsp;<ltx status="ok" id="cd866b65-1">-\infty</ltx> of a function.<br></li><li>Find vertical and horizontal asymptotes for the graph of a given function.<br></li><li>Demonstrate fluency in number sense for products and quotients of very small and very large numbers, as well as for sums and differences of numbers that are very close.<br></li></ul><h3>Concepts and Skills</h3><ul><li>Infinite limit at a number<br></li><li>Vertical asymptote<br></li><li>Limit at infinity<br></li><li>Horizontal asymptote<br></li></ul>');
INSERT INTO public.wikis VALUES (11, '<p>Solve the equation&nbsp;<ltx status="ok" id="14e3034e-0">2 \cdot x+3=4 \cdot x-9</ltx>.</p>');
INSERT INTO public.wikis VALUES (12, '<p>Solve the equation <ltx status="ok" id="f3635296-0">\frac{ x^{2}-3 \cdot x-4 }{ x^{2}+1 }=0</ltx>.</p>');
INSERT INTO public.wikis VALUES (13, 'Compute first derivative of <ltx id="!problemCell1" status="ok">s^{3}</ltx>.');
INSERT INTO public.wikis VALUES (14, '<p>Find&nbsp;<ltx status="ok" id="a7cba56f-0">\int{\frac{ x }{ x^{2}+1 } d x}</ltx>.</p>');
INSERT INTO public.wikis VALUES (15, '<p>test</p>');
INSERT INTO public.wikis VALUES (16, '<h3>Learning Objectives</h3><p>By the end of this topic you will be able to:</p><ul><li>Evaluate definite integrals using antiderivatives.<br></li><li>Use the Fundamental Theorem of Calculus to find definite integrals exactly.<br></li><li>Find the exact rate-of-change function for a given accumulation function given in open form (i.e. as a definite integral with variable upper limit of integration).&nbsp;<br></li></ul><h3>Concepts and Skills&nbsp;</h3><ul><li>The rate of change of the accumulation function of some varying quantity (dependent variable) is the current value of that quantity.&nbsp;<br></li><li>Exact Definite Integrals&nbsp;<br></li><li>The Fundamental Theorem of Calculus<br></li></ul>');
INSERT INTO public.wikis VALUES (17, '<p>Solve the equation <ltx status="ok" id="57adc8a3-0">5 \cdot \left(x-1\right)=4 \cdot x-3</ltx>.</p>');
INSERT INTO public.wikis VALUES (18, '<p>Examine the function <ltx status="ok" id="959e686c-0">f\left(x\right)=\frac{ 1 }{ 2 } \cdot x^{2}+x</ltx> and its derivative <ltx status="ok" id="959e686c-1">f''\left(x\right)=x+1</ltx>. There is a critical point at <ltx status="ok" id="959e686c-2">x=-1</ltx>. <ltx status="ok" id="959e686c-3">f''\left(x\right)&lt;0</ltx>&nbsp;for points to the left of the critical point, and <ltx status="ok" id="959e686c-4">f''\left(x\right)&gt;0</ltx>&nbsp;for points to the right of the critical point. Submit an Analyze First Derivative table that summarizes this information and shows whether the critical point was a min, max, or not an extremum.<br></p>');
INSERT INTO public.wikis VALUES (19, '<p>Solve the inequality <ltx status="ok" id="ed693b53-0">4 \cdot x+1 \le 9</ltx>. Write the solution in interval notation.</p>');
INSERT INTO public.wikis VALUES (20, '<p>Find the zeros of <ltx status="ok" id="1a3e4609-0">f\left(x\right)=x^{3}-6 \cdot x^{2}+11 \cdot x-6</ltx>.</p>');
INSERT INTO public.wikis VALUES (21, '<p>Solve the equation&nbsp;<ltx status="ok" id="4726f4c7-0">3 \cdot x^{2}-7 \cdot x+2=0</ltx>.</p>');
INSERT INTO public.wikis VALUES (22, '<h3>Learning Objectives</h3><p>By the end of this topic you will be able to:</p><ul><li>Compute the area between two curves, including cases where limits of integration need to be found by solving equations.</li></ul><h3>Concepts and Skills</h3><ul><li>Area is an accumulation of lengths</li><li>Understand this is just the accumulation of functional values given by the length of the vertical segments separating the enclosing curves. This can then be transformed into a definite integral.</li></ul>');
INSERT INTO public.wikis VALUES (23, '<p>Let <ltx status="ok" id="f002ab8e-0">\vec{a}=\left\langle 1,0 \right\rangle</ltx>&nbsp;and <ltx status="ok" id="f002ab8e-1">\vec{b}=\left\langle 0,2 \right\rangle</ltx>. What is the length of <ltx status="ok" id="f002ab8e-2">\vec{c}=\vec{a}+\vec{b}</ltx>?<br></p>');
INSERT INTO public.wikis VALUES (24, '<p>Find the limit as <ltx status="ok" id="e09f7bb8-0">f\left(x\right)=x^{2}+3 \cdot x</ltx>&nbsp;goes to 3.</p>');
INSERT INTO public.wikis VALUES (25, '<p>Let <ltx status="ok" id="9ec0b57e-0">f\left(x\right)=x^{2}-9</ltx>&nbsp;and <ltx status="ok" id="9ec0b57e-1">g\left(x\right)=x+3</ltx>. Find <ltx status="ok" id="9ec0b57e-2">\frac{ f\left(x\right) }{ g\left(x\right) }</ltx>&nbsp;and simplify.</p>');
INSERT INTO public.wikis VALUES (26, '<h3>Learning Objectives</h3><p>By the end of this module you should be able to:</p><ul><li>Evaluate numerically and graphically the (one- and two-sided) limit of a function at a number.<br></li><li>Algebraically evaluate the (one- and two-sided) limit of a function at a number.<br></li><li>Explain and exemplify all possible cases for why a limit fails to exist.<br></li><li>Create examples of functions that have a limit at a number but fail to have it at another fixed number as close to the first one as desired.<br></li></ul><h3>Concepts and Skills</h3><ul><li>The limit of a function<br></li><li>Existence and non-existence of a limit<br></li><li>Local nature of the limit<br></li></ul><p><br></p>');
INSERT INTO public.wikis VALUES (27, '<p>Find the derivative of <ltx status="ok" id="1af5c93f-0">f\left(x\right)=7 \cdot x</ltx>.</p>');
INSERT INTO public.wikis VALUES (52, '<p>Find <ltx status="ok" id="9cb2dd9f-0">\int{x \cdot e^{x} d x}</ltx>.<br></p>');
INSERT INTO public.wikis VALUES (421, '<placeholder wiki-id="answer_1"></placeholder>');
INSERT INTO public.wikis VALUES (28, '<p><span style="font-weight: bold;">Learning objectives:</span></p><ul><li>Know the definition of polynomial function.<br></li><li>Know the end behavior of polynomial function.<br></li><li>Know at most how many zeros a polynomial of degree&nbsp;<ltx status="ok" id="ab26a06c-0">n</ltx> can have.<br></li><li>Find a formula for a polynomial function given by a list of conditions (including a graph).<br></li></ul><p><span style="font-weight: bold;">The main problem of the activity:</span></p><p>Find a formula for a polynomial of degree&nbsp;<ltx status="ok" id="ab26a06c-1">3</ltx> with constant coefficient&nbsp;<ltx status="ok" id="ab26a06c-2">6</ltx> and zeros <ltx status="ok" id="ab26a06c-3">\frac{ 1 }{ 2 }</ltx>, <ltx status="ok" id="ab26a06c-4">1</ltx>, and <ltx status="ok" id="ab26a06c-5">-2</ltx>.</p>');
INSERT INTO public.wikis VALUES (29, '<p>Solve the equation <ltx status="ok" id="1b1c3944-0">2 \cdot x-4=1-\left(x-4\right)</ltx>.</p>');
INSERT INTO public.wikis VALUES (30, '<h3>Learning Objectives</h3><p>By the end of this topic you will be able to:</p><p></p><ul><li>Understand the relation between the sign of the derivative of a function and the increasing/decreasing nature of the function.<br></li><li>Find local and global extrema of functions.<br></li><li>Explain the connection between the instantaneous rate of change of a function and its increasing/decreasing nature.<br></li></ul><p></p><h3>Concepts and Skills</h3><ul><li>Local maximum and local minimum<br></li><li>Global maximum and global minimum<br></li><li>Critical numbers<br></li><li>Extreme value theorem<br></li><li>First Derivative Test<br></li><li>Second Derivative Test<br></li></ul>');
INSERT INTO public.wikis VALUES (31, '<h3>Learning Objectives&nbsp;</h3><p>&nbsp;By the end of this topic you will be able to:</p><p></p><ul><li>Use the First and Second Derivative Test to help determine the shape of the graph of a function.&nbsp;<br></li><li>Use limits and derivatives to find the largest intervals of increase/decrease, local and global extrema, intervals of concavity (upward and downward), inflection points, and vertical and horizontal asymptotes of graphs of functions.&nbsp;<br></li><li>Deduce properties about the first and second derivatives of a function from its graph.&nbsp;<br></li></ul><p></p><h3>Concepts and Skills&nbsp;</h3><ul><li>Curve sketching&nbsp;<br></li><li>Concavity (upward and downward)&nbsp;<br></li><li>Inflection point<br></li></ul>');
INSERT INTO public.wikis VALUES (32, '<p>Find <ltx status="ok" id="eb11dd0f-0">\frac{ d y }{d x}</ltx> if <ltx status="ok" id="eb11dd0f-1">y^{2}-x \cdot y=1</ltx>.</p>');
INSERT INTO public.wikis VALUES (33, '<p>test</p>');
INSERT INTO public.wikis VALUES (34, '<p><ltx id="1443c25e" status="ok">x+1</ltx></p>');
INSERT INTO public.wikis VALUES (35, '<h3>Learning Objectives</h3><p>By the end of this topic you will be able to:</p><ul><li>Evaluate improper integrals of both types or decide that they diverge.<br></li></ul><h3>Concepts and Skills</h3><p></p><ul><li>Understand that there are two different types, depending on whether the interval of integration is finite or infinite. In either case, there may be convergence (to a finite limit) or divergence.&nbsp;<br></li><li>Improper integrals are computed as limits of proper ones (that is, integrals of bounded, piecewise continuous functions, over finite intervals)<br></li></ul><p></p>');
INSERT INTO public.wikis VALUES (36, '<p>Consider <ltx status="ok" id="9ba828a6-0">f\left(x\right)=x^{2}-4 \cdot x-5</ltx>.</p><p></p><ol class="lower-alpha"><li>Find the y-intercept and write it as a point.<br></li><li>Write the points that are x-intercept(s) of <ltx status="ok" id="9ba828a6-1">f\left(x\right)</ltx>.<br></li></ol><p></p>');
INSERT INTO public.wikis VALUES (37, '<span style="font-weight: bold;">Learning Objectives</span><p><span style="font-weight: bold;">By the end of this topic, you should be able to:</span></p><ul><li>Determine graphically, numerically and algebraically where a function has an infinite limit.<br></li><li>Determine graphically, numerically and algebraically the limit at <ltx status="ok" id="1be6bb46-0">\infty</ltx> and the limit at <ltx status="ok" id="1be6bb46-1">-\infty</ltx> of a function.&nbsp;</li><li>Find vertical and horizontal asymptotes for the graph of a given function.<br></li><li>Demonstrate fluency in number sense for products and quotients of very small and very large numbers, as well as for sums and differences of numbers that are very close.<br></li></ul><p><span style="font-weight: bold;">Concepts and Skills</span></p><ul><li>Infinite limit at a number<br></li><li>Vertical asymptote&nbsp;</li><li>Limit at infinity<br></li><li>Horizontal asymptote<br></li></ul>');
INSERT INTO public.wikis VALUES (38, '<p>Given&nbsp;<ltx status="ok" id="8ebb2f55-0">R\left(x\right)=\frac{ 1 }{ 2 } \cdot \left(8 \cdot x-x^{2}\right)</ltx> and&nbsp;<ltx status="ok" id="8ebb2f55-1">C\left(x\right)=10+x</ltx>, find&nbsp;<ltx status="ok" id="8ebb2f55-2">P\left(x\right)=R\left(x\right)-C\left(x\right)</ltx>.</p>');
INSERT INTO public.wikis VALUES (39, '<p>Let&nbsp;<ltx status="ok" id="ee967084-0">f\left(x\right)=x^{2}-4 \cdot x</ltx>. Find&nbsp;<ltx status="ok" id="ee967084-1">f\left(-1\right)</ltx>.</p>');
INSERT INTO public.wikis VALUES (40, '<p>Consider <ltx status="ok" id="e8304e18-0">f\left(x\right)=\left|x-2\right|</ltx>.<br></p><p></p><ol class="lower-alpha"><li>Find the point where <ltx status="ok" id="e8304e18-1">f\left(x\right)</ltx>&nbsp;crosses the y-axis.<br></li><li>State the domain of <ltx status="ok" id="e8304e18-2">f\left(x\right)</ltx>&nbsp;in interval notation.<br></li><li>State the range of <ltx status="ok" id="e8304e18-3">f\left(x\right)</ltx>&nbsp;in interval notation.</li></ol><p></p>');
INSERT INTO public.wikis VALUES (41, '<p>Solve the equation <ltx status="ok" id="f216c1e9-0">e^{0.05 \cdot t}=2</ltx>.</p>');
INSERT INTO public.wikis VALUES (42, '<p>Solve the equation <ltx status="ok" id="7d7b0c43-0">10=4-2 \cdot x</ltx>.</p>');
INSERT INTO public.wikis VALUES (43, '<p>Simplify <ltx status="ok" id="d907b7ff-0">\frac{ x^{2}-3 \cdot x-4 }{ 2 \cdot x-8 }</ltx>.</p>');
