INSERT INTO public.wikis VALUES (48, '<p>In this activity, you’ll learn how to use trigonometric functions to model real-life phenomena. Many things in life are periodic (think about your heartbeat, or ocean tides, or the motion of a piston in an engine), and it often makes sense to model them using trigonometric functions, which are themselves periodic.</p><p></p>');
INSERT INTO public.wikis VALUES (49, '<p><span style="font-weight: bold;">Learning objectives:</span></p><ul><li>Learn the definition of the logarithm (including the graph, domain and range) as the inverse of exponential function.<br></li><li>Use logarithms to solve simple exponential equations.<br></li><li>Learn the basic properties of the logarithm.<br></li><li>Find out how to change the base in logarithm.<br></li></ul><p><span style="font-weight: bold;">The main problem of the activity:</span></p><p>Express <ltx status="ok" id="24de4f90-0">\log_{2}\left(x-1\right)+2 \cdot \log_{4}\left(x\right)-6 \cdot \log_{8}\left(x+1\right)</ltx>as a single logarithm with base<ltx status="ok" id="24de4f90-1">4</ltx>.<span style="font-weight: bold;"><br></span></p><p><br></p>');
