INSERT INTO public.wikis VALUES (53, '<h3>Learning Objectives</h3><p>By the end of this module you should be able to:</p><ul><li>Evaluate numerically and graphically the (one- and two-sided) limit of a function at a number.<br></li><li>Algebraically evaluate the (one- and two-sided) limit of a function at a number.<br></li><li>Explain and exemplify all possible cases for why a limit fails to exist.<br></li><li>Create examples of functions that have a limit at a number but fail to have it at another fixed number as close to the first one as desired.<br></li></ul><h3>Concepts and Skills</h3><ul><li>The limit of a function<br></li><li>Existence and non-existence of a limit<br></li><li>Local nature of the limit<br></li></ul><p><br></p>');
