INSERT INTO public.wikis VALUES (137, '<h3>Learning Objectives</h3><p>By the end of this topic you should be able to:</p><li>Determine graphically if a function is continuous at a number, and where the function is discontinuous.<br></li><li>Demonstrate understanding through examples of graphs that can be deceiving about continuity or discontinuity.<br></li><li>Identify the type of discontinuity a function has at a number and justify.<br></li><li>Create examples of functions that are continuous at a number but fail to be continuous at another fixed number as close to the first one as desired.</li><br><h3>Concepts and Skills</h3><ul style="color: rgb(51, 51, 51); font-size: 14px;"><li>Continuity<br></li><li>Continuity from one side<br></li><li>Discontinuity<br></li><li>Types of discontinuity<br></li><li>“Holes” and “gaps” in the domain of a function<br></li><li>Local nature of continuity</li></ul><p></p>');
